(95, 'vedantjohnsharma@gmail.com', 'Thank you for the clarification.<br />\n<br />\nSo if I wish to register a NGO I have to fill the CAF as Society. Please<br />\ncorrect me if I am wrong.<br />\n<br />\nOn Tue, Sep 4, 2018 at 6:07 PM EODB Government of Assam <<br />\nsupport@easeofdoingbusinessinassam.in> wrote:<br />\n<br />\n> This is not an error, this is an alert message showing that you can not<br />\n> fill this application because your business entity is proprietorship and<br />\n> this application form is only for cooperative societies not proprietorship<br />\n> firms.<br />\n', '5B8E2DBA43559', '2018-09-04 19:17:09'),
