(152, 'kmmtejaswi@AAI.AERO', 'Sir,<br />\n Kind Reminder :<br />\n<br />\nPlease refer the trailing mail.<br />\nIn view of urgency , payment has been made once again against the UAIN No : CEI/F16/DI/000006/10/2018 unknowing the fact that it will take 3 working days for confirmation of the application. The application is processed. Please clarify about the payment made second time whether it will be refunded..<br />\n<br />\n Thanks & Regards<br />\n<br />\nAsst. Manager (E-E)<br />\nAAI, Dibrugarh Airport.<br />\n<br />\nFrom: SM - Electrical, Dibrugarh<br />\nSent: Friday, October 26, 2018 6:35 PM<br />\nTo: Ease of Doing Business in Assam<br />\nCc: K.M.M Tejaswi<br />\nSubject: Re: Renewal of License for Escalators, Dibrugarh Airport UAIN : CEI/F16/DI/000006/10/2018<br />\n<br />\n<br />\nSir,<br />\n<br />\n<br />\n<br />\nIn view of urgency , payment has been once made unknowing the fact that it will take 3 working days for confirmation of the application. The screenshot of the same is atttached herewith for your refrence. Please clarify<br />\n<br />\n<br />\n<br />\n<br />\n<br />\n<br />\n<br />\n<br />\n<br />\nThanks & Regards<br />\n<br />\n<br />\n<br />\nSr. Manager (E-E)<br />\n<br />\nAAI, Dibrugarh Airport.<br />\n<br />\n________________________________<br />\nFrom: Ease of Doing Business in Assam <eodb.assam@gmail.com><br />\nSent: Friday, October 26, 2018 6:19 PM<br />\nTo: K.M.M Tejaswi<br />\nCc: SM - Electrical, Dibrugarh<br />\nSubject: Re: Renewal of License for Escalators, Dibrugarh Airport UAIN : CEI/F16/DI/000006/10/2018<br />\n<br />\nDear Sir,<br />\n<br />\nPlease do not try to do the payment again if the amount is already deducted from your bank account. Give us 3 working days to resolve the issue, now your payment is showing failed. The treasury payment gateway of assam will give us the report of the payment you have done within next 3 working days.After that we can give you the confirmation of your payment whether it was successfully done or failed.<br />\n<br />\nWith Best Regards<br />\n--<br />\nTeam EODB Assam<br />\n<br />\nHelpdesk: +91 7086044425<br />\n<br />\nPlease call Helpdesk for any further queries, clarifications or technical support.<br />\n<br />\nOn Fri, Oct 26, 2018 at 5:35 PM K.M.M Tejaswi <kmmtejaswi@aai.aero<mailto:kmmtejaswi@aai.aero>> wrote:<br />\n<br />\nSir,<br />\n<br />\nThe subject mentioned UAIN is registered in web portal for renewing License of escalator and payment is also made. But it is showing in incomplete List of applications status. Kindly clarify.<br />\n<br />\nSimilarly for application of renewing the License of the second escalator, it is being directed to the payment gateway instead of application form . Please tell us the procedure to apply fresh application for renewal of License for second Escalator.<br />\n<br />\n<br />\nRegards<br />\nK.M.M.Tejaswi<br />\nAsst. Manager Engg(E)<br />\nDibrugarh Airport<br />\nMobile No 8547743432<br />\n<br />\nDisclaimer<br />\n<br />\nThe information contained in this electronic message and in any attachments to this message is confidential, legally privileged and intended only for the person or entity to which this electronic message is addressed. If you are not the intended recipient, please notify the system manager and you are hereby notified that any distribution, copying, review, re-transmission, dissemination or other use of this electronic transmission or the information contained in it is strictly prohibited. Please also note that any views or opinions presented in this email are solely those of the author and may not represent those of the Organization or bind the Organization. This message has been scanned for viruses and dangerous content by Mail Scanner, and is believed to be clean. Airports Authority of India accepts no liability for any damage caused by any virus transmitted by this email.<br />\n<br />\n<br />\n--<br />\nRegards,<br />\n<br />\nTeam EODB, Assam.<br />\nDisclaimer<br />\n<br />