INSERT INTO `emails` (`email_id`, `email_from`, `email_body`, `email_subject`, `email_time`) VALUES
(206, 'ms.newtechsolutions@gmail.com', 'We are unable to proceed further after generation of the UBIN . Plus the<br />\nCAF form we filled at that time is not showing when we are logging in now<br />\n.Can you please suggest me your contact number . Need to issue the problem<br />\nin person .<br />\n<br />\nThanks ,<br />\nChinmoy Tamuli ,<br />\nNewtech Solutions,<br />\nManaging Partner<br />\nMobile     - 09707654375 / 9926014770<br />\nemail       - ms.newtechsolutions@gmail.com <ms.newtechsolutions@gmnail.com><br />\n,<br />\n<br />\n<br />\n*[image: Inline image 1]*<br />\n<br />\n<br />\nOn Mon, Dec 10, 2018 at 11:44 AM EODB Government of Assam <<br />\nsupport@easeofdoingbusinessinassam.in> wrote:<br />\n<br />\n> Hi Sir, We are sorry to know that. Can you please elaborate the exact<br />\n> issue you are facing? If you are receiving any error message please provide<br />\n> us with the screenshot of the error message. Waiting for your reply.<br />\n> Regards,<br />\n', '5C0E026CBE08F', '2018-12-10 11:49:15'),
(207, 'ms.newtechsolutions@gmail.com', 'What are the steps after generation of CAF . I want to know the process<br />\nfrom here onwards to final creation of firm registration with certificates<br />\n<br />\nNewtech Solutions,<br />\nManaging Partner<br />\nMobile     - 09707654375 / 9926014770<br />\nemail       - ms.newtechsolutions@gmail.com <ms.newtechsolutions@gmnail.com><br />\n,<br />\n<br />\n<br />\n*[image: Inline image 1]*<br />\n<br />\n<br />\n---------- Forwarded message ---------<br />\nFrom: EODB Government of Assam <support@easeofdoingbusinessinassam.in><br />\nDate: Mon, Dec 10, 2018 at 1:16 PM<br />\nSubject: EODB SUPPORT-[5C0E026CBE08F]<br />\nTo: <ms.newtechsolutions@gmail.com><br />\n<br />\n<br />\nYour CAF has been approved. What exact details you want from us?<br />\n', '5C0E026CBE08F', '2018-12-10 13:34:39'),
(208, 'arpanadhkr61@gmail.com', 'Sir,<br />\nPlz help. Because after clicking  My Application->Incomplete Application,<br />\nthere are no option showing \"Fill and Complete\" and offline payment options.<br />\n<br />\nRegards<br />\nArpana Adhikary<br />\nThe People For People Foundation<br />\nOn Dec 10, 2018 3:55 PM, \"EODB Government of Assam\" <<br />\nsupport@easeofdoingbusinessinassam.in> wrote:<br />\n<br />\n> Hi Sir/Mam, Thanks for writing in. As you have already made the treasury<br />\n> receipt. All you need to do is login to our website. Go to My Applications<br />\n> Incomplete Applications and from their kindly click on the button \"Fill and<br />\n> Complete\" and proceed by selecting the offline payment method. Please<br />\n> upload the challan receipt copy along with the requested information over<br />\n> there and submit your application. We hope that the above helps. Regards,<br />\n', '5C0E39E222884', '2018-12-10 16:23:53'),
(209, 'arpanadhkr61@gmail.com', 'Plz help me because there are no option showing after clicking Incomplete<br />\napplication.<br />\n<br />\nRegards<br />\nArpana Adhikary<br />\nOn Dec 10, 2018 4:23 PM, \"Arpana\" <arpanadhkr61@gmail.com> wrote:<br />\n<br />\n> Sir,<br />\n> Plz help. Because after clicking  My Application->Incomplete Application,<br />\n> there are no option showing \"Fill and Complete\" and offline payment options.<br />\n><br />\n> Regards<br />\n> Arpana Adhikary<br />\n> The People For People Foundation<br />\n> On Dec 10, 2018 3:55 PM, \"EODB Government of Assam\" <support@<br />\n> easeofdoingbusinessinassam.in> wrote:<br />\n><br />\n>> Hi Sir/Mam, Thanks for writing in. As you have already made the treasury<br />\n>> receipt. All you need to do is login to our website. Go to My Applications<br />\n>> Incomplete Applications and from their kindly click on the button \"Fill and<br />\n>> Complete\" and proceed by selecting the offline payment method. Please<br />\n>> upload the challan receipt copy along with the requested information over<br />\n>> there and submit your application. We hope that the above helps. Regards,<br />\n><br />\n><br />\n', '5C0E39E222884', '2018-12-10 16:25:53'),
(210, 'swami4u@gmail.com', 'Thank you. Appreciate the prompt response.<br />\n<br />\nOn Mon, Dec 10, 2018 at 4:03 PM EODB Government of Assam <<br />\nsupport@easeofdoingbusinessinassam.in> wrote:<br />\n<br />\n> Hi Sir, Your payment has been received and confirmed. Kindly go to \"My<br />\n> Applications\" => \"Incomplete Applications\" and from their kindly click on<br />\n> the button \"Fill and Complete\" and proceed by selecting the online payment<br />\n> method. Also, your challan No is: \"ISFD-5bfd30e79f2ef\". Thanks for<br />\n> contacting us. Best Regards,<br />\n', '5C0E23318028E', '2018-12-10 16:29:43'),
(211, 'pr@klgrroup.com', 'Sir,<br />\nThe UBIN no should be generated from KL Foods. But we have wrongly<br />\ngenerated it from KL Beverages which is a different Partnership Firm. Both<br />\nKL Foods and KL Beverages are different partnership firms.<br />\nSo you are requested to delete the data of the UBIN no generated today as<br />\nwe have already received UBIN no of KL Beverages both for FACTORY and HEAD<br />\nOFFICE.<br />\nThis is for your kind information and necessary action.<br />\n<br />\nRegards & Thanks<br />\nDebasis Sarmah<br />\n90850-60991<br />\n<br />\nOn Mon, 10 Dec 2018, 5:39 p.m. EODB Government of Assam <<br />\nsupport@easeofdoingbusinessinassam.in wrote:<br />\n<br />\n> Hi Sir/Mam, Thanks for writing in. Can you please elaborate your exact<br />\n> issue? What do you mean by wrongly generated the UBIN number? Waiting for<br />\n> your response. Regards,<br />\n', '5C0E5252942DF', '2018-12-10 18:18:38'),
(212, 'supdtskkch.glgt@gmail.com', 'Yes, I have received it.<br />\n<br />\nOn Mon, Dec 10, 2018 at 3:42 PM EODB Government of Assam <<br />\nsupport@easeofdoingbusinessinassam.in> wrote:<br />\n<br />\n> Hi Sir/Mam, We have already replied to your previous ticket. Please reply<br />\n> us on the same. Also, do not raise any new tickets for the same. Regards,<br />\n<br />\n<br />\n<br />\n-- <br />\nSuperintendent<br />\nSwahid K.K. civil Hospital<br />\nGolaghat<br />\n', '5C0E1EA1A7E30', '2018-12-11 10:36:35'),
(213, 'sarmamadan12@gmail.com', 'Done.<br />\nthnak u<br />\n<br />\nOn Mon, 10 Dec 2018 at 13:19, EODB Government of Assam <<br />\nsupport@easeofdoingbusinessinassam.in> wrote:<br />\n<br />\n> Hi Sir/Mam, Thanks for sharing the requested information. We request you<br />\n> to kindly proceed with your application in the offline mode. Also, in the<br />\n> column of \"challan upload\" please update the screenshot which you have<br />\n> shared with us and submit your application. Do let us know if you need any<br />\n> more help. Regards,<br />\n', '5C0B6F1C6E064', '2018-12-11 11:39:24'),
(214, 'sarmamadan12@gmail.com', 'Thanks for your support.<br />\n<br />\n<br />\n<br />\n<br />\n<br />\n<br />\nmadan sarma<br />\n<br />\nOn Tue, 11 Dec 2018 at 11:41, EODB Government of Assam <<br />\nsupport@easeofdoingbusinessinassam.in> wrote:<br />\n<br />\n> *REMARKS : *Hi Sir, We are glad that we were of help. Warm Regards,<br />\n><br />\n> . Ticket (#5C0B6F1C6E064) for EODB supports has been resolved. If you have<br />\n> any further query please visit our site<br />\n> http://www.support.easeofdoingbusinessinassam.in and raise a new ticket.<br />\n> Thank you.<br />\n', '5C0B6F1C6E064', '2018-12-11 11:44:42'),
(215, 'suroj.paul1@gmail.com', 'The three days has passed. Please resolve my issue.<br />\n<br />\nOn Sat, 8 Dec 2018, 11:52 am EODB Government of Assam, <<br />\nsupport@easeofdoingbusinessinassam.in> wrote:<br />\n<br />\n> Hi Anjana, I request you to please wait for 3 working days for the payment<br />\n> status to reflect. If you still have the issue post 3 working days do let<br />\n> us know. Regards,<br />\n', '5C0A1C592CF4B', '2018-12-11 14:58:49'),
(216, 'wdss151@gmail.com', 'Thanks for your mail<br />\n<br />\nWDSS<br />\n<br />\nOn 12/13/18, EODB Government of Assam<br />\n<support@easeofdoingbusinessinassam.in> wrote:<br />\n> Thank you for contacting our support team. A support ticket(<br />\n> #5C11FBF58A3E9)<br />\n> has been generated for your request. You will be notified when a response<br />\n> is<br />\n> made by email.<br />\n><br />\n><br />\n<br />\n', '5C11FBF58A3E9', '2018-12-13 12:04:03'),
(217, 'ppbhuyan.m@gmail.com', 'Dear Sir<br />\nMy Amount is not update yet , please update the amount<br />\n<br />\nOn Mon, Dec 10, 2018 at 11:18 AM EODB Government of Assam <<br />\nsupport@easeofdoingbusinessinassam.in> wrote:<br />\n<br />\n> Hi Sir, Thanks for writing in. We are sorry to know about the same. We<br />\n> request you to kindly wait for the next 3 working days for the status to<br />\n> get updated. Do get back to us if the issue is still not solved after 3<br />\n> working days. Regards,<br />\n<br />\n<br />\n<br />\n-- <br />\n<Email-Id-ppbhuyan.m@gmail.com><br />\n<br />\n*Thanks & Regards*<br />\n<br />\n*Partha Pratim Bhuyan*<br />\n<br />\n*Connected Internet cafe*<br />\n<br />\n*Hospital Road*<br />\n<br />\n<br />\n*Near New Uniform House**Sivasagar*<br />\n*Assam*<br />\n*+91-9678839345*<br />\n', '5C0DFC6478A76', '2018-12-14 10:53:55'),
