(219, 'cityorthohosp@gmail.com', 'Sir/Madam<br />\nSorry to say, but it did not work. I have just tried it after log in<br />\nback after log out completely. Kindly do the needful.<br />\n<br />\nOn 12/14/18, EODB Government of Assam<br />\n<support@easeofdoingbusinessinassam.in> wrote:<br />\n> Hi Sir/Mam,<br />\n><br />\n> Thanks for writing in.<br />\n><br />\n> We request you to please logout and login back and select the correct<br />\n> option<br />\n> as your previous application was already processed.<br />\n><br />\n> Do let us know if you face the issue again.<br />\n><br />\n> Regards,<br />\n> Team EODB<br />\n><br />\n><br />\n<br />\n', '5C1376646A9EE', '2018-12-14 16:59:29'),
(220, 'openbugbounty@openbugbounty.org', '', '', '2018-12-15 01:06:50'),
(221, 'saiassam@sai-enterprises.com', 'Good Morning Sir/ Madam,<br />\n<br />\nWe are informing to you that after online payment against UAIN No- LEDF/F4/ST/000549/10/2018 Rs.7000.00 the file is not completed  . So suggest us what will we do?<br />\nThanking you<br />\nFor Sai NEterprises<br />\nShanti Ranjan Payra<br />\n<br />\n<br />\n<br />\n----- Original Message -----<br />\n From: EODB Government of Assam [mailto:support@easeofdoingbusinessinassam.in]<br />\n To: saiassam@sai-enterprises.com<br />\n Sent: Fri, 14 Dec 2018 17:14:35 +0530<br />\n Subject: EODB SUPPORT-[5C139 0ECBB20D]<br />\n<br />\n Hi Sir/Mam, Please provide us with the exact information which needs to be updated. Also, elaborate your exact issue with the concern of \"incomplete application\". Waiting for your response. Regards,', '5C139 0ECBB20D', '2018-12-15 10:21:45'),
(222, 'inamulghy13@gmail.com', 'Dear Sir/Madam<br />\n<br />\nDeed was registered on 3/5/2018 . As explained Partners have decided the<br />\nmatter on 9/4/2018, which is mentioned in uploaded deed itself . As such I<br />\nwould request for change of both Date of Joining and establishment<br />\n<br />\nWith regards<br />\nInamul Islam<br />\nManaging Partners<br />\n<br />\n<br />\nOn Fri, Dec 14, 2018 at 10:40 AM EODB Government of Assam <<br />\nsupport@easeofdoingbusinessinassam.in> wrote:<br />\n<br />\n> Hi Sir/Mam, Thanks for writing in. We would like to let you know that we<br />\n> will not be able to change the date of joining partners as the partnership<br />\n> deed which is uploaded is from 03-05-2018. However, if you wish we can go<br />\n> ahead and change the date of establishment. Do let us know how you would<br />\n> like to proceed. Waiting for your response. Regards, Team EODB<br />\n', '5C1284D2ED1F4', '2018-12-15 10:34:15'),
(223, 'newdoulattraders@gmail.com', 'Dear Sir/Madam,<br />\n<br />\nAfter complete of 4 days also the problem has not been solved , herewith i<br />\nsend you as enclosed the screen shoot of my computer for your further<br />\naction please<br />\n', '5C123637BF977', '2018-12-17 15:53:31'),
(224, 'wdss151@gmail.com', 'Dear Sir,<br />\n<br />\nWe from Women Development Society UBIN-AA21587/NPDLI 21587/08/2018 ,<br />\nwould like to request to help us as we are not able to upload our<br />\nremaining documents  till today.<br />\nToday also tried our best but not able do so.<br />\n<br />\nwaitinf got for your kind advice<br />\n<br />\n<br />\n<br />\nOn 12/13/18, EODB Government of Assam<br />\n<support@easeofdoingbusinessinassam.in> wrote:<br />\n> . Ticket (#5C11FBF58A3E9) for EODB supports has been resolved. If you have<br />\n> any further query please visit our site<br />\n> http://www.support.easeofdoingbusinessinassam.in and raise a new ticket.<br />\n> Thank you.<br />\n><br />\n><br />\n<br />\n', '5C11FBF58A3E9', '2018-12-18 11:40:22'),
(225, 'debshyam45@gmail.com', 'Thank you for your response.  Sir i uploaded the previous challan in the<br />\nform<br />\n<br />\nOn Tue, Dec 18, 2018, 17:55 EODB Government of Assam <<br />\nsupport@easeofdoingbusinessinassam.in wrote:<br />\n<br />\n> Hi Sir, Thanks for writing in. Sir, may I know after you choose the<br />\n> offline mode which challan you have uploaded while submitting the form.<br />\n> Waiting for your response. Regards, Team EODB<br />\n', '5C18E1F3A0EB5', '2018-12-18 19:58:29'),
(226, 'debshyam45@gmail.com', 'After the payment method was choosed to ofline payment, only my bank name<br />\nwas asked to fill and then it showed that ur application has been submitted<br />\nto SDC.  Now in the above options when i go for print e challan, the<br />\nchallan number was asked to fill and when i fill the challan number it<br />\nshows payment failed plz try again later...<br />\n<br />\nOn Tue, Dec 18, 2018, 19:57 Shyam Deb <debshyam45@gmail.com wrote:<br />\n<br />\n> Thank you for your response.  Sir i uploaded the previous challan in the<br />\n> form<br />\n><br />\n> On Tue, Dec 18, 2018, 17:55 EODB Government of Assam <<br />\n> support@easeofdoingbusinessinassam.in wrote:<br />\n><br />\n>> Hi Sir, Thanks for writing in. Sir, may I know after you choose the<br />\n>> offline mode which challan you have uploaded while submitting the form.<br />\n>> Waiting for your response. Regards, Team EODB<br />\n><br />\n><br />\n', '5C18E1F3A0EB5', '2018-12-18 20:03:49'),
(227, 'littleangels945@gmail.com', 'Dear sir/ madam,<br />\n<br />\nThank you very much for your quick response.<br />\n<br />\nI would like to change the name proposed in the Common application form,<br />\nwhich has named as \" The governing body of Little Angels Pre-school\"<br />\ninstead \" little angels Pre-school\".<br />\n<br />\nThanks & Regards,<br />\nRoshmi Handique<br />\n<br />\nOn Wed, 19 Dec 2018, 10:06 EODB Government of Assam, <<br />\nsupport@easeofdoingbusinessinassam.in> wrote:<br />\n<br />\n> Hi Sir/Mam, Thanks for writing in. Can you please elaborate which name is<br />\n> to be added and in which column? Waiting for your response. Regards,<br />\n', '5C18F7575BA12', '2018-12-19 11:33:11'),
(228, 'debshyam45@gmail.com', 'which challan i have to ulpoad..the previous one na??<br />\n<br />\nOn Wed, Dec 19, 2018, 09:58 EODB Government of Assam <<br />\nsupport@easeofdoingbusinessinassam.in wrote:<br />\n<br />\n> Hi Sir, Thanks for writing in again. We request you to wait until the<br />\n> department replies on your application. Once they reply you along with the<br />\n> fees payment link please upload the correct challan. Hope the above<br />\n> information helps. Regards, Team EODB<br />\n', '5C18E1F3A0EB5', '2018-12-19 11:49:53'),
(229, 'alok.dksales@gmail.com', 'PFA.<br />\n<br />\n<br />\n*Greetings of the day!!!*<br />\n<br />\n<br />\n<br />\n<br />\n*Best Regards,*<br />\n*Alok Das*<br />\n*Incharge-Management Executive**M/s D.Kumar & Sales *<br />\n*Mobile no - 7670011106*<br />\n*Email:alok@dksales.in/alok.dksales@gmail.com<br />\n<http://Email:alok@dksales.in/alok.dksales@gmail.com>*<br />\n   [image: View photo in message]<br />\n*Registered Office :* Unit 4-A ,4th Floor of Mayur Gardens , Opp. Rajeev<br />\nBhawan , ABC Bus Stop , Bhangagarh, G.S.Road, Guwahati-781005 (Assam)<br />\n<br />\n<br />\nOn Wed, 19 Dec 2018 at 12:24, EODB Government of Assam <<br />\nsupport@easeofdoingbusinessinassam.in> wrote:<br />\n<br />\n> Hi Sir, Thanks for writing in. We request you to please send us all the<br />\n> information which needs to be updated in the form here. Also, please send<br />\n> us the documents in PDF format. Waiting for your response. Regards, Team<br />\n> EODB<br />\n', 'OBORONA-SPAM', '2018-12-19 13:39:46'),
(230, 'debshyam45@gmail.com', 'Can u tell me the whole process of making new challan<br />\n<br />\nOn Wed, Dec 19, 2018, 12:13 EODB Government of Assam <<br />\nsupport@easeofdoingbusinessinassam.in wrote:<br />\n<br />\n> Hi Sir, The challan you have submitted is for previous year. As you are<br />\n> re-applying for you will have make a new challan. So, please upload the new<br />\n> challan or choose the online payment mode when you get the departmental<br />\n> query for making the payment. Regards, Team EODB<br />\n', '5C18E1F3A0EB5', '2018-12-19 14:27:05'),
(231, 'thapa.sangeeta@gmail.com', 'Dear Sir/Madam<br />\nKindly find attached the authorization letter.<br />\n<br />\nOn Tue, Dec 18, 2018 at 3:43 PM EODB Government of Assam <<br />\nsupport@easeofdoingbusinessinassam.in> wrote:<br />\n<br />\n> Hi Mam, Thanks for writing in. As you do not have the access to your<br />\n> previous email ID to recover your password for the same we can help you in<br />\n> changing the email ID. However, we will require an authorization letter<br />\n> from your firm on this behalf. Waiting for your response. Regards, Team<br />\n> EODB<br />\n<br />\n<br />\n<br />\n-- <br />\nSangeeta<br />\n', '5C18A60022DBB', '2018-12-19 16:29:55'),
(232, 'debshyam45@gmail.com', 'But sir m confused that from where will i get the latest challan<br />\n<br />\nOn Wed, Dec 19, 2018, 17:23 EODB Government of Assam <<br />\nsupport@easeofdoingbusinessinassam.in wrote:<br />\n<br />\n> Hi Sir, As informed earlier, we department sends you a query regarding the<br />\n> fees, please choose offline payment method and upload the latest challan<br />\n> which is in favor of the department. Once done your application will be<br />\n> processed. Regards, Team EODB<br />\n', '5C18E1F3A0EB5', '2018-12-19 17:39:33'),
(233, 'debshyam45@gmail.com', 'okey...That means then challan which i will get from Treasury office after<br />\npaying the fee i have to upload it online after selecting the ofline mode<br />\nof payment<br />\n<br />\nOn Wed, Dec 19, 2018, 17:48 EODB Government of Assam <<br />\nsupport@easeofdoingbusinessinassam.in wrote:<br />\n<br />\n> Hi Sir, You will get the challan from treasury office when you make the<br />\n> payment for the same. Hope this clarifies your concern. Regards, Team EODB<br />\n', '5C18E1F3A0EB5', '2018-12-19 17:54:55'),
(234, 'debshyam45@gmail.com', 'again i have to pay the fee online ? or only in office<br />\n<br />\nOn Wed, Dec 19, 2018, 17:54 Shyam Deb <debshyam45@gmail.com wrote:<br />\n<br />\n> okey...That means then challan which i will get from Treasury office after<br />\n> paying the fee i have to upload it online after selecting the ofline mode<br />\n> of payment<br />\n><br />\n> On Wed, Dec 19, 2018, 17:48 EODB Government of Assam <<br />\n> support@easeofdoingbusinessinassam.in wrote:<br />\n><br />\n>> Hi Sir, You will get the challan from treasury office when you make the<br />\n>> payment for the same. Hope this clarifies your concern. Regards, Team EODB<br />\n><br />\n><br />\n', '5C18E1F3A0EB5', '2018-12-19 17:56:09'),
(235, 'debshyam45@gmail.com', 'After completing the CAF i went to online services nd there in health and<br />\nfamily welfare ans there i choosed the suitable option for retention  of my<br />\ndrug licence and after completing the filling up of all those form...a<br />\nchallan of new Amount 3015 came where i choosed the offline payment method<br />\nand there only my banks name was asked after that it was  showed that my<br />\nform has been submitted to SDC successfully and asked me to print nd keep<br />\nthe copy of Acknowledgement But in the above options when i go for print e<br />\nchallan ...my challan number is asked and i enter the previous challan no<br />\nand then it shows that payment failed.<br />\n<br />\nOn Wed, Dec 19, 2018, 18:08 EODB Government of Assam <<br />\nsupport@easeofdoingbusinessinassam.in wrote:<br />\n<br />\n> Hi Sir, May I know when did you make the payment? If possible please<br />\n> provide us with the screenshot of the payment receipt. Waiting for your<br />\n> response. Regards, Team EODB<br />\n', '5C18E1F3A0EB5', '2018-12-19 18:26:19'),
(236, 'debshyam45@gmail.com', 'I have the previous challan with me...<br />\n<br />\nOn Wed, Dec 19, 2018, 18:25 Shyam Deb <debshyam45@gmail.com wrote:<br />\n<br />\n> After completing the CAF i went to online services nd there in health and<br />\n> family welfare ans there i choosed the suitable option for retention  of my<br />\n> drug licence and after completing the filling up of all those form...a<br />\n> challan of new Amount 3015 came where i choosed the offline payment method<br />\n> and there only my banks name was asked after that it was  showed that my<br />\n> form has been submitted to SDC successfully and asked me to print nd keep<br />\n> the copy of Acknowledgement But in the above options when i go for print e<br />\n> challan ...my challan number is asked and i enter the previous challan no<br />\n> and then it shows that payment failed.<br />\n><br />\n> On Wed, Dec 19, 2018, 18:08 EODB Government of Assam <<br />\n> support@easeofdoingbusinessinassam.in wrote:<br />\n><br />\n>> Hi Sir, May I know when did you make the payment? If possible please<br />\n>> provide us with the screenshot of the payment receipt. Waiting for your<br />\n>> response. Regards, Team EODB<br />\n><br />\n><br />\n', '5C18E1F3A0EB5', '2018-12-19 18:26:44'),
(237, 'debshyam45@gmail.com', 'I tried to make the payment on 5th December 2018<br />\n<br />\nOn Wed, Dec 19, 2018, 18:25 Shyam Deb <debshyam45@gmail.com wrote:<br />\n<br />\n> I have the previous challan with me...<br />\n><br />\n> On Wed, Dec 19, 2018, 18:25 Shyam Deb <debshyam45@gmail.com wrote:<br />\n><br />\n>> After completing the CAF i went to online services nd there in health and<br />\n>> family welfare ans there i choosed the suitable option for retention  of my<br />\n>> drug licence and after completing the filling up of all those form...a<br />\n>> challan of new Amount 3015 came where i choosed the offline payment method<br />\n>> and there only my banks name was asked after that it was  showed that my<br />\n>> form has been submitted to SDC successfully and asked me to print nd keep<br />\n>> the copy of Acknowledgement But in the above options when i go for print e<br />\n>> challan ...my challan number is asked and i enter the previous challan no<br />\n>> and then it shows that payment failed.<br />\n>><br />\n>> On Wed, Dec 19, 2018, 18:08 EODB Government of Assam <<br />\n>> support@easeofdoingbusinessinassam.in wrote:<br />\n>><br />\n>>> Hi Sir, May I know when did you make the payment? If possible please<br />\n>>> provide us with the screenshot of the payment receipt. Waiting for your<br />\n>>> response. Regards, Team EODB<br />\n>><br />\n>><br />\n', '5C18E1F3A0EB5', '2018-12-19 18:27:14'),
(238, 'littleangels945@gmail.com', 'Thank you very much<br />\n<br />\nOn Wed, 19 Dec 2018, 13:28 EODB Government of Assam, <<br />\nsupport@easeofdoingbusinessinassam.in> wrote:<br />\n<br />\n> Hi Mam, Thanks for being patient with us. We have successfully updated<br />\n> your Enterprise name as you have suggested. Do let us know if you need any<br />\n> other help. Regards, Team EODB<br />\n', '5C18F7575BA12', '2018-12-19 22:59:02'),
(239, 'debshyam45@gmail.com', 'Thank u for helping me....but can i pay the amount online by again choosing<br />\nthe online option.<br />\n<br />\nOn Thu, Dec 20, 2018, 10:05 EODB Government of Assam <<br />\nsupport@easeofdoingbusinessinassam.in wrote:<br />\n<br />\n> Hi Sir, Thanks for replying in. Sir, after you completed your application<br />\n> form you were asked to pay a fees of Rs 3015. And as you chose the offline<br />\n> method you should have uploaded the latest challan of Rs 3015 which you<br />\n> receive from the treasury office. As you have uploaded the previous challan<br />\n> is not getting accepted and the payment shows as failed. Hence, we request<br />\n> you to please make the payment of Rs 3015 in the treasury office and keep<br />\n> the challan copy ready with you. When you receive a query from the<br />\n> department regarding the fees please upload the latest challan copy which<br />\n> you received after paying from the treasury office. Doing so will resolve<br />\n> your concern. Regards, Team EODB<br />\n', '5C18E1F3A0EB5', '2018-12-20 11:16:37'),
(240, 'thapa.sangeeta@gmail.com', 'Thank you<br />\nOn Wed, Dec 19, 2018 at 4:46 PM EODB Government of Assam <<br />\nsupport@easeofdoingbusinessinassam.in> wrote:<br />\n<br />\n> . Ticket (#5C18A60022DBB) for EODB supports has been resolved. If you have<br />\n> any further query please visit our site<br />\n> http://www.support.easeofdoingbusinessinassam.in and raise a new ticket.<br />\n> Thank you.<br />\n<br />\n<br />\n<br />\n-- <br />\nSangeeta<br />\n', '5C18A60022DBB', '2018-12-20 12:19:44'),
(241, 'greenteaindia8741@gmail.com', 'Dear Sir,<br />\n<br />\nThank you for your responce , Yes we want to remove the other two names of<br />\nthe director .<br />\nCurrent Director Name are as follows<br />\n1. SUSHIL KUMAR JAIN<br />\n2. SABITA JAIN.<br />\n<br />\nKindly Remove the name of the following director<br />\n1. RIDIP HAZARIKA<br />\n2. ATAUR RAHMAN<br />\n<br />\nWITH REGARDS<br />\n<br />\n<br />\nArotee Agro Pvt Ltd<br />\n<br />\n<br />\nOn Thu, Dec 20, 2018 at 3:37 PM EODB Government of Assam <<br />\nsupport@easeofdoingbusinessinassam.in> wrote:<br />\n<br />\n> Hi Sir, Thanks for writing in. Do you want us to remove the other two<br />\n> names from the list of Directors? Waiting for your response. Regards, Team<br />\n> EODB<br />\n', '5C1B3CE7D51D2', '2018-12-20 18:04:14'),
(242, 'info@globalentrade.com', 'Please find attachment file file as per yoour requirement.<br />\n<br />\nBasanta Kalita<br />\nMobile No.09854080047<br />\n<br />\n<br />\n[image: Mailtrack]<br />\n<https://mailtrack.io?utm_source=gmail&utm_medium=signature&utm_campaign=signaturevirality5&><br />\nSender<br />\nnotified by<br />\nMailtrack<br />\n<https://mailtrack.io?utm_source=gmail&utm_medium=signature&utm_campaign=signaturevirality5&><br />\n21/12/18,<br />\n16:59:03<br />\n<br />\nOn Fri, Dec 21, 2018 at 4:51 PM EODB Government of Assam <<br />\nsupport@easeofdoingbusinessinassam.in> wrote:<br />\n<br />\n> Please send us the member details in typed doc format. so that we can make<br />\n> changes.<br />\n', '5C1CA0755980B', '2018-12-21 17:00:54'),
(243, 'info@globalentrade.com', 'Ok, thank you.<br />\nBasanta Kalita<br />\nMobile No.09854080047<br />\n<br />\n<br />\n[image: Mailtrack]<br />\n<https://mailtrack.io?utm_source=gmail&utm_medium=signature&utm_campaign=signaturevirality5&><br />\nSender<br />\nnotified by<br />\nMailtrack<br />\n<https://mailtrack.io?utm_source=gmail&utm_medium=signature&utm_campaign=signaturevirality5&><br />\n21/12/18,<br />\n17:09:36<br />\n<br />\nOn Fri, Dec 21, 2018 at 5:08 PM EODB Government of Assam <<br />\nsupport@easeofdoingbusinessinassam.in> wrote:<br />\n<br />\n> Hi Sir, We are already working on your previous ticket. Request you not to<br />\n> raise any new ticket for the same issue again. Regards, Team EODB<br />\n', '5C1CCF60AFF4C', '2018-12-21 17:10:36');
