(813, 35, '2018-08-03 11:45:16', 0, 'Ashraful Alom  ( ashraful@avantikain.com )', 'I want to display a large amount of text using a php *echo* command. I have\nthat data stored in mysql database table in a text field. What i want to\nachieve is that the data should be displayed in the same manner in which i\nstore it in the text field.\n\nfor example:\n\n*As entered in Mysql table by its Interface* One reason people lie is to\nachieve personal power.\n\nAchieving personal power is helpful for someone who pretends to be more\nconfident than he really is. For example, one of my friends threw a party\nat his house last month. He asked me to come to his party and bring a date.\n\nAlthough this lie helped me at the time, since then it has made me look\ndown on myself.\n\n*Should be displayed exactly as the above rather than:* One reason people\nlie is to achieve personal power. Achieving personal power is helpful for\nsomeone who pretends to be more confident than he really is. For example,\none of my friends threw a party at his house last month. He asked me to\ncome to his party and bring a date. Although this lie helped me at the\ntime, since then it has made me look down on myself.\n\nAny ideas/tips on how this can be achieved? I know that i can manually\ninsert html tags between the text for formatting but i dont want to\nmanually do so. Any way around?\n\n\nOn Fri, Aug 3, 2018 at 5:13 PM, EODB Government of Assam <\nsupport@easeofdoingbusinessinassam.in> wrote:\n\n> hi\n', '', 6, 1),
