(816, 35, '2018-08-03 11:51:12', 0, 'Ashraful Alom  ( ashraful@avantikain.com )', '<https://stackoverflow.com/questions/15029629/how-to-display-text-in-the-same-format-as-added-in-mysql-text-field-using-php-ec><br />\nAsk Question <https://stackoverflow.com/questions/ask><br />\nup vote 0 down vote favorite<br />\n<https://stackoverflow.com/questions/15029629/how-to-display-text-in-the-same-format-as-added-in-mysql-text-field-using-php-ec#><br />\n*1*<br />\n<br />\nI want to display a large amount of text using a php *echo* command. I have<br />\nthat data stored in mysql database table in a text field. What i want to<br />\nachieve is that the data should be displayed in the same manner in which i<br />\nstore it in the text field.<br />\n<br />\nfor example:<br />\n<br />\n*As entered in Mysql table by its Interface* One reason people lie is to<br />\nachieve personal power.<br />\n<br />\nAchieving personal power is helpful for someone who pretends to be more<br />\nconfident than he really is. For example, one of my friends threw a party<br />\nat his house last month. He asked me to come to his party and bring a date.<br />\n<br />\nAlthough this lie helped me at the time, since then it has made me look<br />\ndown on myself.<br />\n<br />\n*Should be displayed exactly as the above rather than:* One reason people<br />\nlie is to achieve personal power. Achieving personal power is helpful for<br />\nsomeone who pretends to be more confident than he really is. For example,<br />\none of my friends threw a party at his house last month. He asked me to<br />\ncome to his party and bring a date. Although this lie helped me at the<br />\ntime, since then it has made me look down on myself.<br />\n<br />\nAny ideas/tips on how this can be achieved? I know that i can manually<br />\ninsert html tags between the text for formatting but i dont want to<br />\nmanually do so. Any way around?<br />\n<br />\n<br />\nOn Fri, Aug 3, 2018 at 5:14 PM, Ashraful Alom <ashraful@avantikain.com><br />\nwrote:<br />\n<br />\n> I want to display a large amount of text using a php *echo* command. I<br />\n> have that data stored in mysql database table in a text field. What i want<br />\n> to achieve is that the data should be displayed in the same manner in which<br />\n> i store it in the text field.<br />\n><br />\n> for example:<br />\n><br />\n> *As entered in Mysql table by its Interface* One reason people lie is to<br />\n> achieve personal power.<br />\n><br />\n> Achieving personal power is helpful for someone who pretends to be more<br />\n> confident than he really is. For example, one of my friends threw a party<br />\n> at his house last month. He asked me to come to his party and bring a date.<br />\n><br />\n> Although this lie helped me at the time, since then it has made me look<br />\n> down on myself.<br />\n><br />\n> *Should be displayed exactly as the above rather than:* One reason people<br />\n> lie is to achieve personal power. Achieving personal power is helpful for<br />\n> someone who pretends to be more confident than he really is. For example,<br />\n> one of my friends threw a party at his house last month. He asked me to<br />\n> come to his party and bring a date. Although this lie helped me at the<br />\n> time, since then it has made me look down on myself.<br />\n><br />\n> Any ideas/tips on how this can be achieved? I know that i can manually<br />\n> insert html tags between the text for formatting but i dont want to<br />\n> manually do so. Any way around?<br />\n><br />\n><br />\n> On Fri, Aug 3, 2018 at 5:13 PM, EODB Government of Assam <support@<br />\n> easeofdoingbusinessinassam.in> wrote:<br />\n><br />\n>> hi<br />\n><br />\n><br />\n><br />\n', '', 6, 1),
