(1274, 494, '2018-08-28 14:37:02', 0, NULL, 'MEMORENDUM OF ASSOCIATION\r\n (Registration Under Societies Registration Act.xxi of 1860\r\n\r\n1. Name of organization: PARIJAT SANGEET CHITRAKALA SAMITTEE\r\n\r\n2.The office of the  Organization :  -  Hatinga Joypur,P.O. Jamaguri Hat,, Dist. Sonitpur, \r\n                                                               Assam.Pin: 784180\r\n\r\n3.The objects for which the society establish\r\n1.	The basic object of the Samiti has always been to revive the prestige of the art of music comprising vocal music, instrumental music, dance and to organize systematic training in this art in India and also in foreign countries, besides reaching it to people at large\r\n2.	 given to the teaching of the art of music by various government institutions and universities, goes to this Samiti. \r\n3.	The Samiti has played an important role in the all-round revival and popularity of Indian Classical music by organizing music competitions and conferences on All India Basis annually, in an effort to revive taste and devotion towards the art of music amongst the people and thus , popularizing this great art.\r\n4.	preserve the works of heritage art and make people conscious about the growing importance of art in our society.\r\n5.	conducting art exhibitions at state and national levels.\r\n6.	The institute patronizes learning of the professional courses through a wide array of subjects related to Fine Arts.\r\n\r\n\r\n\r\n\r\nMEMORENDUM OF ASSOCIATION\r\n (Registration Under Societies Registration Act.xxi of 1860\r\n\r\n1. Name of organization: PARIJAT SANGEET CHITRAKALA SAMITTEE\r\n\r\n2.The office of the  Organization :  -  Hatinga Joypur,P.O. Jamaguri Hat,, Dist. Sonitpur, \r\n                                                               Assam.Pin: 784180\r\n\r\n3.The objects for which the society establish\r\n1.	The basic object of the Samiti has always been to revive the prestige of the art of music comprising vocal music, instrumental music, dance and to organize systematic training in this art in India and also in foreign countries, besides reaching it to people at large\r\n2.	 given to the teaching of the art of music by various government institutions and universities, goes to this Samiti. \r\n3.	The Samiti has played an important role in the all-round revival and popularity of Indian Classical music by organizing music competitions and conferences on All India Basis annually, in an effort to revive taste and devotion towards the art of music amongst the people and thus , popularizing this great art.\r\n4.	preserve the works of heritage art and make people conscious about the growing importance of art in our society.\r\n5.	conducting art exhibitions at state and national levels.\r\n6.	The institute patronizes learning of the professional courses through a wide array of subjects related to Fine Arts.\r\n\r\n\r\n\r\n\r\n\r\nAs per memorandum  first page  and Rules and regulation first page \r\n', '6a371d5e345b65e11658510f7803bb840d4ae2fd.docx', 5, 1),
