(2146, 711, '2018-09-27 12:41:01', 0, 'SHARMA DRUGS SURGICALS  ( vikashan_sh@rediffmail.com )', 'IN THE CASE OF MEDICINE WE HAVE TO MAKE A NEW LICENSE IF WE CHANGE OUR <br />\n<br />\nPREMISES ALL OTHER THINGS REMAIN SAME SUCH AS PAN CARD AND GST NUMBER. <br />\n<br />\nAND MOREOVER WE HAVE SURRENDERED THE EARLIER LICENSE. SO PLEASE TAKING <br />\n<br />\nTHE ABOVE SAID FACTORS PLEASE CHANGE THE NAME OF OUR FIRM OTHERWISE WE <br />\n<br />\nWILL HAVE TO THROUGH A LONG PROCESS FOR CHANGING THE PAN CARD , <br />\n<br />\nPARTNERSHIP DEED, GST NUMBER. <br />\n<br />\n<br />\n<br />\nTHEREFORE PLEASE CONSIDER THE ABOVE CIRCUMSTANCES. <br />\n<br />\n<br />\n<br />\nTHANKING YOU AND LOOKING FORWARD FOR YOUR KIND CO-OPERATION.<br />\n<br />\n<br />\n<br />\nOn Thu, 27 Sep 2018 17:16:31 +0530 \"EODB Government of Assam\" <br />\n<br />\n wrote<br />\n<br />\n>While trying to change your enterprise name it is coming as PAN CARD <br />\n<br />\nalready exists. Two enterprise cannot bear the same name.<br />\n<br />\n', '', 6, 1),
