(3342, 1131, '2018-12-10 12:07:06', 47, NULL, 'Hi Sir/Mam,\r\n\r\nThanks for writing in. \r\n\r\nWe are sorry to know that your application got rejected. The reason why your license got rejected is because Guwahati Municipal Corporation renews trade license only for the current financial year which is 2018-19. As you have applied for 2018-22 your application got rejected. \r\n\r\nWhat I can suggest is please reapply the application again with the current financial year. \r\n\r\nAlso, if you would like to apply for the refund of the same you can raise a new ticket with all the details of your application. However, the process might take up to 3-4 months as the refund is processed from the Treasury Office not from our end. \r\n\r\nI hope the above helps. \r\n\r\nRegards, ', NULL, 2, 1),
