(3384, 1123, '2018-12-12 09:01:44', 47, NULL, 'Hi\r\n\r\nAs mentioned on the earlier mail, please do the following :\r\n1. Login to your account\r\n2. From your dashboard, click on My Applications-> Incomplete Applications and from  kindly click on the button \"Fill and Complete.\r\n3. Click on choose an offline payment method and upload a copy of your challan number. \r\n4. Once this is done, your application will be processed and you will receive your UAIN number.\r\n\r\nThanks\r\n\r\nTeam EODB', NULL, 2, 1),
