(3390, 1143, '2018-12-12 11:15:32', 47, NULL, 'Dear Sir/ Madam\r\n\r\nBased on your query we noticed that all the members are not mentioned on the application form. We request you to do the following :\r\n1. Upload a letter addressed to \"Ease of Doing Business\", from your Association, stating that the additional members need to be added to the Common Application Form.\r\n2. All members signatures will be needed on this form will need to sign the application form.\r\nOnce the above is done then we can carry out the update, we do however need an authorized letter supporting your request.\r\n\r\nHope this helps\r\n\r\nThanks,\r\nTeam EODB', NULL, 2, 1),
(3391, 1148, '2018-12-12 11:34:38', 47, NULL, 'Hi Sir\r\n\r\nYour application request to renew your license has been submitted. With regards to your request payment, please proceed with the following :\r\n\r\n1. Login to your account under your UBIN/UAIN number, then on your dashboard click on \"My Applications\"\r\n2. Under your application request click on the payment, you have the option of offline or online payment. Proceed accordingly and you will receive an acknowledge receipt.\r\n\r\nHope this helps.\r\n\r\nThanks \r\nTeam EODB', NULL, 2, 1),
