(3657, 1224, '2018-12-20 04:35:16', 47, NULL, 'Hi Sir,\r\n\r\nThanks for replying in. \r\n\r\nSir, after you completed your application form you were asked to pay a fees of Rs 3015. And as you chose the offline method you should have uploaded the latest challan of Rs 3015 which you receive from the treasury office. As you have uploaded the previous challan is not getting accepted and the payment shows as failed. Hence, we request you to please make the payment of Rs 3015 in the treasury office and keep the challan copy ready with you. \r\n\r\nWhen you receive a query from the department regarding the fees please upload the latest challan copy which you received after paying from the treasury office. \r\n\r\nDoing so will resolve your concern. \r\n\r\nRegards, \r\nTeam EODB', NULL, 2, 1),
