(20, '56DSADSASAD', '2018-06-30 07:46:50', 'himanshu.guwahati@yahoo.com', 9435110714, 'RFS/F13/KM/000307/06/2018', 'BUILD NORTH EAST', '', 3, '<p>Dear Sir/ Madam,</p>\r\n<p>&nbsp;</p>\r\n<p>We made a payment of Rs 25 on 23/06/2018 but still my application is pending and showing as incomplete as the payment is not been updated in the sytem.</p>\r\n<p>The payment has been made through SBI vide payment dated 23/06/18 no&nbsp;<span style=\"color: #555555; font-family: Arial, Helvetica, sans-serif; font-size: 13px; background-color: #f5f5f5;\">SBIPG 817480071134FinanceDeptAssamSBIePaMumbai.</span></p>\r\n<p><span style=\"color: #555555; font-family: Arial, Helvetica, sans-serif; font-size: 13px; background-color: #f5f5f5;\">Kindly check and update the same at the earliest.</span></p>', NULL, '', 2, 6, '', 5),
(23, 'URYI78685546', '2018-06-28 12:51:05', 'foundation@pedalroads.com', 9101139834, 'RFS/F15/KM/000774/06/2018', 'Pedalroads Foundation', '', 3, '<p>Payment Gateway Error after Payment:<br />Hi,<br />&nbsp;<br />Please check the following application:<br />&nbsp;<br />1. RFS/F15/KM/000774/06/2018<br />&nbsp;<br />The application were made to Registrar of Societies &amp; Firms, Govt. of Assam and payment of Rs. 50 was deducted from my HDFC Debit Card. But, no confirmation was received on email from EODB regarding the payment.<br />&nbsp;<br />I had raised this issue over email 3 days back and still no closure to this problem.<br />&nbsp;<br />Looking forward.<br />&nbsp;</p>', NULL, '', 3, 6, '', 5),
(24, 'JDFSHFGJKGF45454', '2018-07-02 12:47:03', 'aamba@pedalroads.com', 7002071541, 'RFS/F15/KM/000773/06/2018', 'Samar Das', '', 3, '<p>Payment Gateway Error after Payment:<br />Hi,<br />Please check the following application:<br />1. RFS/F15/KM/000773/06/2018<br />The application were made to Registrar of Societies &amp; Firms, Govt. of Assam and payment of Rs. 50 was deducted from my HDFC Debit Card. But, no confirmation was received on email from EODB regarding the payment.<br />I had raised this issue over email 3 days back and still no closure to this problem.<br />Looking forward.</p>', NULL, '', 1, 6, '6', 5),
