(26, '5B370FCB8C145', '2018-06-30 06:58:09', 'ujjwalsharmaa@gmail.com', 9854089190, 'AA06655/AAKFH9190C/01/2018', 'Ujjwal Sarmah', '', 2, '<div style=\"color: #222222; font-family: sans-serif; font-size: 13px;\">This is for your information that I had registered in EODB and my Unique Business Identification No is AA06655/AAKFH9190C/01/2018.</div>\r\n<div style=\"color: #222222; font-family: sans-serif; font-size: 13px;\">Registration was done as a Transformer manufacturing company but at that time the location of the plant was not decided. So I entered the address of our head office at the time of registration.</div>\r\n<div style=\"color: #222222; font-family: sans-serif; font-size: 13px;\">The address is</div>\r\n<div style=\"color: #222222; font-family: sans-serif; font-size: 13px;\">House no4, Ambikagiri Nagar Road, Guwahati, Kamrup metropolitan, Assam</div>\r\n<div style=\"color: #222222; font-family: sans-serif; font-size: 13px;\">&nbsp;</div>\r\n<div style=\"color: #222222; font-family: sans-serif; font-size: 13px;\">Now we have been allotted a plot of land at Industrial Growth Centre , Matia, Goalpara by AIDC Ltd.</div>\r\n<div style=\"color: #222222; font-family: sans-serif; font-size: 13px;\">Address is&nbsp;</div>\r\n<div style=\"color: #222222; font-family: sans-serif; font-size: 13px;\">Industrial Gwoth Centre, Matia, Mornoi, Goalpara.</div>\r\n<div style=\"color: #222222; font-family: sans-serif; font-size: 13px;\">&nbsp;</div>\r\n<div style=\"color: #222222; font-family: sans-serif; font-size: 13px;\">While trying to apply for electrical connection for the said unit at Goalpara, the EODB site pre-prints the fields for the \"Addresses of the enterprise for which electrical connection is required\" with the details of our head office without edit option.</div>\r\n<div style=\"color: #222222; font-family: sans-serif; font-size: 13px;\">&nbsp;</div>\r\n<div style=\"color: #222222; font-family: sans-serif; font-size: 13px;\">As I want to apply for electrical connection at IGC, Matia, Goalpara, I need your assistance to correct the same</div>', NULL, '', 1, 6, '6', 5),
(27, '5B3711A5D6791', '2018-06-30 06:57:29', 'ujjwalsharmaa@gmail.com', 9854089190, 'AA06655/AAKFH9190C/01/2018', 'Ujjwal Sarmah', '', 2, '<div style=\"color: #222222; font-family: sans-serif; font-size: 13px;\">This is for your information that I had registered in EODB and my Unique Business Identification No is AA06655/AAKFH9190C/01/2018.</div>\r\n<div style=\"color: #222222; font-family: sans-serif; font-size: 13px;\">Registration was done as a Transformer manufacturing company but at that time the location of the plant was not decided. So I entered the address of our head office at the time of registration.</div>\r\n<div style=\"color: #222222; font-family: sans-serif; font-size: 13px;\">&nbsp;</div>\r\n<div style=\"color: #222222; font-family: sans-serif; font-size: 13px;\">Now we have been allotted a plot of land at Industrial Growth Centre , Matia, Goalpara by AIDC Ltd.</div>\r\n<div style=\"color: #222222; font-family: sans-serif; font-size: 13px;\">While trying to apply for&nbsp;Factory License for the said unit at Goalpara, the EODB site pre-prints the fields for the \"<span style=\"color: #333333; font-family: \'Source Sans Pro\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px;\">2. (a) Full postal address and situation of the factory:</span>\" with the details of our head office without edit option.</div>\r\n<div style=\"color: #222222; font-family: sans-serif; font-size: 13px;\">&nbsp;</div>\r\n<div style=\"color: #222222; font-family: sans-serif; font-size: 13px;\">As I want to apply for&nbsp;factory license for a transformer manufacturing unit at IGC, Matia, Goalpara, I need your assistance to correct the same.</div>', NULL, '', 1, 1, '6', 5),
