(29, '5B3723D77AE2D', '2018-06-30 06:56:44', 'ranjeetsingh@brchealthcare.com', 9955772191, 'SDC/F2/JO/000432/05/2018', 'Ranjeet Kumar Singh', '', 6, '<p><span style=\"color: #333333; font-family: monospace; font-size: 12px; white-space: nowrap;\">Dear&nbsp;Madam/Sir,</span><br style=\"color: #333333; font-family: monospace; font-size: 12px;\" /><span style=\"color: #333333; font-family: monospace; font-size: 12px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;My name is Dr. Ranjeet Singh from BRC HEALTHCARE having Active UBIN : AA06819/AAQFB0832R/12/2017.I had applied for procurement of drug licence from the drug controllers office on 19/05/2018 vide UAIN- SDC/F2/JO/000432/05/2018.My problem is that unknowingly or due to lack of knowledge i applied for that certificate under the firm name \"BRC HEALTH CARE\" which is the parent firm. I wanted my firm to be named as \"BRC PHARMA\" for which i had submitted all the supporting documents.Now that the certificate has been issued,Please guide me through the process of change of name of the firm in the certificate. I had even approached the concerned authority when they uploaded the inspection report with wrong name but by the time they take any action,the certificate was issued.</span><br style=\"color: #333333; font-family: monospace; font-size: 12px;\" /><span style=\"color: #333333; font-family: monospace; font-size: 12px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Kindly resolve the issue ASAP.I shall be obliged for your this job of kindness.</span><br style=\"color: #333333; font-family: monospace; font-size: 12px;\" /><span style=\"color: #333333; font-family: monospace; font-size: 12px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nb