(61, '5B3B386083047', '2018-07-03 08:48:32', 'sales.eama@gmail.com', 9954270904, 'AA16686/ABYPJ1609B/06/2018', 'Ashok Kumar Jain', '', 5, '<p>Dear Sir/Ma\'am,&nbsp;</p>\r\n<p>We have already raised a ticket in an issue vide Ticket No :&nbsp;5B373434B0983.&nbsp;</p>\r\n<div title=\"Page 1\">\r\n<div>\r\n<div>\r\n<div>\r\n<p>We had applied for renewal of seed licence via UAIN - DOA/F14/KM/000006/06/2018 but it is not reflecting in DAO Kamrup&rsquo;s office and hence our renewal process cannot be completed.</p>\r\n<p>As per our previous ticket, you had asked to contact&nbsp;Mr. Palashmani Baruah , Mobile no (9435543404) of Agricuture Department. But on contacting him, it was conveyed to us that he is not responsible for renewal of seed license and asked us to contact&nbsp;the seed license division. On contacting the seed license division, they asked us to contact NEGP cell. We are unable to find the right person to process this application.&nbsp;</p>\r\n<p>We had applied on 07/06/2018 with all proper documentation and are still not being able to obtain the license&nbsp;and&nbsp;our renewal process is being delayed indefinitely.</p>\r\n<p>Kindly provide us with a proper channel as to whom we can contact and obtain our license renewal at the earliest.</p>\r\n<p>Thank you,&nbsp;</p>\r\n<p>For&nbsp;</p>\r\n<p>Eastern Agro Marketing Agencies</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', NULL, '', 3, 1, '', 5),
