(114, '5B456A7BDE260', '2018-07-11 02:24:59', 'newtanwirmedicalchotajan@gmail.com', 9957293687, 'AA18738/AANFT8216C/07/2018', 'Md Ashik Hussain & Ruhul  Amil', '', 2, '<p>Respected Sir/Madam,</p>\r\n<p>                         We are the partners of M/s Tanwir Medical Store , Chotajan Dakhinhengra, Dist: Golaghat, Assam.  We applyed for a partnership firm . But in  the time of fillup the from 19 it is shown as proprietorsh firm.  Therefore, we request your goodoffice to take necessary action in this regards &  convert the application form \" proprietorship\"  to  \"partnership\" firm as early as possible. </p>\r\n<p>                         yours faithfully,<br><br>                        Md Ashik Hussain & Ruhul Amin<br>                         Partners of M/S Tanwir Medical Store.</p>', NULL, '', 3, 6, '', 5),
(115, '5B4581784C08B', '2018-07-11 04:03:04', 'paulbricksfield@gmail.com', 8811827555, 'AA03804/AAOFP6542Q/08/2017', 'SATYA RANJAN PAUL', '', 3, '<p>TRY TO UNDERSTAD WHAT I WANT TO SAY. THE INCOMPLETE APPLICATION IS FOR THE YEAR 2018 -19 AND YOU ARE SAYING AGAIN AND AGAIN ABOUT THE CERTIFICATE ISSUE FOR THE YEAR 2017 -18.THE PAYMENT RELATED ISSUE WHICH IS DEDUCTED FROM BANK BUT NOT YET SUCCESSFUL IN MY DASHBORD IS FOR THIS CURRENT YEAR NOT FOR THE EARLIER YOU ARE SAYING PLEASE TAKE THE ISSUE SERIOUSLY AND HELP ME TO RECOVER MY AMOUNYT WHICH IS DEDUCTED FROM MY BANK ACCOUNT IN YOUR FAVOUR BUT YET NOT UPDATED THANK YOU.HOPE THIS TIME YOU UNDERSTAND WHAT I WANT TO SAY.DOCUMENT ATTACHED MY BANK STATEMENT FROM WHICH THE AMOUNT DEDUCTED</p>', '5620be4ed2a1ede0418cdbc6ba4d880f6bbe5c62.jpg', '', 3, 6, '', 5),
(116, '5B45A8EA6C265', '2018-07-11 06:51:22', 'titabartirupati123@gmail.com', 7002793185, 'AA18062/DRNPS7783F/06/2018', 'Mrs  Minu  Saikia', '', 2, '<p>Dear  Sir,           <br>            I Mrs Minu Saikia, Proprietor of M/S Tirupati Medicine, Bibijan Tiniali, Titabar, Dist: Jorhat, my application UBIN  AA18062/DRNPS7783F/<br>06/2018. I am to inform you that  my name is wrongly typed on Schedule  X Form 19 . I the refore, request you  kindly to correct my name from Mrs Mainu Saikia to Mrs  Minu Saikia  as early as possible from your end.</p>\r\n<p>             Yours  Faithfully,</p>\r\n<p>              Mrs  Minu Saikia.<br>              Propriewtor of M/S Tirupati Medicine.</p>', NULL, '', 3, 6, '', 5),
(117, '5B45C2E562FA3', '2018-07-11 08:42:13', 'rangdoitea@gmail.com', 9435053537, 'PCB/F50/GG/002426/02/2018', 'RANGDOI TEA COMPANY', '', 1, '<p>Sir,</p>\r\n<p>Why our application take too much time to issue CTO? F<span xss=removed>rom last few days we notice that continuously our application was forwarded by MoniI Nath, Asstt</span><span xss=removed>  </span><span xss=removed>Executive Engineer</span><span xss=removed>  </span><span xss=removed>to Rita Sarania, Regional Executive Engineer and Rita Sarania, Regional Executive Engineer to MoniI Nath, Asstt</span><span xss=removed>  </span><span xss=removed>Executive Engineer. We want to know the reason for delay.</span></p>', '24efa8f78813d31af391d4a86fbe5542ceeb42ef.pdf', '', 3, 31, '', 5),
