(125, '5B470861D7C0A', '2018-07-12 07:50:57', 'amutalib@rediffmail.com', 9435194613, 'RFS/F1/KM/000340/06/2018', 'Abdul Mutalib', '', 2, '<p>D/Sir,</p>\r\n<p>I requested for correction in my application submitted vide&nbsp; RFS/F1/KM/000340/06/2018 by raising a ticket number 5B3B10A1565AA.&nbsp; Request was (1) to correct date of establishment (2) to correct the nature of business as per&nbsp; record made in partnership deed .</p>\r\n<p>You have complied the Ist&nbsp; request by correcting the date but nature of business not changed as requested. But my request has been shown as disposed .</p>\r\n<p>Today I visited the Register of Firms office&nbsp; where it is informed that the correction of nature of business is yet to be done at your end. When I explained the situation, I have been advised to raise a 2nd ticket and submit the problem for necessary action at your end. The matter may be treated as urgent as&nbsp; date of Interview&nbsp; has been fixed tommorrow.</p>\r\n<p>Yours faithfully,</p>\r\n<p>Abdul Mutalib</p>', NULL, '', 1, 6, '', 5),
