(166, '5B502DBFCDC89', '2018-07-19 06:20:47', 'ssaletters@gmail.com', 9653215724, 'AA18493/AAFTS2204K/07/2018', 'SHANTI SEVA ASHRAM (NGO)', '', 7, '<p>Dear Sir/Madam,</p>\r\n<div xss=removed>Our Organization, Shanti Seva Ashram (NGO), situated at Balugada, Sabjibari, Makum Road, Tinsukia, Assam, is registered under the Societies\' Act of 1860  with Registration Number TIN/244/A/06 of 2003-04.</div>\r\n<div xss=removed> </div>\r\n<div xss=removed>Our Society was duly renewed in 2015 and the registration will expire on 22nd July, 2018. We have been trying to upload the application for renewal for the past ten days but failing as the website is not processing the form at \'SAVE & NEXT\'. Also, column number 7 on the application form says \'special characters are not allowed\' when we try to fill in the grant details.</div>\r\n<div xss=removed> </div>\r\n<div xss=removed>We spoke to the Helpline Executive yesterday and were advised to change the browser and try. Accordingly, we shifted to Mozilla Fire Fox and yet the error continues. As advised, we attach the screen shot here for your reference. Kindly do the needful at the earliest. Also advise, if we can submit the application manually.</div>\r\n<div xss=removed> </div>\r\n<div xss=removed>Yours sincerely,</div>\r\n<div xss=removed>K S Lazaras</div>\r\n<div xss=removed>Founder President</div>\r\n<p> </p>', '88db0984250a1ffd3d4069734d5191fb07420198.png', '', 1, 6, '', 5),
