(180, '5B51C3BEE14C5', '2018-07-20 11:13:02', 'hotellily6@gmail.com', 7086020075, ' PCB/F50/KM/000077/05/2017', 'Abhijit', '', 5, '<p>Hi,</p>\r\n<p>This is to inform you that i am not able to register my current year 2018-2019 , when i apply the form for renewal its comes that i have already applied it. I need to apply for my current year.</p>\r\n<p>So it my humble request you to do the needful asap.</p>\r\n<p>Thanking you -</p>', NULL, '', 2, 45, '31,32', 5),
(181, '5B51E64AD3EB0', '2018-07-20 13:40:26', 'zulfee20042005@yahoo.co.in', 8011796607, 'FIRE/F11/DI/000627/06/2018', 'JALELUR RAHMAN', '', 1, '<div xss=removed>Dear</div>\r\n<div xss=removed>Sir,</div>\r\n<div xss=removed>It is  a FOURTH REMINDER,</div>\r\n<div xss=removed>I submitted the application for RENEWAL OF FIRE NOC UNDER ASSAM FIRE SERVICE RULE 1989; on 06/06/2018.</div>\r\n<div xss=removed>Till date no action has been taken.</div>\r\n<div xss=removed>Unique Application Identification Number (UAIN) is FIRE/F11/DI/000627/06/2018.</div>\r\n<div xss=removed>Kindly process the same at an early date.</div>\r\n<div xss=removed>Also please note, I have written on the email add(<a xss=removed href=\"mailto:eodb.assam@gmail.com\" target=\"_blank\" rel=\"nofollow noopener noreferrer\">eodb.assam@gmail.com</a>) twice and remineded, and also put a grivence on your website  (EGR/22620292/06/2018) for the same, but with out any reply. Earlier <span xss=removed>T</span><span xss=removed>icket( #5B3B2F64F1B40.</span></div>\r\n<div xss=removed>Regards</div>\r\n<div xss=removed>Dr Jalelur Rahman</div>', NULL, '', 3, 45, '34', 5),
(182, '5B52CF1EBCEF9', '2018-07-21 06:13:50', 'nazneen.rahman123@gmail.com', 9864018191, 'PCB/F50/KM/003964/06/2018', 'nazneen rahman', '', 6, 'i have wrongly updated  and forwarded the CTO of m/s govindam in the file m/s gm gopal maharaj to Dr. D n DAS, ACEE. so this needs to be reverted back to my inbox so that necessary corrections can be made from my end.\r\nthanks.', NULL, '', 1, 6, '', 5),
(183, '5B52EB389473E', '2018-07-21 08:13:44', 'dkumarandcompany@gmail.com', 7670011106, 'RFS/F1/KM/000190/04/2018', 'D KUMAR & COMPANY', '', 2, '<p>Dear Sir/Madam,</p>\r\n<p>We are changing the nature of Business as per partnership deed ( Deals in Contract & Govt.Supply of PVC Pipes & Fittings Pumps,Construction materials etc.)</p>\r\n<p>So, Please updated the same .</p>', NULL, '', 3, 45, '', 5),
