(207, '5B57044D952C2', '2018-07-24 10:49:49', 'drugscontrol.assam@gmail.com', 9401981967, 'SDC/F2/BP/000389/04/2018', 'M/s. Barpeta Road Medicos ', '', 6, 'Remainder-1\r\nDear Sir,\r\nI have the honour to inform you that due to over sight the licenced was issued wrongly against the UNI No. SDC/F2/BP/000389/04/2018. Therefore please kindly cancel the previous drug licence no and allow me to reissue the said Drug licence again with proper licence no.\r\nThanking You.\r\nWith Regards\r\nDeba Kr. Das\r\nLicensing Authority, Assam\r\nHengrabari, Guwahati-36 \r\n', NULL, '', 0, 6, '', 5),
(208, '5B57092F9F896', '2018-07-24 11:10:39', 'ratul_ali@rediffmail.com', 9101100481, ' AA07091/CILPB1327E/12/2017 / SDC/F3/KM/000018/03/2018', 'Monima Bora', '', 6, '<p>Sir/Madam,</p>\r\n<table xss=removed width=\"100%\">\r\n<tbody xss=removed>\r\n<tr xss=removed>\r\n<td xss=removed>\r\n<p>           License No: D/OL/KMP/19200-19201 issued in Form 20-B and Form 21-B issued from your end is wrong may be by mistake as already i have the wholesale License No: D/ONL/KM P/19086-19087 with UBIN & UAIN- AA07091/CILPB1327E/12/2017 & SDC/F1/KM/000044/12/2017.<br>           I had applied Scedule X Drug License i Form 19C but may be by mistake issued the same License No: D/OL/KMP/19200-19201 again  which i already have (License No: D/ONL/KM P/19086-19087).</p>\r\n<p>            The Matter is discussed with Drug Controller Sir, Drug Inspector sir, Kamrup Metro. They advised me to mail by requesting reissue the Scedule X Drug License and to cancel License No: D/OL/KMP/19200-19201  with UBIN & UAIN- AA07091/CILPB1327E/12/2017 & SDC/F3/KM/000018/03/2018.</p>\r\n<p>            Therefore, i would like to request you to issue the correct license (Schedule-X) as early possible.</p>\r\n<p> </p>\r\n<p>Regards,</p>\r\n<p>Monima Bora,</p>\r\n<p>Prorietor of Eureka drug and Surgical,</p>\r\n<p>Ajanta Path, Hatigaon, Ayesha Market</p>\r\n<p>Guwahati-38 </p>\r\n<p> </p>\r\n</td>\r\n</tr>\r\n<tr xss=removed>\r\n<td xss=removed> </td>\r\n</tr>\r\n<tr xss=removed>\r\n<td xss=removed> </td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p> </p>', 'fc49e7aaac732e3fb488187d8c6d405787958bec.doc', '', 0, 6, '', 5),
(209, '5B570E10503C8', '2018-07-24 11:31:28', 'alamajrooh@gmail.com', 9435993637, 'AA03303/ACJPD0785C/07/2017', 'gita dutta', '', 2, '<p>sir i have two ubain registered in my name</p>\r\n<p> 1- <span xss=removed>AA03270/ACJPD0785C/07/2017</span></p>\r\n<p> 2-<span xss=removed>AA03303/ACJPD0785C/07/2017</span></p>\r\n<p><span xss=removed> i have filed fir renewal in  pollution department for no -1 ubain -</span><span xss=removed>AA03270/ACJPD0785C/07/2017</span></p>\r\n<p><span xss=removed>but there is issue filing the second ubain - </span><span xss=removed>AA03303/ACJPD0785C/07/2017 </span><span xss=removed>one in pollution department it give me massage that you have success fully submitted.</span></p>\r\n<p><span xss=removed> there would be correction in the second ubain name to \"MAA KALYANI BRICKS -1 \" AND THIS would be branch of the first one.</span></p>', NULL, '', 2, 6, '', 5),
(210, '5B5715D5E7FE5', '2018-07-24 12:04:37', 'rimjhim.goenka25@gmail.com', 8789708637, 'RFS/FI/CA/000372/06/2018', 'Barak Valley Infrastructure', '', 5, '<p>As per the Inbox query, Sl. No. 1 states that <span xss=removed>Submit Re-Constitution Deed mentioning the principal place of business and any other place of business as stated in form no. 1</span></p>\r\n<p><span xss=removed>What does it mean??</span></p>\r\n<p><span xss=removed>We have already submitted the Tenancy agreement as address proof.</span></p>', NULL, '', 3, 45, '', 5),
