(214, '5B58111225612', '2018-07-25 05:56:34', 'rimjhim.goenka25@gmail.com', 8789708637, ' RFS/F1/CA/000372/06/2018', 'Barak Valley Infrastructure', '', 5, '<p>As per query raised by department in Sl. 1 we beg to state that the nature of business as per Deed of partnership is as \"</p>\r\n<p xss=removed><span xss=removed><span xss=removed>a)<span xss=removed>    </span></span></span><span xss=removed>To carry on the business of manufacturers of, dealers in, exporters and importers of, all varieties of AAC Blocks, Bricks, Hollow Bricks, moulded Bricks, Cubes, Moulds, Concrete Bricks/structures/Blocks/Tiles and any other kind and grades of Bricks, Blocks & structures, joining mortar, plaster, or any ready mix or other masonry or adhesive material and consequently to manufacture, sell and deal in all or any of by products which will be obtained in the process of manufacturing these products from Fly Ash, Sand, Red Mud, River Sand, Lime, Cement, Gypsum,</span><span xss=removed><span xss=removed>        </span></span></p>\r\n<p xss=removed><span xss=removed><span xss=removed>b)<span xss=removed>      </span></span></span><span xss=removed>Stone Dust, Stone Chips, Aluminium Powder, Foamy agents and chemicals and other similar products.</span></p>\r\n<p xss=removed> </p>\r\n<p xss=removed><span xss=removed><span xss=removed>c)<span xss=removed>      </span></span></span><span xss=removed>To act as commission agents, stocklists, distributors, handling agents etc.</span></p>\r\n<p> </p>\r\n<p xss=removed><span xss=removed> </span><span xss=removed><span xss=removed>d)<span xss=removed>     </span></span></span><span xss=removed>Such other business as may be agreed.</span></p>\r\n<p xss=removed> </p>\r\n<p xss=removed><span xss=removed>We request you to please update this as our nature of business. </span></p>\r\n<p> </p>', '1ce06cda0145ebc5936ed9faa7078444cbe8514f.pdf', '', 3, 45, '', 5),
