(223, '5B583DE229E51', '2018-07-25 09:07:46', 'DAS.PINKU279@GMAIL.COM', 7002327104, 'AA17641/ABCPC8771F/06/2018', 'MAX WELLNESS CENTER', '', 2, '<p>Dear Sir/Madam,</p>\r\n<p> Due to some reason I have to change the previous pharmacist ( which docouments are uploded) and now I upload the new pharmacist licence with other releated docouments.</p>\r\n<p>Kindly change the previous one and consider the new one.</p>\r\n<p> </p>\r\n<p>with regaeds,</p>\r\n<p>Thanking You,</p>\r\n<p><span xss=removed>ANAND KUMAR CHOUDHURY</span> </p>\r\n<p>(MAX WELLNESS CENTER)</p>', '9acc027e6271f5f988867ba22dbb2c3b9004551e.pdf', '', 3, 45, '', 5),
