(225, '5B5847B3F3F1E', '2018-07-25 09:49:39', 'jitendrasingh@patanjaliayurved.org', 8126012222, 'AA18362/AAJCP2290F/07/2018', 'Parakram Security India Pvt Ltd', '', 3, '<p>Dear Sir</p>\r\n<p>For your kind information, i have paid Rs.2500/- Govt Fee through Online (Via Debit Card) for Fresh Registration under Shop & Establishment in Kamrup-Rural 01 Year. </p>\r\n<p>My application Payment E-Challan No-LABD-5b5840b24111 & i paid Rs.2500/- Amt deducted from my account but Paid Challan not generated. </p>\r\n<p> </p>\r\n<p>Pl help us. So that we able to complete our incomplete application on time.</p>\r\n<p> </p>\r\n<p>Regards</p>\r\n<p>Parakram Security India Pvt Ltd. </p>', NULL, '', 2, 6, '', 5),
(226, '5B58535689233', '2018-07-25 10:39:18', 'hrfoundation1960@gmail.com', 9401584009, 'AA15222/NPDAR15222/05/2018', 'Arup Kumar Chowdhury', '', 2, '<p>We have registered our organization in the name of H. R. Foundation in the CAF, whereas the Register of Firms and Societies raise a query at the time of Registration of our organization as a society that the name should be in full. So we want to change the Registered Name of our organization in the CAF.</p>\r\n<p>So kindly change the name of our organization from H. R. Foundation to Hriday Ranjan Foundation in the CAF.</p>', NULL, '', 3, 45, '', 5),
