(230, '5B5862E57DDB4', '2018-07-25 11:45:41', 'dsharma@smindia.co.in', 8876924689, 'AA03702/AADCB4412H/08/2017', 'BRAHMAPUTRA FOODS PRIVATE LIMITED', '', 2, '<p>Dear Sir,</p>\r\n<p>Firstly We have a existing registered company M/s Brahmaputra Foods Private Limited with UBIN No. AA03702/AADCB4412H/08/2017 with PAN AADCB4412H as an Unit situated at Mirza, Kamrup, Assam.</p>\r\n<p>Now the issue is we need to register a new factory in the name of Brahmaputra Foods Pvt. Ltd. with the same PAN AADCB4412H but not able to do that due to the same PAN. </p>\r\n<p>Then, we choose to add a unew unit option from there we added a new unit with the same name & PAN providing all the required details but before submission there was no option for choosing existing unit or new unit option or the date of commencement of business, now as we submitted the details are showing of the previous UBIN instead of the new.</p>\r\n<p>In the UBIN <span xss=removed>AA19726/AADCB4412H/07/2018 we need to change the Unit from existing to NEW and the date of commencement of business from old one to NEW 29.03.2017.</span></p>\r\n<p> </p>\r\n<p><span xss=removed>Pls. guide and do the required needful.</span></p>\r\n<p class=\"MsoNormal\"> </p>\r\n<p> </p>\r\n<p class=\"MsoNormal\"> </p>\r\n<p> </p>\r\n<p> </p>', NULL, '', 3, 45, '', 5),
(231, '5B58769E43873', '2018-07-25 13:09:50', 'dkumarandcompany@gmail.com', 7670011106, 'RFS/F1/KM/000190/04/2018', 'D KUMAR & COMPANY', '', 2, '<p>Dear Sir/Madam,</p>\r\n<p>We would like to request you that when we were appling the registration of <span xss=removed>REGISTRAR OF FIRMS & SOCIETIES than our office address was R D Enclave , 2nd Floor , Christian Basti , Guwahati -05 & now our registered office is Unit-4A , 4th Floor , Mayur Gardens , ABC Bus Stop , Bhangagarh , Guwahati -05.</span></p>\r\n<p><span xss=removed>So. threrefore request you to kindly updated the same for future crosspondenses.</span></p>\r\n<p><span xss=removed>Thanks</span></p>', 'd29aeda2441dcb83fd27212cb3ea499f0a6dfa92.pdf', '', 3, 45, '', 5),
(232, '5B58999B8970E', '2018-07-25 15:39:07', 'ananta.baishya@gmail.com', 9864057753, 'RFS/F1/KM/000504/07/2018', 'BAJU ASSOCIATES', '', 2, '<p>1. Have to change principal place of proposed firm, wrongly enter our workshop address which is in under construction, and our workshop address is not added in our registered partnersheep deed. </p>\r\n<p>2.Have to delete 2 nos partner (a) Kabita Baishya (b) Jahnabi Baishya, they are not registered partner, but wrongly enter in the form.</p>', NULL, '', 3, 45, '', 5),
(233, '5B58A9E238455', '2018-07-25 16:48:34', 'ssarmah83@gmail.com', 7002764425, 'AA19116/DGVPS7107G/07/2018', 'Saurabh Sharmah', '', 3, '<p xss=removed>Dear Sir,</p>\r\n<p xss=removed>I am applied a <span xss=removed>Application for Registration of Establishment under the Assam Shops & Establishment Act,1971 in FORM O Under Section 36 and RULE 45 of the Assam Rules to </span><span xss=removed>COMMISSIONERATE OF LABOUR vide UAIN no- </span><span xss=removed>LEDL/F1/GG/000025/07/2018 and make a payment of Rs.100/- vide challan no- LABD_5b5026b730e3f Tnx No-820010021008 dated 19.07.2017. After making the payment it is not shown in the side so I can\'t finaly submit the application. You are hereby requested to kindly look after this matter and solve the problem.</span></p>\r\n<p xss=removed> </p>\r\n<p xss=removed><span xss=removed>Befor this complain I was alrady rais a ticket being no-</span>5B5087386BB59 which was closed without solving the problem. So, this time you are again and again requested to solve the problem and request kindly donot close the ticket without solve the problem. </p>\r\n<p xss=removed><span xss=removed>Thanks & regards</span></p>\r\n<p xss=removed><span xss=removed>For, Sai Automobiles</span></p>\r\n<p xss=removed><span xss=removed>Saurabh Sharmah</span></p>', NULL, '', 3, 45, '', 5),
(234, '5B594F4D5332D', '2018-07-26 04:34:21', 'florateasociety@gmail.com', 9401584009, 'AA18450/NPDAR18450/07/2018', 'Arup Kumar Chowdhury', '', 2, '<p>Kindly change the 6th No. column of the executive committee list which was wrongly entered the designation of the person named Manuj Boro was Advisor. He is not the Advisor he is an executive member.</p>\r\n<p>So change the designation field of Mr. Manuj Boro as Executive Member as soon as possible.</p>', NULL, '', 3, 45, '', 5);
