(282, '5B6011878840C', '2018-07-31 07:36:39', 'pureandcure.assam@akums.in', 9401450222, 'SDC/F20/KU/000089/07/2018', 'Pure and Cure Healthcare Pvt. Ltd. ', '', 5, '<p>Dear Sir,</p>\r\n<p>With respect to UAIN no. SDC/F20/KU/000089/07/2018 we wish to inform you that please consider following details against products mentioned in the s.no. as stated in our application:</p>\r\n<p>For product mentioned at S.no. 6 (Betahistine Tablets 16mg), in the last column please mention that the product is approved by DCGI on 20/01/2000 at s.no. 352.</p>\r\n<p>For product mentioned at S.no. 7 and 8 (Clobazam Mouth Dissolving Tablets 5mg/10mg), in the last column please mention that the product is not approved by DCGI.</p>\r\n<p>For product mentioned at S.no. 9 and 10 (Oxcarbazapenine Tablets IP 150mg & 300mg), in the last column please mention that the product is approved by DCGI on 13/08/2009 at s.no. 132</p>\r\n<p>Thanks & Regards</p>\r\n<p>For Pure & Cure Healthcare Pvt. Ltd.</p>', 'cf1129c5752ce2e31d6a80d55b28ec5699b76f06.pdf', '', 1, 6, '', 5),
(283, '5B601327C0677', '2018-07-31 07:43:35', 'pureandcure.assam@akums.in', 9401450222, 'SDC/F20/KU/000082/06/2018', 'Pure and Cure Healthcare Pvt. Ltd.', '', 5, '<p>Dear Sir,</p>\r\n<p>With respect to UAIN no. SDC/F20/KU/000082/06/2018, kindly, consider following remarks against product mentioned at below s.no. in our application:-</p>\r\n<p>For product mentioned in s.no. 7 (Acebrophylline Capsules 100mg), please mention on the last column that, the product has been approved by DCGI on 29/05/2008 at s.no. 141.</p>\r\n<p>For product mentioned at s.no. 10 (Ranitidine Tablets IP 300mg), please mentioned on the last column that, the product is in page no. 3098 of IP-2018.</p>\r\n<p> </p>\r\n<p>With Regards</p>\r\n<p>For Pure & Cure Healthcare Pvt. Ltd.</p>', '8afcaab15e13e12b667c12c77db44f23dca3a6fd.pdf', '', 1, 6, '', 5),
(284, '5B6014C20B6B8', '2018-07-31 07:50:26', 'pureandcure.assam@akums.in', 9401450222, 'SDC/F20/KU/000079/06/2018', 'Pure and Cure Healthcare Pvt. Ltd.', '', 5, '<p>Dear Sir,</p>\r\n<p>With respect to UAIN no. SDC/F20/KU/000079/06/2018, please consider following remarks against product mentioned on below s.no. on our application:-</p>\r\n<p>For product mentioned at s.no. 1 (Clonazepam Mouthe Dissolving Tablets 0.5mg), please mention in the last column that, the product is not approved by DCGI.</p>\r\n<p>For product mentioned at s.no. 2 (Phenobarbitone Tablets IP 30mg), please mention in the last column that, the product is in page no. 2900 of IP-2018.</p>\r\n<p>For product mentioned at s.no. 3 (Metformin Hydrochloride Sustained Release Tablets IP 500mg), please mention in the last column that, the product is approved by DCGI on September 1961 at s.no. 35.</p>\r\n<p>Warm Regards</p>\r\n<p>For Pure & Cure Healthcare Pvt. Ltd.</p>', 'fbca6de54ad015983a79e7ab88b9b936a0a4b733.pdf', '', 1, 6, '', 5),
(285, '5B6016BD09178', '2018-07-31 07:58:53', 'pureandcure.assam@akums.in', 9401450222, 'SDC/F20/KU/000078/06/2018', 'Pure and Cure Healthcare Pvt. Ltd.', '', 5, '<p>Dear Sir,</p>\r\n<p>With respect to UAIN no. SDC/F20/KU/000078/06/2018, please consider following remarks against product at below s.no. in our application:-</p>\r\n<p>For product mentioned in s.no. 1 & 2 (Paroxetine Prolonged Release Tablets IP 37.5mg & 25mg), in the last column please mention that, the product is in page no. 2870 of IP-2018</p>\r\n<p>For product mentioned in s.no. 3 (Isosorbide Mononitrate Tablets IP 20mg), in the last column please mention that, the product is approved by DCGI on August 1985 at s.no. 50</p>\r\n<p>For product mentioned in s.no. 4 (Diclofenac Potassium Sustained Release Tablets 100mg), in the last column please mention that, the product is approved by DCGI on Jan 1988 at s.no. 187</p>\r\n<p>For product mentioned in s.no. 5 (Amlodipine Besylate Tablets IP 5mg), in the last column please mention that, the product is approved by DCGI on 02/05/2009 at s.no. 78</p>\r\n<p>For product mentioned in s.no. 7 & 8 (Sevelamer Carbonate Tablets 400mg & 800mg), in the last column please mention that, the product is approved by DCGI on 28/04/2008 at s.no. 121</p>\r\n<p>For product mentioned in s.no. 9 (Linezolid Tablets IP 600mg), in the last column please mention that, the product is approved by DCGI on 30/05/2004 at s.no. 206</p>\r\n<p> </p>\r\n<p>Warm Regards</p>\r\n<p>For Pure & Cure Healthcare Pvt. Ltd.</p>\r\n<p> </p>', '9a5deb92db91a8d8a020f9b8646876bb4315e4c8.pdf', '', 1, 6, '', 5),
(286, '5B601DFB1A96A', '2018-07-31 08:29:47', 'rajkumartarit@rediffmail.com', 9864043930, 'AA19365/AHCPG3650K/07/2018', 'COL RTC GOHAIN', '', 3, '<p>We have uploaded the challans of Rs.100.00(Treasury challan No.7/4119 through SBI, Dispur) in payment mode. The file is uploaded which we have viewed. But no acknowledgement is received. Kindly look into the matter.</p>', 'a2589211af91d74ebcb64dd33b672cadbee9db95.jpg', '', 0, 6, '', 5),
