(289, '5B602636ACC35', '2018-07-31 09:04:54', 'pureandcure.assam@akums.in', 9401450222, 'SDC/F54/KU/000033/06/2018', 'Pure and Cure Healthcare Pvt. Ltd.', '', 5, '<p>Dear Sir,</p>\r\n<p>With respect to UAIN no. SDC/F54/KU/000033/06/2018, please consider following remarks against product at below s.no. in our application:</p>\r\n<p>For product mentioned in s.no. 1 (Serratiopeptidase Tablets IP 10mg), in the last column please mention that, the said product is in page no. 3181 of IP-2018.</p>\r\n<p>For the product mentioned at s.no. 2 (Betamethasone Tablets IP 0.5mg), in the last column please mention that, the product has been approved by DCGI of August 1961 at s.no. 33.</p>\r\n<p>For the product mentioned at s.no. 3 (Betamethasone Sodium Phosphate Tablets IP 0.5mg), in the last column please mention that, the product has been approved by DCGI of August 1961 at s.no. 33.</p>\r\n<p>For the product mentioned at s.no. 4 (Methylergometrine Tablets IP 0.125mg), in the last column please mention that, the said product is in page no. 2567 of IP-2018.</p>\r\n<p>For the products mentioned in s.no. 5 & 6 (Calcium with Vitamin D3 Tablets IP 250mg+125IU & 500mg + 500IU), in the last column please mention that, the said product is in page no. 1466 of IP-2018</p>\r\n<p>For the product mentioned at s.no. 7 (Calcium Citrate Malate & Vitamin D3 Tablets 250mg+1000IU), in the last column please mention that, the said product is not approved by DCGI. </p>\r\n<p>Warm Regards</p>\r\n<p>For Pure & Cure Healthcare Pvt Ltd.</p>', '82ab965558038426ad30e44f00c92f3ab00411e6.pdf', '', 1, 6, '', 5),
