(300, '5B61A487C60D2', '2018-08-01 12:16:07', 'islamaminur11@gmail.com', 9435081467, 'AA13093/NPDGA13093/07/2018', 'Aminur Islam', '', 2, '<p>At first we submit as PIAZBARI DEVELOPMENT FOUNDATION.</p>\r\n<p>But this name is exist as <span xss=removed>PIAZBARI JONOKALYAN SOCIETY and the registrar of societies and firm reject it.</span></p>\r\n<p><span xss=removed>Now we had changed the name as PIAZBARI ROYAL FOUNDATION.</span></p>\r\n<p><span xss=removed>So please change the the Name Piazbari Development Foundation as new name  PIAZBARI ROYAL FOUNDATION</span></p>', 'f38ef0f12cb71bd852af022c99fbd11e7a1bc55e.jpg', '', 2, 6, '', 5),
