oved> </span></p>\r\n<p class=\"MsoNormal\" xss=removed><span xss=removed>Thanking you,</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span xss=removed> </span></p>\r\n<p class=\"MsoNormal\" xss=removed><span xss=removed>Our  <strong>Unique Business Identification Number</strong></span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><span xss=removed>        (UBIN)</span></strong><span xss=removed> is <strong>AA12884/NPDMA12884/03/2018.</strong></span></p>\r\n<p class=\"MsoNormal\" xss=removed><span xss=removed> </span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><span xss=removed>Email: <a href=\"mailto:crybokakhat@gmail.com\" target=\"_blank\" rel=\"noopener noreferrer\"><span xss=removed>crybokakhat@gmail.com</span></a></span></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span xss=removed> </span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><span xss=removed>        ( Manoj Pegu )</span></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><span xss=removed>     Secretary, Creative River Youth</span></strong></p>\r\n<p class=\"MsoNormal\"> </p>', 'd9e35bc24648a2f57ab46c3e2718dff34e185201.pdf', '', 3, 45, '', 5),
(303, '5B61DAA849CFF', '2018-08-01 16:07:04', 'diliprajkhowa18@gmail.com', 7002235188, 'AA19915/AHYPR4143G/07/2018', 'MM Car Care', '', 3, '<p>Dear Sir,</p>\r\n<p> </p>\r\n<p>My payment regarding my application <span xss=removed>for </span><span xss=removed>Registration of Establishment under the Assam Shops & Establishment Act,1971 in FORM O Under Section 36 and RULE 45 of the Assam Rules is not upload till now.</span></p>\r\n<p><span xss=removed>I am rais ticket two time for solve the problem but from your end every time closed my ticket without solving the problem. So, you are again third time requested to kindly look after the matter seriously and solve the problem so that I can submit my application.</span></p>\r\n<p> </p>\r\n<p><span xss=removed>Thanks & regards</span></p>\r\n<p> </p>\r\n<p><span xss=removed>Dilip Rajkhowa</span></p>\r\n<p> </p>', NULL, '', 3, 45, '', 5),
