(378, '5B6C24136F1BD', '2018-08-09 11:22:59', 'jayanta.sarma@marico.com', 8876517312, 'SDC/F58/KU/000066/04/2018 ', 'jayanta kumar sarma', '', 6, '<p> </p>\r\n<p xss=removed><span xss=removed>Dear Sir/Madam,</span></p>\r\n<p> </p>\r\n<p xss=removed><span xss=removed>I have submitted one Application for manufacturer of additional products of Cosmetics for sale or distribution - Form 31via UAIN No- <strong><em>SDC/F58/KU/000066/04/2018</em></strong> bearing product Name </span><span xss=removed>“<strong>HAIR & CARE FRUIT OILS WITH MULTIVITAMINS ORANGE ANAR & STRAWBERRY</strong>” </span><span xss=removed>& <strong>“</strong></span><strong><span xss=removed>HAIR </span></strong><strong><span xss=removed>& </span></strong><strong><span xss=removed>CARE </span></strong><strong><span xss=removed>FRUIT OILS WITH MULTIVITAMINS OLIVE MOSAMBI & </span></strong><strong><span xss=removed>GREEN </span></strong><strong><span xss=removed>APPLE”</span></strong> <span xss=removed>for mfg Lic No C-27M/ 2016.</span></p>\r\n<p> </p>\r\n<p xss=removed><span xss=removed>We have got the License too from state drug control organization, Hengrabari, Guwahati on 09.05.2018. But after getting of license we have observed some spelling mistake while typing the alphabets from our end which is highlighted on attached file.  </span></p>\r\n<p> </p>\r\n<p xss=removed><span xss=removed>As advised by Mr. Debo Das ( Drugs Controller i.c) of state drug control organization, Hengrabari, Guwahati I have sent the mail to you so that you can do the necessary corrections for the same.</span></p>\r\n<p> </p>\r\n<p xss=removed><span xss=removed>Requesting you kind support.</span></p>\r\n<p> </p>', 'd8d226afb8f6cf5c30ff7724c36f03f31c1e5a49.pdf', '', 1, 6, '', 5),
(379, '5B6C2B1B169F0', '2018-08-09 11:52:59', 'anubhavmahanta09@gmail.com', 9954322960, 'AA20452/BLXPM1847A/08/2018', 'Anubhav mahanta', '', 2, '<p><span xss=removed>Respected Sir/Madam,</span></p>\r\n<p><span xss=removed>                 I have applied for a pharmacy license in the name of <span xss=removed>PRADHAN MANTRI BHARTIYA JANAUSHADHI KENDRA (A UNIT OF PRADHAN MANTRI BHARTIYA JANAUSHADHI KENDRA)</span>. I have uploaded the pharmacist registration details, but may be because of technical error it is not visible at your end. I’ve suggested by your help line to write it here. Kindly find the attached document (<em xss=removed>1 up to date registration certificate</em>).</span></p>\r\n<p><span xss=removed><span xss=removed>            </span><span xss=removed>      </span>Dear Sir/Madam, I’ve two more requests. Kindly accept the 2<sup>nd</sup> part of the agreement details uploaded as <em xss=removed>2 agreement part B </em>in the same pdf file.</span></p>\r\n<p><span xss=removed><span xss=removed>            </span><span xss=removed>       </span>Lastly, as the name showing <em xss=removed>A UNIT OF PRADHAN MANTRI BHARTIYA JANAUSHADHI KENDRA </em>in the brackets is not required. As a new (for opening a branch) applicant hope you will accept my sincere request.</span></p>\r\n<p><span xss=removed> </span></p>\r\n<p><span xss=removed>With regards</span></p>\r\n<p><span xss=removed>Anubhav Mahanta</span></p>\r\n<p class=\"MsoNormal\"><span xss=removed> </span></p>', '34ea31fe5693632c2c1074fcef23c9fb485d0198.pdf', '', 2, 6, '', 5),
