(398, '5B712A852BDEE', '2018-08-13 06:51:49', 'devalbaruah@gmail.com', 9008250008, 'AA15370/AAXAS9201R/05/2018', 'Society for Promotion of Education and Economic Development', '', 6, '<p>Hi,</p>\r\n<p>We had applied for address change of \"Society for Promotion of Education & Economic Development\" from Ambikagiri Nagar, R.G. Baruah Road, Guwahati- 24 to <strong>Abirkunj Aparments Flat No B-3 Mother Teresa Road Hatigarh Chariali Guwahati-21</strong>. We have got Registration Certificate with new changed address. </p>\r\n<p>But while we are trying to apply for \"<span xss=removed>Certified copy of the Society registered under Section 19 of the S.R. Act XXI of 1860\", it is showing previous address rather than new updated address in EODB portal.  So please help us to get in portal present correct address for further action. </span></p>\r\n<p><span xss=removed>We will be thankful for your act.</span></p>\r\n<p> </p>\r\n<p><span xss=removed>With Regards,</span></p>\r\n<p><span xss=removed>Deval Baruah.</span></p>\r\n<p><span xss=removed>(Secretary) </span></p>', 'c039f31c9a99d5f0701206178122ab6c744ff980.pdf', '', 3, 45, '', 5),
(399, '5B7131C5469AE', '2018-08-13 07:22:45', 'banajyotideka@gmail.com', 9957192886, 'RFS/F15/KM/001247/08/2018', 'BRIHATTAR KALITAKUCHI 2NO BIRKUCHI BIHU  UDJAPAN SAMITEE', '', 2, '<p>THIS IS TO CERTIFY THAT I MR PRABHAT CHANDRA GOGOI PRESIDENT OF BRIHATTAR KALITAKUCHI 2NO BIRKUCHI BIHU UDJAPAN SAMITEE, I SUBMITTED & PAYMENT 50/- FOR SUBMITTING MY APPLICATION. ALL SUBMITING DATA ARE CORRECT IN MY APPLICATION AGAINST COLUMN NO 5. HERE YOU ARE REQUIRED SUM MEMBERS NAME. I SUBMITTED MEMBERS NAMES ARE IN YOUR ATTACHMENT ENCLOSED.BUT I RECEIVE SUM OTHER PERSONS NAME IN MEMBER LIST. THAT PERSON I  DONT KNOW. AND THE 2ND IS IN MY ADDRESS POLICE STATION NAME IS NOONMATI AGAINST NOONMAYI. </p>\r\n<p>THANKS                                                                                                                                                                                                                                                                                                                      </p>', '5923ffee303f56efaaa2501ef53aa0b0d4d10f12.pdf', '', 1, 6, '', 5);
