(404, '5B71AC7EF39B5', '2018-08-13 16:06:22', 'utpalnath@hincol.com', 8638032378, 'AA14297/AAACH1172P/06/2018', 'UTPAL KUMAR NATH', '', 3, '<p class=\"MsoNormal\"><span xss=removed>Dear Sir/ Madam,</span></p>\r\n<p class=\"MsoNormal\"><span xss=removed> </span></p>\r\n<p class=\"MsoNormal\"><span xss=removed>Our Manufacturing unit comes under the Industries having the total investment exceeding Rs. 10.00 crores but not exceeding Rs. 50.00 crores and according to this the consent to establish (NOC)/ payable Fee is INR. 2,00,000/- while applying under the Deptt. Pollution Control Board, Assam for the Pre-establishment application.</span></p>\r\n<p class=\"MsoNormal\"><span xss=removed> </span></p>\r\n<p class=\"MsoNormal\"><span xss=removed>But, during final submission of application a default payable Fee amount of INR. 2,02,200/- is shown.</span></p>\r\n<p class=\"MsoNormal\"><span xss=removed> </span></p>\r\n<p class=\"MsoNormal\"><span xss=removed>Request you to confirm whether INR. 2,00,000/- to pay or INR. 2,02,200/-.</span></p>\r\n<p class=\"MsoNormal\"><span xss=removed> </span></p>\r\n<p class=\"MsoNormal\"><span xss=removed> </span></p>\r\n<p class=\"MsoNormal\"><span xss=removed>Your confirmation is awaited.</span></p>', NULL, '', 3, 45, '31,32', 5),
