(431, '5B7938D710B26', '2018-08-19 09:31:03', 'askmcstsk@gmail.com', 9401104848, 'RFS/F15/TI/000930/07/2018', 'Abhi Saha', '', 2, '<p xss=removed><span xss=removed>Dear Sir,</span></p>\r\n<p xss=removed><span xss=removed>With reference to the query sent by the LDA-Registrar of Firms & Societies relating to the registration of the society Named :AADYA SRISHTI KALA MANDIR CULTURAL SOCIETY\", I on behalf of this society made all necessary changes in the Memorandum of Association and the Rules and Regulations of the Society by taking a resolution dated 28.07.2018 in our general meeting and replied to the query through EODB portal but the department has sent re-query that the Resolution copy regarding the formation of the committee not yet updated and asked to upload it properly.</span></p>\r\n<p xss=removed><span xss=removed>Therefore sir I request you to kindly convert the advisers as mentioned in the Common Application Form into the Executive members of the committee as the advisers are converted into executive members of the committee by a resolution dated 28.07.2018 and kindly make all necessary changes in the Common Application Form of our Society so that we can proceed further to register the society.</span></p>\r\n<p xss=removed><span xss=removed>Please find herewith the attachment of the resolution copy and kindly inform elaborately how to proceed further</span></p>\r\n<p xss=removed><span xss=removed>Following are the queries:</span></p>\r\n<p xss=removed><span xss=removed>25-07-2018 3:09 PM</span>/ <strong>Query Message</strong><span xss=removed> : </span><span xss=removed>1.</span><span xss=removed> Adviser cannot be a member of the executive committee so contact helpdesk no. 91-7086044425, +91-9707026895, (10 am to 5 pm on all working day) and sent email to eodb.assam@gmail.com and remove the adviser from the executive list mention in point-5.</span></p>\r\n<p xss=removed><span xss=removed>10-08-2018 7:13 AM</span>/ <strong>Reply Message</strong><span xss=removed> : </span> Dear Sir, I have uploaded the new executive list along with the other related documents of the meeting and the resolution copy and I have also uploaded the short description of the members in the Rules & Regulation as per resolution copy. I have taken the reference from the form-V available in the website of Registrar of Firms & Societies. It is therefore prayed that your good kind be pleased to look after this application and register our society as soon as possible and oblige. Regards Abhi Saha General Secretary Aadya Srishti Kala Mandir Cultural Society</p>\r\n<p class=\"MsoNormal\" xss=removed><span xss=removed>16-08-2018 12:36 PM</span>/ <strong>Query Message</strong><span xss=removed> : </span>2. Adviser cannot be a member of the executive committee so contact helpdesk no. 91-7086044425, +91-9707026895, (10 am to 5 pm on all working day) and sent email to eodb.assam@gmail.com and remove the adviser from the executive list mention in point-5.</p>', '8c97489f88d6c5a3fbd6b7a8bb37d83e6d610009.pdf', '', 1, 5, '', 5),
