(477, '5B814AD0B34D9', '2018-08-25 12:25:52', 'ratul_ali@rediffmail.com', 9101100481, 'SDC/F3/KM000018/03/2018', 'Monima Bora', '', 2, '<p>Sir/Madam,</p>\r\n<p>I had applied for Scedule X Drug License where i mentioned the Narcotic Drug Name i.e. Fentanyl, Morphine etc. whereas, i had to put  in in the row of <strong>Categories of drugs to be sold. :</strong> Schedule X.</p>\r\n<p>Now, a quesry received from Drug Inspector office as given bellow-</p>\r\n<p><span xss=removed>Query By </span><span xss=removed>: Sr. Inspector of Drugs - STATE DRUGS CONTROL ADMINISTRATION</span></p>\r\n<p><span xss=removed>Subject</span><span xss=removed> : General Query</span></p>\r\n<p><span xss=removed>Query Message</span><span xss=removed> : <strong>pl make the correction of the form of application deleting the name of narcotic drugs and including the name of sch x drugs.</strong></span></p>\r\n<p><span xss=removed><strong>                       </strong>T</span><span xss=removed>herefore, you are requested to make a correction by </span><strong xss=removed>deleting the name of narcotic drugs and including the name of sch x drugs.</strong></p>\r\n<p> </p>\r\n<p><strong xss=removed>Yours Faithfully,</strong></p>\r\n<p><strong xss=removed>Monima Bora,</strong></p>\r\n<p><strong xss=removed>Eureka Drug and Surgical</strong></p>', NULL, '', 1, 6, '', 5),
