(494, '5B845AB863D58', '2018-08-27 20:10:32', 'pscssonitpur@gmail.com', 9365421084, ' RFS/F15/ST/001139/08/2018', 'Mridul Nath', '', 2, '<p class=\"MsoNormal\"><span xss=removed>As per Query </span></p>\r\n<table class=\"MsoNormalTable\" xss=removed border=\"1\" width=\"1099\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr xss=removed>\r\n<td xss=removed valign=\"top\">\r\n<p class=\"MsoNormal\"><span xss=removed>27-08-2018 10:39 AM</span></p>\r\n</td>\r\n<td xss=removed valign=\"top\">\r\n<p class=\"MsoNormal\"><strong xss=removed><span xss=removed>Query By </span></strong><span xss=removed>: Lower Division Assistant - REGISTRAR OF FIRMS & SOCIETIES<br xss=removed> <strong xss=removed>Subject</strong> : General Query<br xss=removed> <strong xss=removed>Query Message</strong> : Once the change has been done than reply for this \"Raise a ticket on the website easeofdoingbusinessinassam.in under \"HELP\" and request them to change date of establishment as per resolution in the application form.\"<br xss=removed> <strong xss=removed>Document Uploaded(if any)</strong> : <a xss=removed href=\"https://easeofdoingbusinessinassam.in/admin_locker/rfs/query_documents/15894944115b8387847c744.\" target=\"_blank\" rel=\"noopener noreferrer\"><span xss=removed> Download</span></a>)</span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p class=\"MsoNormal\"><span xss=removed> </span></p>\r\n<p class=\"MsoNormal\">I request to make correction of the date <span xss=removed>change date of establishment as per resolution </span>from 28-07-2018 TO<span xss=removed>  </span>27-12-2017 in my common application form and <span xss=removed>1) Object of the society has to be as per name of the society proposed for.</span></p>\r\n<p class=\"MsoListParagraphCxSpFirst\" xss=removed>&lt;!-- [if !supportLists]--&gt;<span xss=removed><span xss=removed>1.<span xss=removed>       </span></span></span>&lt;!--[endif]--&gt;<span xss=removed>The basic object of the Samiti has always been to revive the prestige of the art of music comprising vocal music, instrumental music, dance and to organize systematic training in this art in India and also in foreign countries, besides reaching it to people at large</span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" xss=removed>&lt;!-- [if !supportLists]--&gt;<span xss=removed><span xss=removed>2.<span xss=removed>       </span></span></span>&lt;!--[endif]--&gt;<span xss=removed><span xss=removed> </span>given to the teaching of the art of music by various government institutions and universities, goes to this Samiti. </span></p>\r\n<p class=\"MsoListParagraphCxSpLast\" xss=removed>&lt;!-- [if !supportLists]--&gt;<span xss=removed><span xss=removed>3.<span xss=removed>       </span></span></span>&lt;!--[endif]--&gt;<span xss=removed>The Samiti has played an important role in the all-round revival and popularity of Indian Classical music by organizing music competitions and conferences on All India Basis annually, in an effort to revive taste and devotion towards the art of music amongst the people and thus , popularizing this great art.</span></p>\r\n<p class=\"MsoNormal\"><span xss=removed> </span></p>\r\n<p class=\"MsoNormal\"> </p>', NULL, '', 1, 6, '', 5),
