(515, '5B87992BDFE68', '2018-08-30 07:13:47', 'pgoyal275@gmail.com', 9864077408, 'FIRE/F10/KU/000001/02/2017', 'Parveen Goyal', '', 2, '<p>We have applied for renewal of our Fire License on 26th July 2018. However, the UAIN <span xss=removed>FIRE/F10/KU/000001/02/2017 </span>given is the orginal Fire Certificate No. There is no application showing in application tracking with this UAIN.</p>\r\n<p> </p>\r\n<p>Kindly advise how to apply for renewal.</p>\r\n<p> </p>\r\n<p>Thanks</p>\r\n<p>Parveen</p>', '1ae6d8833d0dc557db6d41052dce5d6e39519a9f.pdf', '', 1, 5, '', 5),
(516, '5B87AB984A186', '2018-08-30 08:32:24', 'back2guwdhiraj@gmail.com', 9706842256, 'AA19452/ARNPB2491G/08/2018', 'DHIRAJ PRATIM BARUAH', '', 2, '<p>Hello sir/mam</p>\r\n<p>On 27th of august 2018, i have submitted the final submission of the application for registration of societies but today a query came from the facilitator to raise a ticket for mentioning all the executive members name,so i am submitting the same as directed..</p>\r\n<p>1. DHIRAJ PRATIM BARUAH (PRESIDENT)</p>\r\n<p>2. DIGANTA KALITA (SECRETARY)</p>\r\n<p>3. SIMPI BARUAH (TREASURER)</p>\r\n<p>4. SANJIB KALITA (MEMBER)</p>\r\n<p>5. MANASH PRATIM BARUAH (MEMBER)</p>\r\n<p>6. PRANAB BEZBARUAH (MEMBER)</p>\r\n<p>7. KARISHMA PHUKAN (MEMBER)</p>\r\n<p> </p>\r\n<p>     These are the seven executive member of our society \"BHUMIPUTRO\", </p>\r\n<p>I kindly request you to upload the above for which i will be very grateful to you</p>\r\n<p>yours faithfully</p>\r\n<p>DHIRAJ PRATIM BARUAH</p>\r\n<p> </p>', NULL, '', 1, 6, '', 5),
(517, '5B87AF384C2A7', '2018-08-30 08:47:52', 'deepdutta500@gmail.com', 8638661562, 'RFS/F15/KM/001335/08/2018', 'ALL ASSAM VILLAGE HEADMAN ASSOCIATION', '', 2, '<p>WE HAVE BEEN UPLOAD FILE NAME WAS \"ALL ASSAM VILLAGE HEADMAN ASSOCIATION\", NAMLY ASSAMESE MEANING IS \"SADOU ASOM GAONBURAH SANGSTHA\"</p>\r\n<p>    SO WE REQUEST THAT TNE ASSAMESE MEANING NAMELY \"SADOU ASOM GAONBURAH SANGSTHA\" CAME IN OUR CERTIFICATE.</p>\r\n<p>          AND WE HAVE CHANGE OUR ADDRESS ALL ASSAM VILLAGE HEADMAN ASSOCIATION TO SADOU ASOM GAONBURAH SANGSTHA BHABAN, JABAHOR NAGAR</p>\r\n<p>                                                  YOUR FAITH FULLY.......</p>', NULL, '', 3, 45, '', 5),
(518, '5B87BA83380FE', '2018-08-30 09:36:03', 'littleangels945@gmail.com', 7002608600, 'RFS/F15/JO/001348/08/2018', 'ROSHMI HANDIQUE', '', 2, '<p>Dear Sir/Madam,</p>\r\n<p>With reference to your email dated on 29th Aug 2018, I would like to request to change the date of establishment and the date of General meeting as per resolution copy i.e. 15/08/2018 of our society.</p>\r\n<p>Please find the attached copy of resolution for your kind perusal and doing the needful.</p>\r\n<p> </p>\r\n<p>Thanks & Regards,</p>\r\n<p>Roshmi Handique</p>', 'fd77f240afad95fd70f7aabd363d2676309d69c4.pdf', '', 2, 6, '', 5),
