(521, '5B87D658D9166', '2018-08-30 11:34:48', 'drugscontrol.assam@gmail.com', 9401981967, 'SDC/F1/GP/000807/07/2018', 'M/s JULFIKAR DRUG DISTRIBUTOR', '', 6, '<p>Dear Sir</p>\r\n<p><span xss=removed>I am to inform you that due to over sight  the licenced was  issued wrongly against the UNI No. </span><span xss=removed> </span><a xss=removed href=\"https://easeofdoingbusinessinassam.in/admin_new/only_applications_view.php?token=NDUxJjI=\" target=\"_blank\" rel=\"noopener noreferrer\" type=\"button\" data-saferedirecturl=\"https://www.google.com/url?q=https://easeofdoingbusinessinassam.in/admin_new/only_applications_view.php?token=NDUxJjI=&source=gmail&ust=1535715104572000&usg=AFQjCNHTJvELiAk2g1PXOrg4jlj5AjwQ2A\"> </a><span xss=removed><span xss=removed>SDC/F1/GP/000807/07/2018</span></span><span xss=removed><span xss=removed>. Therefore please kindly cancel the previous drug licence no and allow  me to reissue the said Drug licence again with proper licence no. </span></span></p>\r\n<p><span xss=removed><span xss=removed>With Regards</span></span></p>\r\n<p><span xss=removed><span xss=removed>Deba Kr. Das</span></span></p>\r\n<p><span xss=removed><span xss=removed>Licensing Authority, Assam</span></span></p>', NULL, '', 1, 6, '', 5),
