(596, '5B92E07A89482', '2018-09-07 20:32:58', 'ananta.baishya@gmail.com', 9864057753, 'AA02681/AAJFB0875B/06/2017', 'BAJU ASSOCIATES', '', 7, '<p class=\"MsoNormal\">Dear Sir / Madam</p>\r\n<p class=\"MsoNormal\">I Sri Ananta Baishya a partner of Baju Associates, I tried to register our firm online at Registrar of Firm and Society site for CIF, but unfortunately I committed some mistake to filling the online form, now I unable to edit those mistake, I am facing some problem to fill up the form those are like….</p>\r\n<p class=\"MsoNormal\">At the very beginning we are two partners 1. Jayanta Baishya and me 2. Ananta Baishya started a printing business in the name of Baju Associates in 2008, at Simon House, Nepalimandir, Paltanbazar, Guwahati-08 and made a partnership deed registered at dc court. In the year 2011 we changed our business location from Simon House to Priyonath Sarma Bhaban, H.P.B. Road, Paltanbazar, Guwahati 781008. In the year 2014 we added two more partner in our firm they are 1. Kabita Baishya (w/o. Jayanta Baishya) 2. Jahnabi Baishya (w/o. Ananta Baishya) through Notary agreement. In the year 2017 we establish our workshop (printing press) at Milan Nagar, Bye Lane4, Lalganesh, Guwahati-781034 , this is our own premises (Patta land in the name of Jayanta Baishya and Ananta Baishya).</p>\r\n<p class=\"MsoNormal\">Presently</p>\r\n<p class=\"MsoListParagraphCxSpFirst\" xss=removed>&lt;!-- [if !supportLists]--&gt;<span xss=removed><span xss=removed>(1)<span xss=removed>    </span></span></span>&lt;!--[endif]--&gt;Our office address is: Priyonath Sarma Bhaban, H.P.B. Road, Paltanbazar, Guwahati 781008</p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" xss=removed>&lt;!-- [if !supportLists]--&gt;<span xss=removed><span xss=removed>(2)<span xss=removed>    </span></span></span>&lt;!--[endif]--&gt;Workshop (Press): Milan Nagar, Bye Lane4, Lalganesh, Guwahati-781034</p>\r\n<p class=\"MsoListParagraphCxSpLast\" xss=removed>&lt;!-- [if !supportLists]--&gt;<span xss=removed><span xss=removed>(3)<span xss=removed>    </span></span></span>&lt;!--[endif]--&gt;Partner: 4 Partners</p>\r\n<p class=\"MsoNormal\">Those three points are not mention in our registered partnership deed.</p>\r\n<p class=\"MsoNormal\">There for I request you advice me how can I register our firm online or offline at Registrar of Firm and Society site for CIF.</p>\r\n<p class=\"MsoNormal\"> </p>\r\n<p class=\"MsoNormal\">Thanks and regards</p>\r\n<p class=\"MsoNormal\">Ananta Baishya</p>\r\n<p class=\"MsoNormal\">Baju Associates</p>\r\n<p class=\"MsoNormal\">Ph-9864057753, 7002613945</p>\r\n<p class=\"MsoNormal\"><span xss=removed> </span></p>\r\n<p class=\"MsoNormal\"> </p>\r\n<p class=\"MsoNormal\"> </p>', NULL, '', 3, 45, '', 5),
