(609, '5B98D7ADD29E4', '2018-09-12 09:09:01', 'rhisavdeb@britindia.com', 7895022890, 'PCB/F33/KU/000034/03/2018', 'Rhisav Deb', '', 7, '<p>Dear Sir/ Madam,</p>\r\n<p>We have applied for the UAIN No: PCB/F33/KU/000034/03/2018. In the eodb website it is showing \"The application has been submitted successfully on 17-04-2018. However the courier did not reach the concerned department.\"</p>\r\n<p>I have attached the application, you can see the Courier Details as \"Self Handover\". I have been asked by the PCB concerned official that I have to upload the documents again in the eodb website under incomplete applications sections as offline submission are not accepted. The application PCB/F33/KU/000034/03/2018 is not listed in the \"incomplete section\". Kindly help regarding the issue for necessary closure.</p>\r\n<p> </p>\r\n<p>With Warm Regards,</p>\r\n<p>Rhisav Deb</p>\r\n<p>EHS Officer,</p>\r\n<p>Britannia Industries Limited, Rampur,</p>\r\n<p>Guwahati</p>', '10471e44cdcb5ec9c5415e9eb892ce45aedb2eb9.pdf', '', 3, 45, '', 5),
