(619, '5B9B4DA2A5004', '2018-09-14 05:56:50', 'goswamiengineering2000@gmail.com', 7637934413, ' UBIN : AA04840/AAKFG2091B/10/2017 , UAIN : RFS/F1/ST/000554/08/2018', 'Mr. Diganta Goswami', '', 6, '<p>Dear Sir,</p>\r\n<p>We have applied for firm registration with UAIN No.RFS/F1/ST/000554/08/2018. <span xss=removed>Date of establishment and date of joining of partners mention in the common application</span><span xss=removed> has to be changed from 23/08/2018 to 001/01/2014.</span></p>\r\n<p><span xss=removed>we are attaching the application form for consideration.</span></p>\r\n<p><span xss=removed>Thank you.</span></p>', '4412c5f9f01917717766e265b21d20e80b56fef0.pdf', '', 3, 45, '', 5),
