(629, '5B9BA3523A795', '2018-09-14 12:02:26', 'neads_jorhat@yahoo.co.in', 9957852794, 'RFS/F13/JO/000480/08/2018 ', 'North-East Affected Area Development Society (NEADS) ', '', 7, '<p>Dear Sir / Ma\'am, </p>\r\n<p>Greetings..! </p>\r\n<p>We would like to clarify though this mail that we have received a report earlier which was drafted by the Mondol of our respective organisational area. But later on based on the Mondol report, the Circle Officer had issued a certification letter in favour of us. While issuing the letter to us, Circle Officer had kept the report with him, which was shared by the Mondol. Hence, we donot have the same report being prepared by the Mondol in the earlier process and also wonot be able to submit the report to you at this instance. This is also for your information that the entire processes are being undertaken under the direction of Deputy Commissioner of Jorhat. Kindly find attached few documents of our official communication for your information and needful action. </p>\r\n<p>Looking forward for your response and support. </p>\r\n<p>Thanking you in anticipation. </p>\r\n<p>With regards,</p>\r\n<p>Tirtha Prasad Saikia </p>\r\n<p> </p>\r\n<p>  </p>\r\n<p> </p>\r\n<p> </p>\r\n<p> </p>\r\n<p> </p>', '7c4e49b19c8939917b25bd68b97936a1e373e99e.pdf', '', 3, 45, '13', 5),
