(666, '5BA3ADC45DBF0', '2018-09-20 14:25:08', 'mandalp49@gmail.com', 8638048613, 'SDC/F1/KM/000986/09/2018', 'PRASENJIT MANDAL, SANGITA ROY MANDAL', '', 6, '<p>WE HAVE APPLIED FOR WHOLE SALE DRUG LICENSE IN PARTNERSHIP, BUT IN ISSUED LICENSE ONLY AUTHORISED PERSON  PRASENJIT MANDAL NAME  WAS MENTIONED OTHER PARTNER SANGITA ROY MANDAL IS MISSING FROM THE ISSUED LICENSE, WE REQUEST TO ENTER THE BOTH PARTNERS. DO THE NEEDFUL</p>', 'd8ebed71c4ec2f2bdd7a97798d6f74ff578c4bd2.pdf', '', 1, 6, '', 5),
