(669, '5BA4CD4BC7D19', '2018-09-21 10:51:55', 'avinash.chauhan@sunpharma.com', 9915032172, 'AA00939/AACCS6163P/03/2017/ LEDB/F2/KU/000149/07/2018', 'sun pharma lab ltd', '', 3, '<p class=\"MsoNoSpacing\"><span lang=\"EN-IN\" xss=removed>Dear Team</span></p>\r\n<p class=\"MsoNoSpacing\"><span lang=\"EN-IN\" xss=removed>With reference to subject cited above we do honour to state that we M/s Sun Pharma Laboratories Limited –Mirza Palashbari Road-Dist.-Kamrup has submitted on line application for inspection of Boilers on dated 06/07/2018 but during online payment of the Challan, error observed & transaction was not executed but inspection fee of Rs-3411.8 was deducted from my account as per following detail.</span></p>\r\n<p class=\"MsoNoSpacing\"> </p>\r\n<p class=\"MsoNoSpacing\"><span lang=\"EN-IN\" xss=removed>Further approval of Additional Chief Inspector of Boilers Mr. A.K.Sarmah has also provided for refund of additional amount & all the details were submitted in EOD Portal wide Ticket no. 5B6BF5B7E86E7 on 9<sup>th</sup> August but still there is no action.</span></p>\r\n<p class=\"MsoNoSpacing\"><span lang=\"EN-IN\" xss=removed>Copy of application with all the details are attached .</span></p>\r\n<p>Thanks //Rgds</p>', '9929938b20e1240ab337e1c178eb4c167387870b.pdf', '', 0, 47, '', 5),
(670, '5BA53D13CEC3E', '2018-09-21 18:48:51', 'bi7338125@gmail.com', 9954816849, 'SDC/F2/KM/000806/09/2018', 'BAHARUL ISLAM', '', 7, '<p>A QUERY WAS GIVEN BY THE INSPECTOR OF DRUGS KAMRUP METRO ON 20/09/2018 BUT WRONG REPLLY THE WAS GIVEN ON 21/09/2018 . THE ANOTHER DOCUMENT WAS UPLOADED IN THE PLACE OF QUERY INSTEAD OF THE AFFIDAVIT OF APPLICANT. PLZ GIVE ME CHANCE TO REUPLOAD THE AFFIDAVIT OF APPLICANT.</p>', 'f7f07a1031b6671a9f255760e13090ce96f7b3aa.pdf', '', 3, 45, '17', 5),
(671, '5BA54514302D1', '2018-09-21 19:23:00', 'buragohainp724@gmail.com', 9864030796, 'SDC/F2/KM/000824/09/2018', 'PRASANTA BURAGOHAIN', '', 7, '<p>I HAVE WRONGLY ENTERED THE PLACE OF PHARMACY AS GHORAMARI CHARIALI INSTEAD OF GHORAMARA CHARIALI, SO KINDLY MAKE CORRECT THE SAME</p>', '69228f46f1f65a07a950b6fe3d26bdc61f0f5b49.pdf', '', 1, 6, '', 5),
