(683, '5BA8822610CF8', '2018-09-24 06:20:22', 'tbipvtltd123@yahoo.in', 9864227736, 'DOA/F26/KM/000045/09/2018, dated 21.09.2018', 'TECH BUSINESS INDIA PVT LTD', '', 2, '<p>Dear Sir/Madam</p>\r\n<p>Kindly note that we have applied for Fertilizer licence renewal vide UAIN no DOA/F26/KM/000045/09/2018, dated 21.09.2018</p>\r\n<p>There are two option to apply, ie  Head Office, Street 1, PO Kamrup (M), 781029 & District Agriculture office, Kamrup Kamrup(M) pin 781003.</p>\r\n<p>We have applied the said renewal licence at Head Office, Street 1 Po Kamrup 781029 instead of District Agriculture office, Kamrup Kamrup(M) pin 781003.</p>\r\n<p>We have contacted the matter with the concerned department of Agriculture , Assam and they informed us that for this particular renewal licence we need to apply at District Agriculture office, Kamrup Kamrup(M) pin 781003.</p>\r\n<p>So we requested to cancel our previous application no DOA/F26/KM/000045/09/2018, dated 21.09.2018, and allow us to apply afresh at District Agriculture office, Kamrup Kamrup(M) pin 781003.</p>\r\n<p> </p>\r\n<p>Thanking you</p>\r\n<p>Tech business India Pvt Ltd</p>\r\n<p>VIP Road, Six Mile, Guwahati-781022</p>\r\n<p>9864227736</p>\r\n<p>Enclosed : Licence acknowledge letter</p>\r\n<p> </p>\r\n<p> </p>', '05235fa729d2f5c18e447fb5c020f2c5c8d1d62a.pdf', '', 3, 45, '', 5),
(684, '5BA88998B6857', '2018-09-24 06:52:08', 'autorex2002@gmail.com', 9854757377, 'SDC/F1/BO/001019/09/2018', 'amaresh saha', '', 2, '<p>Sir, I have apply for a drug licence in the name of M/S LIFE CARE DRUG DISTRIBUTOR but sir unfortunately it is mistakely typing in the name of LILFE CARE DRUG DISTRIBUTOR so, Sir Please Correct the name in LIFE CARE DRUG DISTRIBUTOR instead of LILFE CARE DRUG DISTRIBUTOR and obliged me</p>', NULL, '', 3, 45, '', 5),
(685, '5BA8962172499', '2018-09-24 07:45:37', 'tbipvtltd123@yahoo.in', 9864227736, 'DOA/F26/KM/000045/09/2018', 'TECH BUSINESS INDIA PVT LTD', '', 2, '<p>Dear Sir /Madam</p>\r\n<p> </p>\r\n<p>With reference to our Ticket No 5BA8822610CF8, we have contacted and requested to Deptt of Agricultuer to forward the application to DAO office. They insists us to apply afresh of the same. kindly help to cancel our previos application and allow us to reapply.</p>', NULL, '', 1, 5, '', 5),
(686, '5BA8AC3336C6D', '2018-09-24 09:19:47', 'surajbk22@gmail.com', 8721045185, 'FIRE/F10/KU/000080/07/2018', 'OINTMENT & EYEDROP PRODUCTION AREA (A UNIT OF AJANTA PHARMA LIMITED)', '', 7, '<p>Please rectify the floor area in the issued certificate against the UAIN no.FIRE/F10/KU/000080/07/2018 of  OINTMENT & EYEDROP PRODUCTION AREA (A UNIT OF AJANTA PHARMA LIMITED) as below (data mistakenly input and remained):</p>\r\n<p>Ground Floor : 5073.40 sq mtr,   5542.28 sq mtr.</p>\r\n<p>First Floor     :  5073.40 sq mtr,   5542.28 sq mtr.</p>\r\n<p>Kindly fix it. </p>\r\n<p>Regards,</p>\r\n<p>Computer Operator, HQ, F&ES Assam. </p>', NULL, '', 1, 6, '', 5),
(687, '5BA8B3E61D871', '2018-09-24 09:52:38', 'parthakashyap28@gmail.com', 8822670707, 'PCB/F50/ST/004822/09/2018', 'GURU CHARAN DAS', '', 6, '<p>Sir/Madam, I want some changes in my application as directed by my Regional office,Tezpur.</p>\r\n<p>The changes are as per application number follows-</p>\r\n<p>2(a)street Name 1-  COLLEGE ROAD</p>\r\n<p>      Village/Town  - KETELA PATHAR</p>\r\n<p>      District  -        Biswanath</p>\r\n<p>      Pincode     -      784166</p>\r\n<p>27(A) Details of stack (process & fuel stacks)</p>\r\n<p>    Capacity - 900000.00</p>\r\n<p>Fuel quantity(TPD/KLD)-  1.50</p>\r\n<p>Material of construction- BRICK</p>\r\n<p>Height,m(above ground level) - 30.00</p>\r\n<p>Diameter/ size, in meters - 2.5</p>\r\n<p> </p>\r\n<p>I request you to change the required as I mentioned above. To understand better I have also uploaded an example copy of my application. Thanking you in anticipation.</p>\r\n<p> </p>', '021d3bc91911028263afed3ee39c28953c73d49f.jpg', '', 1, 6, '', 5),
