(730, '5BACE6D167848', '2018-09-27 14:18:57', 'rahmaniahomoeohall1995@gmail.com', 9957073676, 'UBIN : AA23236/BVGPM4895R/09/2018', 'Jakaria Mollah', '', 2, '<p>Respected Sir/Madam,</p>\r\n<p>As instructed by the Sr. Inspector of Drugs,Dhubri the name of my Enterprise M/s. Rahmania Homoeo Hall is not proper being a wholesale enterprise. Hence, the name of Enterprise should be M/s. Rahmania Homoeo Enterprise, instead of M/s. Rahmania Homoeo Hall, and the address will be the same as in the CAF. Therefore, I request you kindly to correct the name of enterprise in the CAF as directed by the Sr. Inspector of Drugs, Dhubri :-  M/s. Rahmania Homoeo Enterprise instead of M/s. Rahmania Homoeo Hall and the address should be the same.</p>', NULL, '', 3, 45, '', 5),
