(737, '5BADF9D79FCA4', '2018-09-28 09:52:23', 'vikasne2018@gmail.com', 8169588200, 'RFS/F15/KM/001323/09/2018', 'DR. CHANDAN DAS', '', 7, '<p>Dear Sir/Ma\'am,</p>\r\n<p>We applied for registering a society named as \"VIKAS foundation\". However, the registration was rejected due to the existence of a similarly named society already.</p>\r\n<p>The answer from the registrar is as follows, </p>\r\n<p>\"<span xss=removed>Any other reason (Please specify), The society with the similar name or identical name is already registered vide registration no- RS/KAM/240/A-3/531 of 2006 name as VIKASH WELFARE SOCIETY</span></p>\r\n<p><span xss=removed>Reference of our application, UAIN: </span><strong xss=removed>RFS/F15/KM/001323/09/2018</strong></p>\r\n<p>We, the members have decided to rename the society as \"REHOPE Foundation\".</p>\r\n<p>Kindly let us know the procedure to follow up or whichever is necessary.</p>\r\n<p>Thank You.</p>\r\n<p> </p>\r\n<p>Sincerely,</p>\r\n<p>Dr. Chandan Das</p>', NULL, '', 3, 45, '', 5),
(738, '5BAE06A1B8DED', '2018-09-28 10:46:57', 'erceyecare@gmail.com', 9854073253, 'SDC/F1/SV/00108/09/2018', 'Sanku Sharma', '', 2, '<p>Dear Sir/Madam,</p>\r\n<p>We were trying to apply for a new wholesale unit in Guwahati under State Drugs Control Department. However, as we did not add the location of new address first, it inadvertently got applied to Sivasagar. The actual place of business is</p>\r\n<p><strong>House No 1,Magzine Tiniali,Purbanchal By Lane No 1,VIP Road Ghy-781036</strong>.</p>\r\n<p>Kindly change the application address from Drugs Control Office, Sivsagar (as shown in acknowledgement) to Guwahati, State Drugs Control Office, as the new application is under their jurisdiction.</p>\r\n<p>UAIN is SDC/F1/SV/00108/09/2018</p>\r\n<p>I can be reached at 98540 73253/98540 15062 for any clarification.</p>\r\n<p>Regards,</p>\r\n<p>Sanku Sharma</p>', NULL, '', 1, 5, '', 5),
