(753, '5BB1E0214E3DC', '2018-10-01 08:51:45', 'degstsk@gmail.com', 8486936987, 'AA19696/AAALD1349M/08/2018', 'District e Governance Society Tinsukia', '', 6, '<p>We have applied for renewal of District e Governance Society , Tinsukia on 27/08/2018. After verification and processing , the society has been renewed and certificate has been downloaded. Everything is correct in the certificate  apart from date in the certificate ehich  is wrongly showing as <strong>1st day of January, One Thousand Nine Hundred Seventy </strong>..</p>\r\n<p>Kindly do the necessary correction of the same in the certificate. Screenshot is attached for your kind reference.</p>', '269f2f4a9132a598f26d5204d1baa0206585c32a.png', '', 1, 6, '', 5),
