(758, '5BB239568F8A7', '2018-10-01 15:12:22', 'zenith.nj@gmail.com', 7002315067, 'AA22191/AAAAJ4016A/09/2018', 'DEWKI NANDAN AGARWALLA', '', 3, '<p>Sir,</p>\r\n<p>when I asked about the address to courier the required documents, the executive in the  eodb helpline told me to send it to the Address given in the Contact Us Link of EODB page. and I did what I was told. I send the courier to the given address which was given in your site. </p>\r\n<p> </p>\r\n<p>To</p>\r\n<p>Chief Executive Officer</p>\r\n<p>Single window Agency</p>\r\n<p>Dept of Industries & Commerce</p>\r\n<p>Udyog Bhavan, M.R.D. Road, Bamuni Maidam, Guwahati-781021.</p>\r\n<p> </p>\r\n<p>Sir, though my courier is delivered, but the status of my application shows that the \"courier not received\"</p>\r\n<p> </p>\r\n<p>Sir, if the given address is wrong, then what shall I do???? Do I need to send the Courier in the new address?? where shall I enter the Consignment number?? Please Help.</p>\r\n<p>I am attaching the scanned copy of the DTDC  consignment slip.</p>\r\n<p> </p>\r\n<p>Thankyou.</p>\r\n<p> </p>', '27c2a202edac1ecee8f9f16286c38ee4e7f854fe.pdf', '', 1, 5, '', 5),
(759, '5BB367101023D', '2018-10-02 12:39:44', '12stepfoundationassam@gmail.com', 8011557553, 'RFS/F15/KM/001404/09/2018', 'TWELVE STEP FOUNDATION', '', 7, '<p>Respected EODB Team, Need to correct our Acknowlegement reciept, we visited  rfs beltola office as per   Miss Nirmala kundu, in acknowlegement reciept copy only name address & designation of the prisident of this society is given but by it is desired by the norms of the society that all the existing executive members details too are needed. In this regard you are requested to provive the details of all the eight members of Twelve Step Foundation in acknowledgement receipt copy. </p>', NULL, '', 1, 5, '', 5);
