(772, '5BB4CF8B4B549', '2018-10-03 14:17:47', 'ruralupliftmentsociety@gmail.com', 9435081467, 'RFS/F15/DU/001626/09/2018', 'Dewan Atikur Reza', '', 2, '<p>Dear Sir/ MAdam</p>\r\n<p>In the CAF, <strong>The specimen signatures of all the executive members have been witness by</strong> is missed at the time of submission of CAF.</p>\r\n<p>Please edit the form and enter the Witness official as BLOCK DEVELOPMENT OFFICER, MAHAMAYA DEVELOPMENT BLOCK</p>\r\n<p>For reference find the attach file.</p>\r\n<p> </p>', 'e4400696cddac8ae9753384ee820848eb7cd8fe2.pdf', '', 0, 45, '', 5),
