(774, '5BB5D0793DD97', '2018-10-04 08:34:01', 'barua.bhaskar@gmail.com', 9864163061, 'AA23841/NPDBH23841/10/2018', 'Bhaskar Barua', '', 2, '<p>In our application for Registration Of Societies, kindly incorporate the following correction:</p>\r\n<p>Sl. No. 4, Address of the Society, the <strong>Circle is Ulubari</strong>, and<strong> not</strong> Mirza as mentioned.</p>\r\n<p>Kindly do the necessary corrections.</p>\r\n<p>Regards.</p>', NULL, '', 3, 45, '', 5),
