(776, '5BB5E7292CF46', '2018-10-04 10:10:49', 'dhansristeels.tsk@gmail.com', 9435035342, 'AA05991/AAACD7292E/11/2017', 'SANWAR GOEL', '', 2, '<p><span xss=removed>DEAR SIR/MADAM,</span></p>\r\n<p xss=removed><span xss=removed>ONE OF OUR DIRECTOR NAMELY SRI KAILASH PD. MODI HAS RESIGNED THE POST ON 30/03/2018. (RESIGNATION DIR-11 FORM OF COMPANY ATTACHED)</span></p>\r\n<p xss=removed><span xss=removed>WE HAVE ALSO INTRODUCED TWO NEW PERSON FOR THE POST OF DIRECTOR:</span></p>\r\n<p xss=removed><span xss=removed>I REQUEST YOU TO KINDLY UPDATE THE FOLLOWING:</span></p>\r\n<p xss=removed><span xss=removed>CURRENT DIRECTOR OF M/S DHANSRI STEELS PVT LTD AS ON 30/09/2018:</span></p>\r\n<p xss=removed><span xss=removed>1) SANWAR GOEL (DIN NO: 00549398), MAKUM ROAD, TINSUKIA, PIN-  786125 PH: 9435035264</span></p>\r\n<p xss=removed><span xss=removed>2) KUNAL GOEL (DIN NO: </span><span xss=removed>08067713), MAKUM ROAD, TINSUKIA, PIN-  786125 PH: 9435035342</span></p>\r\n<p xss=removed><span xss=removed>3) ADIT GOEL (DIN NO: 08067697), MAKUM ROAD, TINSUKIA, PIN-  786125 PH: 9435035692</span></p>\r\n<p xss=removed><span xss=removed>ALSO UPDATE MOBILE NO. OF COMPANY AS 9435035342.</span></p>\r\n<p>THANKS & REGARDS</p>\r\n<p>FOR DHANSRI STEELS PVT LTD</p>\r\n<p>TINSUKIA</p>', 'a8c1155f582222133417d86c36378020e9f1ffc8.pdf', '', 3, 45, '', 5),
(777, '5BB5F64D2F693', '2018-10-04 11:15:25', 'educareacademy27@rediffmail.com', 9707662861, 'RFS/F1/KM/000671/09/2018', 'EDUCARE', '', 2, '<p>In the application for registration of partnership firms under partnernership act, in the point no. 2 i.e. nature of business, we only mentioned about coaching institute. Whereas the nature of business should include - all type of business of private sector/unauthorised sector Govt./Govt. Undertaking sector like coaching institute, computer education centre, pharmaceutical, Industrty/Udyog, transport, food and civil supply, handloom, labour and employment, power, water, agriculture, food processing,home security service, sports and fitness, holidays & travels,plastics and foods, garments, energy, electrical, holding sale, marketing, retail, trading, manufacturing agency,  education, school, driving centre, consultancy, construction, corporation, health & medical, tourism, forest, civil and mechanical construction, non-government project,advertisement, etc. So Sir, can you kindly correct pt. no. 2 of the application or can we get a chance to correct it.</p>\r\n<p>please find the partnership deed attached herewith.</p>\r\n<p>                                                                                              </p>\r\n<p>                                                                                                                                From, Durlav Talukdar (partner)</p>\r\n<p>                                                                                                                                         Educare</p>\r\n<p>                                                                                                                                         ph: 9707662861/ 9508267168</p>\r\n<p>                                                                                                                                         mail: durlavtalukdar28@gmail.com</p>', '4b96521388338b8258e377300bfa9ccd732e6