(844, '5BC74EB88C4C6', '2018-10-17 15:01:12', 'zulfee20042005@yahoo.co.in', 8011796607, 'PCB/F44/DI/000070/03/2018', 'JALELUR RAHMAN', '', 6, '<p>Sir,</p>\r\n<p>with reference to the above File No, and the prevoius <span xss=removed>Ticket (#5BC2006E27935), with your advise to contact the office directly, I want to sate that I am from Dibugarh, and I don\'t ahve the acess to thier office direclty via E mail or by phone. Please help to get the certificate.</span></p>\r\n<p><span xss=removed>Regards Dr Rahman</span></p>', NULL, '', 3, 45, '', 5),
(845, '5BC82D0A7D416', '2018-10-18 06:49:46', 'sashankasaha@gmail.com', 9435986980, 'AA11402/AAAAB0707G/05/2018', 'BIBLES INTERNATIONAL INDIA SOCIETY', '', 2, '<p>Dear Sir/Madam,</p>\r\n<p>This is our humble request to you to update in Common Application Form (CAF) as given below:</p>\r\n<p>1. Please, <strong><span xss=removed>COMPLETELY REMOVE</span> the address in Serial no. 5 (b) in CAF,</strong> as any of our office unit is no more there except registered office. (In case it is not at all possible to remove completely then change the Revenue Circle to SILCHAR (not Barkhola)</p>\r\n<p>2. For the Registered Office Address in Serial no. 6 in CAF, Revenue Circle : LAKHIPUR and Subdivision: LAKHIPUR can be input, if necessary.</p>\r\n<p>3. In serial no. 8 (b) in CAF, Designation of the Applicant: OFFICE & FINANCIAL MANAGER/ACCOUNTANT</p>\r\n<p>4. Type of Area: RURAL (Serial no. 12 in CAF)</p>\r\n<p>5. Status of Land/Building/Premises: OWNED (Serial no. 13 in CAF)</p>\r\n<p>6. Serial no.14 (b) in CAF, Dag No: 72</p>\r\n<p>7. Serial no. 14 (c) in CAF, Patta No. 33</p>\r\n<p>8. Serial no. 14 (d) in CAF, Mouza: Lalangkitta Labocpar Part 1</p>\r\n<p> </p>\r\n<p>Sashanka Ranjan Saha</p>\r\n<p>For Bibles International India Society</p>\r\n<p>18 October 2018</p>', NULL, '', 3, 45, '', 5),
(846, '5BCAF6B5CCC20', '2018-10-20 09:34:45', 'lotus.kbt@gmail.com', 9401595274, 'RFS/F1/KM/000445/08/2018', 'SHRISTI K MERCANTILE', '', 2, '<p>Dear Sir / Madam</p>\r\n<p> </p>\r\n<p>We have applied for Firm Registration of our firm M/s Shristi K Mercantile and they have raised a query to mention the nature of business as per Partnership Deed in the Application Form.</p>', NULL, '', 3, 45, '', 5),
(847, '5BCB2B269AC6B', '2018-10-20 13:18:30', 'klb@klgrroup.com', 9085060991, 'RFS/F1/KM/000638/09/2018', 'KL Beverages', '', 6, '<p>Sir,</p>\r\n<p xss=removed>We beg to inform you that we have wrongly filled up the Date of Establishment of the firm, <strong>M/s KL Beverages</strong> in the CAF as <strong>22.04.2019</strong> which should be <strong>21.06.2018</strong>. We have received the CERTIFIED COPY OF REGISTRATION OF FIRM, M/s KL BEVERAGES from your esteemed office on 20.10.2018 with the establishement date as 22.04.2019.</p>\r\n<p>You are requested to correct the Date of Establishment as 21.06.2018.</p>\r\n<p>Your kind action in this regard will be highly solicited.</p>\r\n<p>Regards & Thanks</p>\r\n<p>D. Sarmah</p>\r\n<p>For, M/s KL Beverages</p>', NULL, '', 3, 45, '', 5),
(848, '5BCC6A9D4AF84', '2018-10-21 12:01:33', 'runarafique@gmail.com', 9435543787, 'RFS/F1/KM/000712/09/2018 ', 'runa rafique', '', 7, '<p>I am waiting for the Certificate of Registration since my bank needs the certificate in order to open the bank account. Kindly let me know the likely date by which the certificate will be issued to me.</p>\r\n<p>I would like to add that I need the Cenrtificate of Registration as early as possible since all the bank work is subject to the registration. </p>\r\n<p>I thank you and trust that you will respond without delay.</p>\r\n<p>thanks and regards.</p>', NULL, '', 3, 45, '', 5),
(849, '5BCCC10987380', '2018-10-21 18:10:17', 'ahmedjulfiquer1964@gmail.com', 8399898377, 'SDC/F2/KM/000889/10/2018', 'JULFIQUER AHMED', '', 7, '<p>MY NAME IS WRONGLY ENTERED AS MD JILFIQUER AHMED INSTEAD OF MD JULFIQUER AHMED. PLEASE MAKE CORRECT THE SAME.</p>', '32b6c7eb651e974813e43b521d63df8717a64396.pdf', '', 1, 6, '', 5),
