(852, '5BCD6E21640D0', '2018-10-22 06:28:49', 'surajbk22@gmail.com', 8721045185, 'UAIN : FIRE/F11/KJ/000511/04/2018', 'BIJNI DOOARS TEA COMPANY LTD. A/C KOKRAJHAR TEA ESTATE (A UNIT OF BIJNI DOOARS TEA COMPANY LTD.A/C.CHIKONMATI TEA ESTATE)', '', 7, '<p>As reported by Staion Officer Kokrajhar F&ES Station, the application of \'BIJNI DOOARS TEA COMPANY LTD. A/C KOKRAJHAR TEA ESTATE(A UNIT OF BIJNI DOOARS TEA COMPANY LTD.A/C.CHIKONMATI TEA ESTATE)\' was forwarded to Director Fire and Emergency Services Assam but unfortunately may due to technical issues the application was not forwarded and presently the application is missing from Kokrajhar ID as well as in Headquarter IDs.</p>\r\n<p>Kindly fix it. </p>', NULL, '', 1, 6, '', 5),
(853, '5BCD750F7D09B', '2018-10-22 06:58:23', 'surajbk22@gmail.com', 8721045185, 'FIRE/F11/JO/000070/04/2017', 'HOTEL MD\'S, MARWARI PATTY, JORHAT , JORHAT', '', 6, '<p>The Certificate was issued earlier vide no. <strong>FIRE/F11/JO/000070/04/2017</strong> dated<strong> </strong>21-11-2017 but they hadn\'t previously submitted any relevant documents about the exisiting fourth and Fifth floors.</p>\r\n<p>Further, Sr. S.O. Jorhat F&ESS has submitted the required reports relating to issue the NOC upto Fifth floor and details are as follows:</p>\r\n<p>Ground Floor - <strong>1125 Sq Mtr  </strong>Purpose of utilization- <strong>For Hotel</strong></p>\r\n<p>Basement Floor - <strong>1000 Sq Mtr  </strong>Purpose of utilization- <strong>For Parking</strong></p>\r\n<p>First Floor<strong> - 925 Sq Mtr  </strong>Purpose of utilization- <strong>For Hotel</strong></p>\r\n<p>Second Floor<strong> - 925 Sq Mtr  </strong>Purpose of utilization- <strong>For Hotel</strong></p>\r\n<p>Third Floor<strong> - 925 Sq Mtr  </strong>Purpose of utilization- <strong>For Hotel</strong></p>\r\n<p>Fourth Floor - <strong>925 Sq Mtr</strong>   Purpose of utilization- <strong>For Hotel</strong></p>\r\n<p>Fifth Floor - <strong>398.71 Sq Mtr</strong> Purpose of utilization - <strong>Staff room and Kitchen for food, sweets etc.</strong></p>\r\n<p> </p>\r\n<p> </p>\r\n<p>Kindly fix it asap.<strong> </strong></p>', NULL, '', 1, 6, '', 5),
