(855, '5BCDC167170E8', '2018-10-22 12:24:07', 'chemicalsnortheast@gmail.com', 9508675260, 'AA19332/AAPFN3146H/09/2018', 'NORTHEAST CHEMICALS', '', 2, '<p><span xss=removed>Dear Sir</span></p>\r\n<p><span xss=removed>Our partnership deed has been changed so the authorised signatory has also been changed so need to upload the new authorised person details</span></p>\r\n<p><span xss=removed>Name : Pankaj Kumar Baheti</span></p>\r\n<p><span xss=removed>Designation of the applicant: Partner</span></p>\r\n<p><span xss=removed>Address: Street 1     K K Baruah Road              Street2      J N Khound Path</span></p>\r\n<p><span xss=removed>             Town: Jorhat     District : Jorhat   State: Assam  PIN: 785001</span></p>\r\n<p><span xss=removed>             Mobile no: 9508675260  email id: chemicalsnortheast@gmail.com</span></p>\r\n<p><span xss=removed>Also please find the attachment of the new partnership deed. Other Files not able to upload as only one attachment is allowedpan card and aadhar card of pankaj kr baheti, power of attorney.</span></p>\r\n<p><span xss=removed>Also please updated the new names of the partners as mention as below:</span></p>\r\n<p> </p>\r\n<p><span xss=removed>Arbind Kr Singhania, Sunit Kediya,Pawan Mundhra,Sunit Kediya, Neha Baheti,Rajni Baheti, Rashmi Baheti, Saurabh Binani, Parashram Binani, Amit Kr<span class=\"apple-converted-space\"> </span>Malpani, Sumit Kr Malpani and Sarita Kundalia.</span></p>', 'cc685cb0b3b23234cc2e6b2588d2ee7971966111.pdf', '', 3, 45, '', 5),
