(857, '5BCF13DAEDB65', '2018-10-23 12:28:10', 'krishnadaslici@gmail.com', 9365476519, 'DOA/F21/NN/000004/06/2018', 'Krishna Das', '', 6, '<p>Sir, My Retail License for Pesticide sale is being issued/approved wongfully. All documents are submited against \"<strong>S.M. Fertilizer</strong>\". Our all commercial & Financial transaction are carried against the same. It will be very problematic if not rectified. It is mentioned as \"Granted to M/S: KRISHNA DAS\" which is not correct.</p>\r\n<p>It should be Granted as <strong>\"M/S: S.M.Fertilizer</strong>\"</p>', NULL, '', 1, 6, '', 5),
(858, '5BCF1CDE31992', '2018-10-23 13:06:38', 'krishnadaslici@gmail.com', 9365476519, 'DOA/F31/NN/000005/06/2018', 'Krishna Das', '', 6, '<p>Sir, Myself Proprietor of S.M. Fertilizer applied for ammendment of Whole sale Fertilizer License. Accordingly license is being approved, but source of Fertilizer Companies are not properly mentioned in the license which will not serve the purpose. Intended company may not supply Fertilizer to us if their <strong>name & products</strong> are not mentioned in the License. Crrection needed as follows -</p>\r\n<p>1. <strong>IPL</strong> ( Indian Potash Ltd) :- Urea, DAP,SSP,MOP, NPK, TSP</p>\r\n<p>2. <strong>IFFCO</strong> (Indian Farmers Fertilizer Co-Operative Society) :- Urea, DAP, NPK,WSF,SOP,Boron,Zink sulphate,Biofertilizer, SAGARIKA,</p>', NULL, '', 1, 6, '', 5),
