(879, '5BD1ED24A59E8', '2018-10-25 16:19:48', 'krishnadaslici@gmail.com', 9365476519, 'DOA/F21/NN/000004/06/2018', 'kRISHNA DAS', '', 6, '<p>Sir,Kindly look in to these matter:- <strong>1</strong>. Retail Pesticide License issued by the authority should have the validity period as per rule but, it is no where mentioned. It should be rectified.</p>\r\n<p>2. \"<strong>Particulars of Insecticides</strong>\" as mentioned in the Certificate issued should cover the <strong><em>name of pesticide</em></strong> against which we are licensed to trade. I think, complete information should be mentioned in the Certificate.</p>\r\n<p>Thank you, seeking guidance in this regard.            Krishna Das</p>', NULL, '', 1, 6, '', 2),
