(898, '5BD7E88DE8DD0', '2018-10-30 05:13:49', 'sashankasaha@gmail.com', 9435986980, 'UBIN: AA11402/AAAAB0707G/05/2018; UAIN: RFS/F9/CA/000029/08/2018', 'BIBLES INTERNATIONAL INDIA SOCIETY', '', 6, '<p><span xss=removed>Dear Sir/Madam,</span></p>\r\n<p><span xss=removed>I have received a certificate from your office in my e-mail account on 29/10/2018 for changes in the Managing Body, Constitution, Submission of Balance Sheet and Auditors\' Report of the Society under Section 4 4(a), 4(b) of the S. R. Act XXI of 1860. The postal/corresponding address given in this certificate is the old address which has to be changed, because <strong><span xss=removed>the society is no more located in Court Road, Silchar - 788001. If this address appears automatically in the certificate then KINDLY REMOVE THE ADDRESS APPEARING IN THE <u>SL. NO. 5 (b)</u> in Common Application Form (CAF).</span></strong></span></p>\r\n<p><span xss=removed>The new and present address is given in the Sl. No. 6 \'LOCATION OF THE ENTERPRISE/REGISTERED OFFICE\'.</span></p>\r\n<p><span xss=removed>BIBLES INTERNATIONAL INDIA SOCIETY<br> VILLAGE: KHUNJA BASTI, LALANGKITTA LABOCPAR PART 1<br> P.O. PAILAPOOL<br> DISTRICT: CACHAR<br> STATE: ASSAM - 788098</span></p>\r\n<p><strong><span xss=removed>THE ABOVE MENTIONED ADDRESS SHOULD APPEAR IN THE CERTIFICATE ISSUED TO US.</span></strong><span xss=removed> Thank You.</span></p>\r\n<p><span xss=removed> </span></p>\r\n<p><span xss=removed>Yours Faithfully,</span></p>\r\n<p><span xss=removed>Sashanka Ranjan Saha<br> 30/10/2018</span></p>\r\n<p> </p>\r\n<p class=\"MsoNormal\"> </p>\r\n<p> </p>', '1a22f081e188f0196bdcbc38c1c2a0a50e8950c9.pdf', '', 3, 45, '', 5),
