(928, '5BDE9BA6986F2', '2018-11-04 07:11:34', 'swetaenterpriseeodb@gmail.com', 9085953705, 'RFS/F1/KM/000715/09/2018', 'Sweta Enterprise', '', 2, '<p>Dear Sir,</p>\r\n<p>We filed an application for partnership firm registration in the name of sweta enterprise and sent the required documents by courier service as files could not be uploaded and there was option to send the documents by courrier service. Docuents sent by overnite express courier Consignment No. 3049888494. Kindly intimate the status of our application and do the needful for registration of the Firm</p>\r\n<p> </p>\r\n<p>Thanking You,</p>\r\n<p> </p>\r\n<p>For Sweta Enterprise</p>', NULL, '', 3, 45, '13', 5),
