(935, '5BE3E2AA902DD', '2018-11-08 07:15:54', 'goswamibedananda@gmail.com', 9854028075, 'UBIN-AA23917/NPDBE/23917/10/2018 UAIN-RFS/F15/KM/001976/11/2018', 'AXOM SATTRA UNNAYAN MAHASABHA GUWAHATI', '', 2, '<p>The name of the society will be Axom Sattra Unnayan Mahasabha Guwahati. In the common application form by mistake the spelling of Sattra has been written as Satttra. Please look into the matter.</p>', NULL, '', 3, 45, '', 5),
