k into the matter and provide us necessary guidance so that the application can be submitted on time.</span></p>\r\n<p><span lang=\"EN-US\" xss=removed>Thanking you with regards</span></p>\r\n<p><span lang=\"EN-US\" xss=removed>Raju Chetia</span></p>\r\n<p><span lang=\"EN-US\" xss=removed>Senior Manager (Inspection)</span></p>\r\n<p><span lang=\"EN-US\" xss=removed>NRL</span></p>', 'c91ee46f2dfa54ed20b6539082c96c3810a44d97.pdf', '', 1, 6, '', 5),
(939, '5BE5712A3F1BF', '2018-11-09 11:36:10', 'marketing_it@bvfcl.co.in', 9435734030, 'AA02295/AABCB9399R/06/2017', 'Chandragupta Kakati', '', 6, '<p> <span xss=removed>Dear Sir,</span></p>\r\n<p><span xss=removed>We have received online wholesale renewal license certificate in \"easeofdoingbusinessinassam.in\"(Copy attached). But our main product Mukta Neem Coated Urea was found missing in the product list. You are kindly requested to include the said product and issue a fresh license copy.</span></p>\r\n<p><span xss=removed>Regards,</span></p>\r\n<p><span xss=removed>C Kakati,BVFCL, Namrup</span></p>\r\n<p class=\"MsoNormal\"> </p>', '54bd397fd4b2ed02d340254bf4b8021f590cbb74.pdf', '', 1, 6, '', 5),
