(948, '5BE92D94A1752', '2018-11-12 07:36:52', 'raju.chetia@nrl.co.in', 9435703128, 'AA04856/AAACN6984B/11/2017', 'Numaligarh Refinery Limited', '', 2, '<p><span xss=removed>While applying for renewal of License to work a factory of Numaligarh Refinery Limited in Form-2, certain difficulties were faced and a  support </span><span xss=removed>5BE538515C6CC was raised on November 09 2018 and the status is shown as resolved.</span></p>\r\n<p><span xss=removed>The data was entered in four 04 headings could not be saved. No special character was used. </span></p>\r\n<p><span xss=removed>Please, please please refer to the screenshot attached. Inspite of several communication,we are unable to make you understand the raised issue. Please intimate us if we require to depute any officer to your office to demonstrate the problem we are facing.</span></p>\r\n<p><span xss=removed>We are already in short of time to make the payment after the issue is resolved and apply within due time.</span></p>\r\n<p><span xss=removed>Regards</span></p>\r\n<p><span xss=removed>Raju Chetia</span></p>\r\n<p><span xss=removed>Numaligarh Refinery Limited</span></p>\r\n<p> </p>', '73c19d3d73d1491176e20129627fd52b6fd212aa.pdf', '', 1, 6, '', 5),
