(954, '5BEA69236718F', '2018-11-13 06:03:15', 'klb@klgrroup.com', 9085060991, 'AA19523/AATFK6049C/07/2018', 'KL Beverages', '', 2, '<p>Dear Sir,</p>\r\n<p>We have received the UBIN no of KL Beverages a few months back. But we have made a mistake by declaring the address of Neha Apartments, Athgaon, Guwahati-781001 as <strong>FACTORY</strong>, which should be <strong>HEAD OFFICE</strong>. </p>\r\n<p>We have received another UBIN no of KL Beverages today showing the address of Udayan Vihar, Satgaon, Guwahati-781171 as <strong>FACTORY</strong>.</p>\r\n<p>You are therefore requested to change the Type of Unit of the address of Neha Apartments, Athgaon, Guwahati-781001 as <strong>HEAD OFFICE</strong>.</p>\r\n<p>Your kind action in this regard will be highly solicited.</p>\r\n<p> </p>\r\n<p>Thanking You</p>\r\n<p>KL Beverages</p>\r\n<p>90850-60991</p>', NULL, '', 0, 45, '', 5),
