(957, '5BEBB8E264B50', '2018-11-14 05:55:46', 'vidya.shalimar@gmail.com', 9957717606, 'UAIN : LEDB/F2/KU/000211/11/2018', 'SONA VETS PVT LTD', '', 3, '<p>Dear Sir / Madam,</p>\r\n<p>During last time online application for renewal of Boiler Certificate in May 2018 ( UAIN : LEDB/F2/KU/000131/05/2018 ), the two times extra payment has deducted from my card. Which i want to attache with current boiler certificate renewal application. </p>\r\n<p>Total payment deducted three times and got only one ative challan number ISBD-5b024e7ecdebf for application. </p>\r\n<p>The card statements screenshort and mail notification has attached for your kind consideration. Please help me to use the same extra payment in current Boiler Certificate renewal application. Current application for renewal of Boiler Certificate ref no is UAIN : LEDB/F2/KU/000211/11/2018.</p>', '879b56b1bed8ce8129a414a79beed5e2cb0446ca.docx', '', 3, 45, '', 5),
