(960, '5BEBFD8FBFAB6', '2018-11-14 10:48:47', 'kmmtejaswi@aai.aero', 8547743432, '1. CEI/F16/DI/000006/10/2018 2. CEI/F16/DI/000008/10/2018', 'K M M TEJASWI', '', 3, '<p>Sir,</p>\r\n<p> </p>\r\n<p>The subject mentioned UAIN\'s are registered in EODB, for renewal of NOC of Escalators ( 2 No\'s), at Terminal Building, Dibrugarh Airport.</p>\r\n<p>Physical verification for one Escalator is already completed on 03.11.2018 <span xss=removed>by Sub Asst Electrical Inspector, Milan Nagar at Dibrugarh Airport</span>. What are the further procedures to get fresh NOC for both the Escalators. Is it mandatory for physical verification of the second escalator, or shall we go to Guwahati with the original documents which needs to be get verified at the <span xss=removed>“Office of Chief Inspector Lifts & Escalators , Dispur at Guwahathi Office“. Please clarify at the earliest as the original NOC validity gets expired by 18.11.2018.</span></p>\r\n<p class=\"MsoNormal\"><span xss=removed>Regards</span></p>\r\n<p class=\"MsoNormal\"><span xss=removed>K.M.M.Tejaswi,</span></p>\r\n<p class=\"MsoNormal\"><span xss=removed>Asst Manager Engg(E),</span></p>\r\n<p class=\"MsoNormal\"><span xss=removed>Dibrugarh Airport,</span></p>\r\n<p class=\"MsoNormal\"><span xss=removed>Dibrugarh,</span></p>\r\n<p class=\"MsoNormal\"><span xss=removed>Mob No: 8547743432</span></p>\r\n<p><span xss=removed> </span></p>', NULL, '', 3, 45, '', 5),
