(984, '5BEFB779B8B06', '2018-11-17 06:38:49', 'yule.hoolungooree@gmail.com', 9435246250, 'LEDF/F4/JO/000058/11/2017', 'Mr. D.J. Neog', '', 3, '<div xss=removed>We have tried to apply online for renewal of application form of Factory license last year in 2017, but it was unsuccessful and we went for offline mode and received the said License, now for the next year renewal i.e 2019, we are again trying for online mode but the last years incomplete application bearing the <strong>UAIN : LEDF/F4/JO/000058/11/2017</strong> is showing up, as per telephonic conversation with the helpline we were instructed to continue with this same UAIN and uplaod new documents as and where required, after doing the same in the <strong>payment mode</strong> the last years DD receipt is showing up which we want to cancel and upload the new one which we are not able to do as there is no such option.</div>\r\n<div xss=removed> </div>\r\n<div xss=removed>Please advice <strong>how to upload a fresh DD receipt and cancel the earlier uploaded one</strong>.</div>', NULL, '', 1, 6, '', 5),
(985, '5BEFC619F38E4', '2018-11-17 07:41:13', 'dcpltinsukia@gmail.com', 9435412766, 'UBIN : AA01842/AACCD2107L/05/2017', 'MANASH JYOTI KONWAR', '', 2, '<p>DEAR SIR</p>\r\n<p>PLEASE FIND ATTATCHMENT PDF COPY OF OUR DIRECTOR RESIGNATION LETTER NAME OF SRI <strong><span xss=removed>JAGADISH CHANDRA PAUL (DIN : 00547223) & BOARD OF DIRECTORS RESOLUTION LETTER DT. 11/08/2017</span>.</strong> SRI <strong><span xss=removed>JAGADISH CHANDRA PAUL </span></strong>WAS RESIGNED APPLY FOR 07/08/2017 & HIS REGISNATION ACCEPTED BY THE BOARD MEETING WITH EFFECT FROM 11/08/2017. </p>\r\n<p>PLEASE REMOVE NAME OF THE DIRECTOR SRI <strong><span xss=removed>JAGADISH CHANDRA PAUL (DIN : 00547223) </span></strong> OUR PROFILE ENTERPRISE DETAILS IN SL. NO. 4(a) & OTHER ETC.</p>', '8a5fd64f8a4bba09b805da436269bfd36410b03d.pdf', '', 3, 45, '', 5),
(986, '5BF04009580AC', '2018-11-17 16:21:29', 'mfarazee888@gmail.com', 8046063905, 'AA07183/ABPPV9673G/12/2017', 'Sri Balram Verma', '', 2, '<p>Sir/Madam, I have mistakenly writing in form no 2 for renewal of factory licence,  sl.  no 6 (i) and (ii) 329.64 HP,  but this is wrong , the correct power is 750 HP, so sir please correction the above sl. No in form no.2</p>', NULL, '', 1, 6, '', 5),
