(1025, '5BF960E0CBDB1', '2018-11-24 14:32:00', 'psrisrimggbbs@gmail.com', 9435091067, 'RFS/F13/JO/000466/07/2018', 'PARAMHANS 108 SRI SRI MATSWAMI GIRIJANANDA GIRI BALAKBABA SEWA ASHRAM', '', 6, '<p>You are hereby requested to solve our problem against ticket no<span xss=removed>#5BE6B7069C31B from your end.</span></p>\r\n<p> </p>\r\n<p><span xss=removed>THANKING yOU</span></p>', NULL, '', 3, 45, '', 5),
(1026, '5BFA94FFBF3D9', '2018-11-25 12:26:39', 'alamajrooh@gmail.com', 9435993637, ' AA05954/BLRPK3884R/11/2017', 'nur islam khan', '', 3, '<p>payment done for factory license but error occured</p>', NULL, '', 3, 45, '', 5),
(1027, '5BFB8545D1A71', '2018-11-26 05:31:49', 'monojdomai60@gmail.com', 8876071779, 'AA05411/AOJPD0223R/11/2017', 'Sri Manoj Domai', '', 2, '<p>Sir I have mistakenly fill in common application form for my enterprise name CHUNU BRICK INDUSTRY UNIT-1 but this is wrong, the correct name of enterprise is M/s CHUNU BRICK INDUSTRY, </p>\r\n<p>Please correct the name of enterprise.</p>', NULL, '', 3, 45, '', 5),
(1028, '5BFBA3849918F', '2018-11-26 07:40:52', 'concordme10@gmail.com', 9678524247, 'RFS/F1/CD/000650/09/2018', 'M/S CONCORD ENTERPRISE', '', 2, '<p>SIR/MAM</p>\r\n<p> I have upload a file name is\" M/S CONCORD ENTERPRISE\". but i have mistake  file area pincode & police station  .. corrrect pin code is-785673 and police station is-Moranhat  (Charaideu District)</p>\r\n<p>    kindly resolve this mater... thnk you.. yours faithfully.....</p>', NULL, '', 3, 45, '', 5),
(1029, '5BFBBA06ABD41', '2018-11-26 09:16:54', 'swetaenterpriseeodb@gmail.com', 9085953705, 'RFS/F1/KM/000715/09/2018', 'Sweta Enterprise', '', 2, '<p>Dear Sir/Madam</p>\r\n<p>Plz include the name of the first Partner as mentioned in the Form 1, i.e., M/s Dosi Tourism Private Limited represented by its Managing Director Vijay Singh Dosi which is also in the Partnership Deed. As regard nature of business, the firm at present, has started only construction of Appartments (office) which is included in clause 2 (c) of Partnership Deed. Hence Registration of Partnership firm may be allowed for construction and Appartment. Further, at present there has been  no labour & staff finalized and hence labour licence cannot be applied for and uploaded at this stage which may be considered or suggest the way to proceed further.The date of Establishment of the Firm is 25.09.2017 and the duration is till such period as partners may mutually decide and dissolve. In other words  no  term is fixed by partners of Partnership business as per Deed of Partnership. Please consider and /or suggest the way to proceed further in the registration process.</p>\r\n<p>Thanking You, </p>\r\n<p>For Sweta Enterprise.</p>', NULL, '', 0, 47, '', 2),
