(1090, '5C08FECD31120', '2018-12-06 10:49:49', 'brahmaputra.201817@gmail.com', 9613257011, 'AA08786/AGMPB6781F/01/2018', 'BRAHMAPUTRA ENTERPRISE', '', 7, '<p>Respected Sir/Madam</p>\r\n<p>     We apply online renewal  for the our renewal certificate at pollution control board assam last year through ease of doing business in assam portal.But unfortunatelly we forgot our user name and password.we also tried to reset the password as we created a particular email id for eodb purpose we forgot that email address also ,hence we are asking help from this portal.we provide our UBIN number also.you can contact us with the new email address.Please do the needfull as it is urgent.thank you</p>', NULL, '', 1, 45, '', 5),
(1091, '5C090E76DA45A', '2018-12-06 11:56:38', 'bpt@goodricke.com', 9859917567, 'AA14597/AAECS3091C/04/2018', 'Senior Manager, Borpatra Tea Garden', '', 2, '<p class=\"MsoNormal\">Dear Sir,</p>\r\n<p class=\"MsoNormal\">I write to request you that we have made some mistakes while filling up form 2 for renewal of factory license on the easeofdoingbusinessinassam website. I will be thankful if you could kindly help/allow us to make following corrections in above form:</p>\r\n<p class=\"MsoNormal\"> </p>\r\n<p class=\"MsoNormal\">Correct details are</p>\r\n<p class=\"MsoNormal\"> </p>\r\n<p class=\"MsoListParagraph\" xss=removed>&lt;!-- [if !supportLists]--&gt;<span xss=removed><span xss=removed>1.<span xss=removed>     </span></span></span><strong><u>Legal Entity</u> :</strong> Stewart Holl India Limited is wrongly mentioned as Pvt Ltd Co. in the form, whereas it is actually a “<span xss=removed>PUBLIC LIMITED COMPANY”</span></p>\r\n<p class=\"MsoListParagraph\" xss=removed>&lt;!-- [if !supportLists]--&gt;<span xss=removed><span xss=removed>2.<span xss=removed>     </span></span></span><strong><u>Name of Director</u></strong> : Name of <strong>Mr.</strong> <em><strong>Y Levin has to be deleted</strong></em> from the names of Directors as he has retired from his services. <em>Our current Director is “<span xss=removed>Mr. ATUL ASTHANA”</span>.</em></p>\r\n<p class=\"MsoNormal\">A copy of the form is attached herewith for your ready reference.</p>\r\n<p class=\"MsoNormal\"> </p>\r\n<p class=\"MsoNormal\"> </p>\r\n<p class=\"MsoNormal\">Yours faithfully,</p>\r\n<p class=\"MsoNormal\"> </p>\r\n<p class=\"MsoNormal\"><strong>Dhrubajyoti Baruah</strong></p>\r\n<p class=\"MsoNormal\">Senior Manager</p>\r\n<p class=\"MsoNormal\">Borpatra Tea Garden</p>', '4a4f96bd5d8b100ec0e2f54ff5ac35dd2986db5a.pdf', '', 1, 6, '', 2),
