(1128, '5C0E466F47129', '2018-12-10 10:56:47', 'pureandcure.assam@akums.in', 9401450222, 'SDC/F20/KU/000057/04/2018', 'Mr. Dilip Gupta', '', 6, '<p>Dear Sir,</p>\r\n<p>In context of above, additional product permission received under UAIN no. SDC/F20/KU/000057/04/2018, the product mentioned at<strong> s.no. 4</strong> needs correction in the spelling of <strong>\"Hydrochlorthiazide\" to \"Hydrochlorothiazide\"</strong> under column \"<strong>Name of the product\"</strong> and also the spelling of <strong>\"Contians\" to \"Contains\" under column \"Composition\"</strong></p>\r\n<p>Thanks & Regards</p>', NULL, '', 1, 6, '', 5),
(1129, '5C0E4733A4650', '2018-12-10 11:00:03', 'pureandcure.assam@akums.in', 9401450222, 'SDC/F20/KU/000024/01/2018', 'Mr. Dilip Gupta', '', 6, '<p>Dear Sir,</p>\r\n<p>In context of above, additonal product permission received under UAIN no. SDC/F20/KU/000024/01/2018, in the product mentioned at <strong>s.no. 10</strong>, under column <strong>composition</strong> the spelling of <strong>\"Excipeints\" needs to be corrected to \"Excipients\".</strong></p>\r\n<p>Thanks & Regards</p>', NULL, '', 1, 6, '', 5),
(1130, '5C0E49316DE63', '2018-12-10 11:08:33', 'klf@klgrroup.com', 9085060991, 'RFS/F1/KM/000842/11/2018', 'KL FOODS', '', 2, '<p>Sir,</p>\r\n<p xss=removed>We have filled up the Application form for Registration of Partnership Firms under IP Act, 1932 for our unit, <strong>KL Foods</strong>. But mistakenly the Revenue Circle is mentioned as <strong>AZARA</strong> which is wrong. The correct revenue circle should be <strong>DISPUR, </strong>as Beltola mouza falls under Dispur Circle.</p>\r\n<p xss=removed>As regard to the Patta no and Dag no are concerned, we have mentioned the <strong>Old Patta no (11/3) and Dag no (93/94/95). The new Patta no should be 4 and new Dag no should be 88.</strong></p>\r\n<p>You are therefore requested to rectify the above mistakes in the CAF.</p>\r\n<p>Thanking you.</p>\r\n<p>Yours faithfully</p>\r\n<p>Sri Debasis Sarmah</p>\r\n<p>For, M/s KL Foods</p>\r\n<p>90850-60991</p>', NULL, '', 3, 47, '', 5),
(1131, '5C0E523BEBCE0', '2018-12-10 11:47:07', 'mridul99994@gmail.com', 8876411484, 'UBIN : AA03163/DENPS5296J/07/2017', 'Mridul Jyoti Sarma', '', 3, '<p>Hello, I have tried to renew my license two times. Both time got message saying it has been rejected. ( <a href=\"https://easeofdoingbusinessinassam.in/departments/requires/pdf_with_acknowledgement.php?uain=GMC/TRADE/KM/000161/04/2018\" target=\"_blank\" rel=\"noopener noreferrer\">GMC/TRADE/KM/000161/04/2018</a>, <a href=\"https://easeofdoingbusinessinassam.in/departments/requires/pdf_with_acknowledgement.php?uain=GMC/TRADE/KM/000275/05/2018\" target=\"_blank\" rel=\"noopener noreferrer\">GMC/TRADE/KM/000275/05/2018</a>). I don\'t know the reason of rejection. Kindly help. Also though application has been rejected but I didn\'t get back any refund.</p>', NULL, '', 3, 47, '', 5),
