(1133, '5C0E61632B5C6', '2018-12-10 12:51:47', 'nitairastravashamahavidyalaya@gmail.com', 9854285345, 'RFS/F13/SV/000106/04/2018', 'GOPAL SARUP BHUYAN', '', 6, '<p>I HAVE UPLOADED MY DOCUMENTS ON 3 DECEMBER 2018 AS REQUIRED ACCORDING TO THE QUERRY DATED 6 APRIL 2018. BUT NO RESPONSE TILL NOW. KINDLY LOOK INTO THE MATTER.</p>', NULL, '', 3, 47, '', 2);
