(1136, '5C0F74DA81C49', '2018-12-11 08:27:06', 'styleflexpspl@gmail.com', 9435052604, 'AA09544/AAYCS0116J/02/2018', 'GAUTAM GHOSH', '', 2, '<p><span xss=removed>Dear Sir/Madam</span></p>\r\n<p><span xss=removed>I would like to inform you that we have register the user in respect of our unit M/s Styleflex Print System Private Limited consisting the UBIN NO. </span><span xss=removed>AA09544/AAYCS0116J/02/2018 </span><span xss=removed>in Ease of Doing Business in Assam Portal , while filling common application form for the unit due to some mistake Name of the industrial unit is filled with the name of the partner & we have applied for renewal for consent to operate 19-20 in the portal but Acknowledge Online Form  shows the name of the partner in place of name of the unit , so kindly do the needful so we can rectify the mistake in the Common Application Form </span></p>\r\n<p><span xss=removed>Thank You </span></p>', NULL, '', 3, 47, '', 5),
