(1138, '5C109D1114080', '2018-12-12 05:30:57', 'goombirate@gmail.com', 9706320491, 'AA02399/AACCG2190G/05/2018', 'Goombira Tea Company Limited', '', 2, '<p>Dear Sir/Madam</p>\r\n<p>We want to do some small changes in our application</p>\r\n<p>form.</p>\r\n<p> </p>\r\n<p>1.  We want to change our LEGAL ENTITY from Private limited company to Public Limited Company,  their was a typological error.</p>\r\n<p> </p>\r\n<p>2 .  Full postal address and Situation of the factory : we want to replace the name of Street 2.</p>\r\n<p> </p>\r\n<p>3.  Directors name: we want to change our Director Name.</p>\r\n<p> </p>\r\n<p>Kindly help to correct our application form.</p>\r\n<p> </p>\r\n<p>Thanking you</p>\r\n<p> </p>\r\n<p>Yours Faithfully</p>\r\n<p> </p>\r\n<p>Gaurav Tulshyan</p>\r\n<p>Goombira Tea Company Ltd.</p>\r\n<p>Karimganj</p>\r\n<p>9706320491</p>\r\n<p> </p>', NULL, '', 1, 6, '', 2),
