(1185, '5C138D35AAA79', '2018-12-14 11:00:05', 'vks_aquagold@yahoo.com', 9435569016, 'LEDF/F4/NN/001126/11/2018', 'V.K Food & Beverages', '', 3, '<p>Dear Sir,</p>\r\n<p>We have made a payment of Rs. 875/- towards the late fees for renewal of factory licence as per the query raised by the Deptt. The amount has been debited form our account but the same has not yet been reflected in EODB site. </p>\r\n<p>Request you to do the needful and enable us to process our application at the earliest.</p>', NULL, '', 3, 47, '', 2),
(1186, '5C138EE0E0B98', '2018-12-14 11:07:12', 'maamiraent@gmail.com', 9854047432, 'UBIN : AA27009/BVVPS2290B/12/2018', 'sankar saha', '', 7, '<p>Dear sir,</p>\r\n<p>the name of the enterprise was typed as MM MIRA instead of MAA MIRA by mistake.</p>\r\n<p>Kindly correct the name of the enterprise to MAA MIRA</p>\r\n<p>Thank you</p>', NULL, '', 3, 47, '', 5),
(1187, '5C1390ECBB20D', '2018-12-14 11:15:56', 'saiassam@sai-enterprises.com', 9127071041, 'LEDF/F4/ST/000549/10/2018', 'SAI ENTERPRISES', '', 3, '<p>WE WANT TO EDIT OUR CONTACT NO ,MAIL ID OF OUR COMPANY AS PER ABOVE AND WE WANTED TO KNOW WHY THE ABOVE MENTION UAIN NO OF FORM- 2 WAS SHOWN AS INCOMPLETE  & NOT SUBMITED.</p>', NULL, '', 3, 47, '', 2),
(1188, '5C13A4B6384AB', '2018-12-14 12:40:22', 'saronganguly1993@gmail.com', 7044310441, 'AA02410/AABCG1614Q/06/2017', 'Saron Ganguly', '', 3, '<p> </p>\r\n<div xss=removed>Hello,</div>\r\n<div xss=removed>I was making a payment at easeofdoingbusinessinassam website. My payment didnot go through as it said some problem with the server, but the amount was deducted from my account. Noe my bank has already deducted my money. On enquiring they have reverted me a mail saying that the payment was successful from the bank side and asked me to share the email with you for proof.</div>\r\n<div xss=removed>I am attaching the screenshot of the email which contains the details of transaction in your website.</div>\r\n<div xss=removed>Please see to it and refund </div>', 'fd09cd1b2ae94d025bb5b31894c7f97b8d06413f.jpeg', '', 3, 47, '', 5);
