(1189, '5C13A54ACB852', '2018-12-14 12:42:50', 'atlantishealthcareghy@gmail.com', 9707528002, 'SDC/F40/KM/000005/07/2018', 'Atlantis Healthcare', '', 3, '<p>Respected Sir/Madam,</p>\r\n<p>I have enrolled for retention of my previous drug licence via the EODB portal as my place of work has changed.</p>\r\n<p>However while doing the payment on 10th of July, the amount of Rs. 6011.80 was debited from my bank account however no challan was issued to me. I was thinking that my licence will be renewed, however the drug licence office has told me to get another new licence now, by paying for another challan manually, offline.</p>\r\n<p> </p>\r\n<p>So, I would like to request you to kindly reimburse me back my previously debited money so that I am able to make the repayment of the new licence and get my licence at the earliest possible day.</p>\r\n<p> </p>\r\n<p>The bank receipt bearing the UTR number has been attached for your reference.</p>', '501e4384b24c4bdc1330526804246ea7735b44b7.pdf', '', 3, 47, '', 5),
(1190, '5C13BE208AFB5', '2018-12-14 14:28:48', 'rohibulh.786@yahoo.com', 8011879749, 'UBIN : AA25297/AGZPI8834R/11/2018 ', 'Rohibul Islam', '', 2, '<p>Respected Sir/Madam,</p>\r\n<p>Kindly please change the name of Enterprise from Munna Medical Store to Munna Drug Distributor and the remaining will be the same as it is.</p>\r\n<p>Thanking you.</p>\r\n<p>Yours faithfully,</p>\r\n<p>Rohibul Islam.</p>', NULL, '', 3, 47, '', 5),
(1191, '5C147E1B9DBCD', '2018-12-15 04:07:55', 'kanchanna2018@hotmail.com', 7002057321, ' AA26131/NPDNA26131/11/2018', 'M/S KANCHAN NAHAR ASSOCIATES', '', 2, '<p>DEAR SIR/  MADAM,</p>\r\n<p> </p>\r\n<p>PLEASE SIR CORRECT THE DATE OF ESTABLISHMENT - TYPING MISTAK - </p>\r\n<h2><span xss=removed><strong>WRONG DATE: <span xss=removed> 02/04/2017</span></strong></span></h2>\r\n<h2><strong>CORRECTED DATE : 22/11/2018</strong></h2>\r\n<p> </p>\r\n<p><strong>THANKING YOU</strong></p>\r\n<p><strong>REGARDS<br><br></strong></p>\r\n<p> </p>\r\n<p><strong>NABA KUMAR BRAHMA</strong></p>\r\n<p><strong>PARTNER OF </strong></p>\r\n<p><strong>M/S KANCHAN NAHAR ASSOCIATES</strong></p>', NULL, '', 3, 47, '', 5),
(1192, '5C1487C51E3F5', '2018-12-15 04:49:09', 'anjar.ghy@gmail.com', 7086027338, 'LEDB/F2/MA/000246/12/2018', 'ESES BIO WEALTH PRIVATE LIMITED', '', 6, '<p>Respected Sir / Madam,</p>\r\n<p>With due honour I would like to inform you that I have submitted the application for renewal of registration of boiler. But during filling of application, the heating surface was mistakenly typed as <strong>139 M2</strong> instead of <strong>69 M2</strong>. The actual heating surface will be <strong>69 M2</strong>. The payment is not submitted because of the mistake. The UAIN is <strong>LEDB/F2/MA/000246/12/2018</strong>. Please help to rectify the mistake so that I can complete the payment. </p>\r\n<p>Thanking you</p>\r\n<p> </p>\r\n<p>From ESES Bio Wealth Pvt. Ltd.</p>\r\n<p> </p>', NULL, '', 1, 6, '', 5),
(1193, '5C149E076E22A', '2018-12-15 06:24:07', 'ruchit_79@rediffmail.com', 9864139525, 'AA27023/AHNPB6041J/12/2018.', 'MEDIPLUS', '', 6, '<p>Dear Sir/Madam</p>\r\n<p> </p>\r\n<p>I want to renew my Drug Licence (Wholesale) Form 20-B and Form 21-B, but in online Form 20-B and 21-B not shown in online system, so how i can renew the Drug Licence,</p>\r\n<p>So, you are requested to guide me to renew my Drug Licence.</p>\r\n<p> </p>\r\n<p>Thanking You</p>\r\n<p>For Mediplus</p>\r\n<p>Tinsukia, Assam</p>', '52850156edbd26fffdb739b6dbbd6854a669dbae.jpg', '', 3, 47, '', 2),
