(1244, '5C1A26A722F2A', '2018-12-19 11:08:23', 'nethermion@gmail.com', 9435030051, 'UAIN- PCB/F50/DI/002661/03/2018', 'NE THERMION PVT LTD', '', 3, '<p>Dear Sir,</p>\r\n<p>We have uploaded and submitted the CTO Online and wanted to pay the PCBA CTO Fees through Net Banking from HDFC Bank on 28/03/2018. But while making the Online Payment for an amount of Rs. 25,105.90 (Bank Charges Included) was deducted from our account and due to some technical failure we did not get the Acknowledgement. Hence later we have tried from Indian bank and paid the PCBA CTO Fees and we have got the Acknowledgement.</p>\r\n<p>Hence we kindly request you to look into matter and refund the amount in our HDFC Bank Account of Rs. 25,100.00/- which was debited from HDFC Bank. The statement of the money deducted from HDFC Bank and the statement of Indian Bank through which we made the payment again and got the Acknowlegement is attached.</p>\r\n<p>Thanking you,</p>\r\n<p>NE Thermion Pvt Ltd</p>', '666d0aa7c4571b844248e0df17242c4c5de5f6aa.pdf', '', 1, 6, '', 5),
