(1330, '5C25C827A8A1C', '2018-12-28 12:22:23', 'dilipsarkar064@gmail.com', 8254096891, 'AA28118/CPPPS2472L/12/2018', 'DILIP SARKAR', '', 2, '<p>Dear Sir/Madam, </p>\r\n<p>I have submitted an application in the of M/s Maa Medicos (retail )and the UBIN no is AA28118/CPPPS2472L/12/2018 and now I want to apply for wholesale with the firm name M/s Dev Pharma. Now, whether i have to add unit with the existing ubin or do i need to apply a fresh with another email and mobile no as because the proprietor of both the firm is Dilip Sarkar and same individual Pan card.</p>\r\n<p>So, please suggest how to apply in this case.</p>\r\n<p> </p>\r\n<p>Thanking you.</p>\r\n<p>Dilip Sarkar</p>\r\n<p> </p>\r\n<h4 xss=removed> </h4>', 'accea917a2fe8f484112fa24f79800eccd09d182.png', '', 3, 47, '', 5),
(1331, '5C25C97C78E1D', '2018-12-28 12:28:04', 'Kdujjaman@gmail.com', 9435082970, 'AA05042/ACTPJ0802C/11/2017', 'Khaliduj zaman', '', 2, '<p>Sir mistakenly I have filled in form no 2 in sl. No.  7,8 and 9 MD. KHALIDUZ ZAMAN instead of MD KHALIDUJ ZAMAN, so department queried. </p>\r\n<p>So sir please correct the above issue in form no. 2.</p>\r\n<p> </p>', '84c7fff0a4259b5a4a0f05f71f594e8150506b53.pdf', '', 1, 6, '', 5),
(1332, '5C25D404F02BB', '2018-12-28 13:13:00', 'ayanjyoti03@gmail.com', 7906148100, 'RFS/FI/CV/000894/12/2018', 'Rupankar Jyoti Dutta', '', 2, '<p>As the query to us goes like: \"<span xss=removed>raise ticket on EODB portal requesting them to mention date of joining of partners as per deed of partnership in the application form and as well as requesting them to upload photographs & signatures of the partners in the online application form.\"</span></p>\r\n<p><span xss=removed>We are submitting the attached document.</span></p>\r\n<p><span xss=removed>Moreover, as enquired, the date of joining of partners is 24/08/2018.</span></p>\r\n<p><span xss=removed>Hope this will suffice.</span></p>\r\n<p><span xss=removed>Regards</span></p>\r\n<p><span xss=removed>For</span></p>\r\n<p><span xss=removed>AR Natural</span></p>', '8c188cc5c67757c45c85c01505293a5c1cd131df.pdf', '', 3, 47, '', 5),
(1333, '5C25D77F42F75', '2018-12-28 13:27:51', 'nokhroy@gmail.com', 7002492685, 'LEDF/F4/TI/000585/11/2018', 'Mr. Pradeep Borgohain, Estate Manager, Nokhroy T. E. ', '', 6, '<p class=\"MsoNormal\" xss=removed>Dear Sir,</p>\r\n<p class=\"MsoNormal\" xss=removed>We would like to inform you that we have submitted our Online Application for Renewal of Factory License (Form No. 2) (UAIN No. LEDF/F4/TI/000585/11/2018) on 17.11.2018. On dated 12.12 2018 we have received a mail that our application had been rejected by the Chief Inspector Factories, Golaghat Section whereas our garden is located in Tinsukia district. While tracking our application in the website we have found we have found that few details in the application automatically changed. Eg. of such changes are like SL No. 1. License No. changed from TSK/74 to GLT/10, SL No. 4 Name and value of the principal product, SL No 5, SL No. 6, SL No. 7 etc which we have highlighted in the attached copy. But surprisingly the payment details remain the same that we had entered at the time of submission of application form. In this regards we would also like to inform you that Bokakhat T. E. is our sister concern and few data that we had entered remain same like Occupier name & address etc. <span xss=removed> </span></p>\r\n<p class=\"MsoNormal\" xss=removed>Sir, as our Factory license will valid till 31.12.2018; we would like to request you kindly to look into this and take necessary corrective action in this regards.</p>\r\n<p class=\"MsoNormal\" xss=removed>Thanking you, submission</p>\r\n<p class=\"MsoNormal\" xss=removed>Yours faithfully</p>\r\n<p class=\"MsoNormal\" xss=removed>Estate Manager,</p>\r\n<p class=\"MsoNormal\" xss=removed>Nokhroy T. E. <span xss=removed> </span><span xss=removed> </span></p>', 'f3933b62fa991bac8fd7651d8a328bc8caf046d9.pdf', '', 3, 47, '', 5),
(1334, '5C25F24705D86', '2018-12-28 15:22:07', 'sarkarfoundation537@gmail.com', 9101640940, 'UAIN : RFS/F13/KU/000912/12/2018', 'SARKAR FOUNDATION', '', 2, '<p class=\"MsoNormal\" xss=removed><span xss=removed>I have wrongly typed district name & village name in common application from. Please correction or edit.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span xss=removed> </span></p>\r\n<p class=\"MsoNormal\" xss=removed><span xss=removed>Wright one is District Name : <strong xss=removed>Darrang</strong></span></p>\r\n<p class=\"MsoNormal\" xss=removed><span xss=removed>Village Name: <strong xss=removed>Silbari</strong></span></p>', NULL, '', 3, 47, '', 2),
(1335, '5C25F73D7AA94', '2018-12-28 15:43:17', 'agrawal.piyushgarg@gmail.com', 9864089320, ' AA03094/AAMFC5186B/07/2017', 'Piyush Agarwal', '', 2, '<p>Dear Team,</p>\r\n<p> </p>\r\n<p>I have two UBIN for the same company with same pancard. Actually the first UBIN was when i started my business but now when i have changed my office, i created new UBIN number with my present address. So, request you to delete my previous UBIN number because its of no use. and it can be misused in future.</p>\r\n<p>As i had applied a trade license from the old UBIN number and also recived it, it can be misused.</p>\r\n<p>Request you to kindly help me with the same.</p>\r\n<p>Thanks and regards</p>\r\n<p>piyush agarwal</p>', NULL, '', 3, 47, '', 5),
