(1338, '5C260411E42E0', '2018-12-28 16:38:01', 'jayanta.sarma@marico.com', 8876517312, 'SDC/F58/KU/000106/09/2018', 'jayanta kumar sarma', '', 6, '<p>Hello Sir,</p>\r\n<p><span xss=removed>I have submitted one Application for manufacturer of additional products of Cosmetics for sale or distribution - Form 31via UAIN No- <strong><em>SDC/F58/KU/000106/09/2018</em></strong> bearing product Name </span><span xss=removed>“ <strong>HAIR & CARE Shanti Badam Hair Oil </strong></span><span xss=removed>\" for mfg Lic No C-27M/ 2016.</span></p>\r\n<p><span xss=removed>We have got the License too from state drug control organization, Hengrabari, Guwahati on 21.12.2018. But after getting of license we have observed that in \"Pack Size column\" 78 ml is missing. Therefore I request you kindly add 78 ML too in the license copy.Refer the attched file for your better understanding.</span></p>\r\n<p><span xss=removed> </span><u></u></p>', '21be995405d3b4a1e745e571a45342b919aff123.pdf', '', 1, 6, '', 5),
(1339, '5C2606CEABFC5', '2018-12-28 16:49:42', 'hanumanmaloswal@gmail.com', 7002288989, 'LEDF/F4/SV/000828/11/2018', 'HANUMANMAL OSWAL', '', 3, '<div class=\"gs\" xss=removed>\r\n<div class=\"\">\r\n<div id=\":tn\" class=\"ii gt adO\" xss=removed>\r\n<div id=\":tm\" class=\"a3s aXjCH \" xss=removed>\r\n<div dir=\"ltr\">\r\n<div dir=\"ltr\">sir</div>\r\n<div dir=\"ltr\">i am  paid fees on 16th Nov this is  not update and this amount i am not receive refund my <span id=\"m_2592036954473057314:14s.4\">tra</span> id  of bank is 20181116203923/0  on 16th Nov again i am paid on 29th Nov it is update so please check payment on 16th Nov and refund me. </div>\r\n<div>sir I am attach bank statement on both 16th Nov & 29th Nov for fees payment for factory <span id=\"m_2592036954473057314:14s.8\">lic</span> renew.</div>\r\n</div>\r\n<div class=\"yj6qo ajU\" xss=removed>\r\n<div id=\":vk\" class=\"ajR\" xss=removed tabindex=\"0\" data-tooltip=\"Show trimmed content\"><img class=\"ajT\" xss=removed src=\"https://ssl.gstatic.com/ui/v1/icons/mail/images/cleardot.gif\"></div>\r\n</div>\r\n</div>\r\n</div>\r\n<div id=\":vd\" class=\"hq gt a10\" xss=removed>\r\n<div class=\"hp\" xss=removed> </div>\r\n<div class=\"a3I\" xss=removed>Attachments area</div>\r\n<div id=\":vg\"> </div>\r\n<div id=\":vf\" class=\"aQH\" xss=removed> </div>\r\n</div>\r\n<div class=\"hi\" xss=removed> </div>\r\n</div>\r\n</div>', '75dea9c81770a05f8ae02a27dc77c0d3dfbe4f87.pdf', '', 3, 47, '9', 2),
(1340, '5C2607246EE49', '2018-12-28 16:51:08', 'jayanta.sarma@marico.com', 8876517312, 'SDC/F58/KU/000107/09/2018', 'jayanta kumar sarma', '', 6, '<p>Hello Sir,</p>\r\n<p xss=removed><span xss=removed>I have submitted one Application for manufacture of additional products of Cosmetics for sale or distribution - Form 31via UAIN No- <strong><em>SDC/F58/KU/000107/09/2018</em></strong> bearing product Name </span><span xss=removed>“<strong>HAIR & CARE Shanti Badam Hair Oil\" </strong></span><span xss=removed>for mfg Lic No C-29M/2016.</span></p>\r\n<p><span xss=removed>We have got the License too from state drug control organization, Hengrabari, Guwahati on 21.12.2018. But after getting of license we have observed that in \"Pack Size\" column of license 78 ML is missing. Requesting you to add 78 ml too in the license copy. </span></p>\r\n<p><span xss=removed>During the time of application from our side we may be missed to type the 78 ml. But in uploaded document in formulation 78 ml is clearly mentioned.</span></p>\r\n<p><span xss=removed>I\'ll be very much grateful for your support. Thanking you.  </span><u></u></p>', '41b722fcc4a20d0c34057f590d19832be1acc6c2.pdf', '', 1, 6, '', 5),
(1341, '5C26282493F9B', '2018-12-28 19:11:56', 'atlantishealthcareghy@gmail.com', 9707528002, 'SDC/F1/KM/001296/12/2018', 'Atlantis Healthcare', '', 3, '<p xss=removed>Dear Sir,</p>\r\n<p xss=removed>I was going to apply for a new drug licence 4 days ago and my form was complete.</p>\r\n<p xss=removed>I made the payment via netbanking through Indusind bank, my account got debited for Rs. 3011.80 however when I try to print my e-challan, it is not being generated.</p>\r\n<p xss=removed>Kindly find the bank copy of the transaction attached.</p>\r\n<p xss=removed>As per my last support ticket I was asked to wait for 3 days for the amount to be reversed, however the same has not yet reflected in my bank account yet and it will be 5 days tomorrow.</p>\r\n<p xss=removed>Kindly help me resolve this issue by issuing me the challan number or refunding me back my money, so that I can do the necessary and get my licence issued at the earliest.</p>', '93f7e95ef6a7a20b8a4b40951afa18f806124fe2.pdf', '', 3, 47, '', 5),
(1342, '5C2629E9632F4', '2018-12-28 19:19:29', 'atlantishealthcareghy@gmail.com', 9707528002, 'SDC/F40/KM/000005/07/2018', 'Atlantis Healthcare', '', 2, '<p>I applied for drug licence however the same has not been issued to me, </p>\r\n<p>I visited the department and I was asked to tell you to make some amendments in my Common application form.</p>\r\n<p> </p>\r\n<p>Instead of the current form \"<span xss=removed>Application for Retention of a licence to manufacture for sale or for distribution of drugs specified in Schedule C and C (1) excluding those specified in part XB and Schedule X Form 27\" update the form to </span><span xss=removed>APPLICATION FOR GRANT OF A LICENSE TO SELL, STOCK, EXHIBIT OR OFFER FOR SALE, OR DISTRIBUTE DRUGS OTHER THAN THOSE SPECIFIED IN SCHEDULE X FORM 19 AND ADDITIONAL INFORMATION (WHOLESALE)\"</span></p>\r\n<p>It will really be very helpful if the same is done in my form and my challan so that I could get my licence issued at the earliest.</p>\r\n<p>If not, the department has asked me to claim refund from you as instead of the Rs. 3000 normal fees, I was charged a high fee of Rs. 6000.</p>\r\n<p> </p>\r\n<p><span xss=removed> </span></p>\r\n<p> </p>', NULL, '', 3, 47, '', 5),
