(1348, '5C275ABAB89C6', '2018-12-29 17:00:02', 'tezpore.gogra@mcleodrussel.com', 7002835828, 'LEDF/F4/ST/000553/11/2018', 'tezpore gogra', '', 2, '<p>While Filling the Application for Renewal of Factory License(Form no.2)  that in serial no.8 \"Full name and Residential address of Occupier\"   was entered incorrectly from our side which needs to be change.</p>\r\n<p><strong>Incorrect Entery. </strong></p>\r\n<p><span xss=removed><em>Name of occupier - Sanjay Bajpai</em></span></p>\r\n<p><span xss=removed><em>Street name 1- Flat no.3A, Swagat Apartments,</em></span></p>\r\n<p><span xss=removed><em>Street name 2- karbi Path, Zoo Narangi Road</em></span></p>\r\n<p><span xss=removed><em>Village/Town : Guwahati    District : Kamrup(M)      Pincode : 781021</em></span></p>\r\n<p><strong><em>Which Needs to Be Corrected To</em></strong> </p>\r\n<p><strong>Correct Details :</strong></p>\r\n<p><strong>Name- MR. RAJEEV TAKRU</strong></p>\r\n<p><strong>Street name 1: TEZPORE & GOGRA TEA ESTATE</strong></p>\r\n<p><strong>Street name 2: P.O - BINDUKURI</strong></p>\r\n<p><strong>village/Town : BINDUKURI</strong></p>\r\n<p><strong>District : SONITPUR</strong></p>\r\n<p><strong>Pincode : 784502</strong></p>\r\n<p><strong>ASSAM</strong></p>\r\n<p>Please Change the Incorrect Entry to the Correct Details given above.</p>\r\n<p>Inconvenience Regretted </p>\r\n<p>Thanking You.</p>\r\n<p> </p>\r\n<p> </p>', NULL, '', 1, 6, '', 5),
(1349, '5C286AEF699DB', '2018-12-30 12:21:27', 'SURYAA333@YAHOO.CO.IN', 9864521181, 'AA06717/AABCN9741K/12/2017 / (LEDF/F4/KU/001519/12/2018)', 'AMIT MITTAL', '', 3, '<p>I HAVE FILED A FACTORY LICENCE RENEWAL APPLICATION AND PAID AN AMOUNT OF RS. 2000 FOR THE SAME, ON 30.12.2018, THROUGH YOUR ONLINE GATEWAY. THE AMOUNT HAS BEEN DEDUCTED FROM ACCOUNT BUT NOT REFLECTED ON YOUR PORTAL DUE TO WHICH I AM NOT ABLE TO SUBMIT AND THE SAME IS TREATED AS UNSUBMITTED APPLICATION. BEFORE DIRECTING TO PAYMENT GATEWAY PAGE I GOT A POP-UP MESSAGE SHOWING ISFD-5c286716e113c AS MY CHALLAN NO. BUT THE SAME IS ALSO NOT WORKING. PLEASE RESOLVE THIS ISSUE AS SOON AS POSSIBLE.</p>', 'd4e51a7dd42dab44c9d8cb90966739ef692ffd93.jpg', '', 3, 47, '', 5),
(1350, '5C28B4EC6F63B', '2018-12-30 17:37:08', 'ckalita319@gmail.com', 9435124962, 'AA28195/AMQPK1739E/12/2018', 'CHANDAN KALITA', '', 7, '<p>I HAVE APPLIED FOR RETAIL DRUG LICENCE WITH PROPER DOCUMENTS WITH NAME AND STYLE RISHAB MEDICOS AFTER SUCCESSFUL VERIFICATION FROM YOUR END I AM NOT ABLE TO DO NEXT PHAGE. REPEATEDLY COMMON APPLICATION OPTION COMES AHEAD SHOWING PAN NUMBER AS INVALID PLEA SE GIVE ME SOLUTION</p>', '5ae0089fa675d8ddef8cc930062df45fddf1839d.pdf', '', 3, 47, '', 5),
(1351, '5C29C3593FB24', '2018-12-31 12:50:57', 'chb_tb@yahoo.com', 9954112554, 'LEDF/F4/CA/001066/11/2018', 'RAILTRACK CONCRETE PRODUCTS PVT LTD', '', 2, '<p><span xss=removed>Query By </span><span xss=removed>: Additional Chief Inspector of Factories Assam - INSPECTORATE OF FACTORIES</span><br xss=removed><span xss=removed>Subject</span><span xss=removed> : General Query</span><br xss=removed><span xss=removed>Query Message</span><span xss=removed> : You are hereby asked to submit the correct the name and address of occupier in Form No.2,Sl.No.78 and re-submit.</span></p>\r\n<p> </p>\r\n<p><span xss=removed>Replied by the Applicant </span> : Name of the Occupier: Sabyasachi Munshi Address: AE-666, SECTOR-1, PS- BIDHAN NAGAR, SALT LAKE, WEST BENGAL. ( Uploading herewith the copy of Passport of the Company Occupier for your ready reference). Requesting you to please change the name & address of the Occupier.</p>\r\n<p> </p>\r\n<p>Thanks & regards,</p>\r\n<p>CHANDAN BHATTACHARJEE</p>\r\n<p>RAILTRACK CONCRETE PRODUCTS PVT LTD</p>\r\n<p>Contact No: 9954112554 / 8638395057</p>', 'dc48cad2896b10e56e0c288ff2ef46b74c291013.pdf', '', 1, 6, '', 5),
(1352, '5C29EC02B3465', '2018-12-31 15:44:26', 'jskautomatic@gmail.com', 9435298023, 'PCB/CTE/BK/001515/12/2018', 'JAI SHREE KRISHNA AUTOMATIC SAND SCREENING AND WASHING PLANT', '', 7, '<p>Respected sir,</p>\r\n<p>as we applied to eodbassam for pollution certificate.By mistake we typed the name of the unit wrongly.In form we typed \"JAI SHREE KRISHNA AUTOMATIC SAND SCREENING AND WASHING PLANT\" ,but actually it should be \"SHREE KRISHNA AUTOMATIC SAND SCREENING AND WASHING PLANT\".</p>\r\n<p>We given the UAIN number with this query,please update the same.As a proof here i am also uploading DICC certificate.</p>\r\n<p>Thank you</p>', 'd1796911c03ef0d19783b86d444639a64aabc8a5.pdf', '', 3, 47, '', 5),
