(1365, '5C2D9841E4CAB', '2019-01-03 10:36:09', 'arunjyoti666@yahoo.co.in', 9859938213, 'RFS/F13/GG/000908/11/2018', 'Arunjyoti Hazarika', '', 7, '<div>Respected Sir/ Madam</div>\r\n<div>With due respect I would like to state that I have applied for the renewal of our society in November and our UAIN is RFS/F13/GG/000908/11/2018. When I track my application it always displayed as submitted successfully. It is clearly written in your website that the application matter will be settled within 15 days of the submission of the same, but its more than 1 month I have not got any update yet. When I called in the helpline numbers, they said that I have to contact in our district Office, but they do not know what is the name of the office I have to contact. Therefore, I want your help to proceed further.</div>\r\n<div> </div>\r\n<div>Thanking You</div>\r\n<div> </div>\r\n<div>Yours faithfully</div>\r\n<div> </div>\r\n<p><span xss=removed><strong><span xss=removed>Dr. ARUNJYOTI HAZARIKA</span></strong></span></p>', NULL, '', 3, 47, '', 2),
