(1444, '5C3ECB56ED80B', '2019-01-16 11:42:38', 'info@universalinfra.in', 8811004411, 'AA17341/AABCU1899D/06/2018', 'Universal Infraworld Pvt Ltd', '', 2, '<p><span xss=removed>Dear Sir, </span>Kindly refer to our EODB UBIN mentioned above  where we applied for permission for installation of lift which we got dated 29/12/18 as per file attached. But to our surprise, the permission was addressed to \'Gaurav Goel who is a director of the company and at its personal address\' instead of \"Universal Infraworld Pvt Ltd, NH37, Betkuchi, Opp. MRD Trade Centre, GUWAHATI-781035\" . Whereas earlier similar license applied manually, we have got in right name Universal Infraworld Pvt Ltd, enabling us to further obtain other permission.</p>\r\n<p>We will have to submit this license in many departments to obtain other permissions etc, so it will create problem for us in future.</p>\r\n<p>So we are rasing this ticket to make following changes in applicant details so that such situation does not arise in future application:</p>\r\n<p>1. Name of the applicant : Change to \"Universal Infraworld Pvt Ltd\" from \"Gaurav Goel\"</p>\r\n<p>2. Address of the Applicant : Change to \" NH37,BETKUCHI, OPP. MANIRAM DEWAN TRADE CENTRE, GUWAHATI-781035\" FROM \"H.NO. 49 B.R.Phookan Road, Bharalumukh, Near Rly gate No. 7, GUWAHATI-781009\".</p>\r\n<p>For any clarification or perusal, you can also call us at 8811004411.</p>', '0e49c92737185a7fffacdcec29e25ea58c802671.pdf', '', 3, 47, '', 5),
(1445, '5C3F055F09F25', '2019-01-16 15:50:15', 'medicinemart111@gmail.com', 7002323279, 'AA28861/ACRPD2240E/01/2019', 'SAMARJIT DUTTA', '', 3, '<p>I HAVE MADE PAYMENT OF RS. 3000/- TODAY AFTERNOON AS DRUG LICENSE FEES AGAINST UBIN NO. <strong>AA28861/ACRPD2240E/01/2019</strong><span xss=removed> </span>FROM AN SBI DEBIT CARD. THE PAYMENT HAS BEEN DEDUCTED FROM THE ACCOUNT BUT THE TRANSACTION WAS NOT SUCCESSFUL AND AS A RESULT THE FINAL APPLICATION FORM IS NOT GENERATED. WHEN I CLICK SUBMITTED APPLICATION BUTTON THEN IT IS SHOWN NO RECORDS FOUND. I AM ATTACHING THE SCREEN SHOTS OF PAYMENT PROCEDURES AND TEXT MESSAGE OF PAYMENT DEDUCTION FOR YOUR READY REFERENCE.</p>\r\n<p>KINDLY DO THE NEEDFUL TO COMPLETE THE PROCESS OR CREDIT THE AMOUNT BACK INTO THE ACCOUNT.</p>', '49183da8c93d396f66a3896d446b9a4fb741e3a2.pdf', '', 3, 47, '', 5),
(1446, '5C402A7AA6C0C', '2019-01-17 12:40:50', 'phoenixlabsindia@gmail.com', 7578009174, 'UAIN: SDC/F20/KU/000001/08/2018', 'Phoenix Laboratories', '', 7, '<p>We have applied Drug License for 10 Products through online  vide UAIN: SDC/F20/KU/000001/08/2018. In this connection we request you to kindly reject our application because of some Data\'s was entered wrongly.</p>', '4f9948bf6e50320166c804764f22a927872bed3e.pdf', '', 3, 47, '', 2),
