(1448, '5C405E0E2C04A', '2019-01-17 16:20:54', 'namsecdo.tlp@gmail.com', 8638384727, 'RFS/F15/BK/002347/01/2019', 'NATIONAL MULTI SOCIO ECONOMIC CULTURAL DEVELOPMENT ORGAINAZATION', '', 2, '<p>GOOD EVINING SIR/MADAM,</p>\r\n<p>WE ARE SUBMITIED COMMON APPLICATION FORM IN YOUR WEBSITE FOR RENUWAL NGO. WE ARE DO NOT SUBMITED AGREEMENT OF HOUSE RENT. KINDLY UPDATE THE FILE.</p>\r\n<p>THANKING YOU</p>\r\n<p>KAMAL LOCHAN RABHA, PRESIDENT OF THE NGO</p>', 'e8b4f4d257c304d1e6fb8a4af3e40f21861d135f.pdf', '', 3, 47, '', 5),
(1449, '5C407A28B5960', '2019-01-17 18:20:48', 'samarjitdey007@gmail.com', 8638987808, 'AA28753/BAAPD4681F/01/2019', 'SAMARJIT DEY (CANDID LIFECARE)', '', 3, '<p>SIR, I HAVE APPLIED FOR DRUG LICENSE VIDE UBIN NO. AA28753/BAAPD4681F/01/2019 AND I MADE THE PAYMENT OF REQUISITE FEES OF RS. 3000.00 ON 12.01.2019. THE SAID AMOUNT HAS BEEN DEDUCTED FROM MY ACCOUNT BUT THE PROCESS OF APPLICATION REMAINED INCOMPLETE, SO BOTH THE ONLINE CHALLAN AND APPLICATION WAS NOT GENERATED. THEN AGAIN I PAID THE SAID FEES OF RS. 3000.00 ON 16.01.2019 WHICH WAS SUCCESSFUL VIDE CHALLAN NO. WAS SDCA-5c3f3bce3cab6. </p>\r\n<p>I AM ATTACHING THE TEXT MESSAGE OF BOTH THE TRANSACTION AS A PROOF OF PAYMENT. SO I AM REQUESTING YOU TO DO THE NEEDFUL AT THE EARLIEST TO REFUND THE AMOUNT OF FIRST TRANSACTION OF RS. 3000.00.</p>\r\n<p>WITH REGARDS</p>\r\n<p>SAMARJIT DEY</p>\r\n<p>CANDID LIFECARE</p>', '7d6933aed878ce4f7179a2f05aecbad6b19835fa.pdf', '', 3, 47, '', 5),
(1450, '5C407D254FFA3', '2019-01-17 18:33:33', 'info@universalinfra.in', 8811004411, 'AA17341/AABCU1899D/06/2018', 'Universal Infraworld Pvt Ltd', '', 2, '<p>Please treat <span xss=removed>Ticket (#5C3ECB56ED80B) as unresolved. We have visited the department before first writing to you and they said that they cannot do anything about it. May be i make him talk on your number, then may be they correct. </span></p>\r\n<p><span xss=removed>But the main problem is that there are various departments in EODB which means everytime we will have to go through tedious process of correction. Please try to understand, that in our permission, nowhere the main entity is mentioned \"Universal Infraworld Pvt Ltd\".</span></p>\r\n<p><span xss=removed>Universal - Betkuchi is a different entity whereas Gaurav Goel - Bharalumukh is a different entity.</span></p>\r\n<p><span xss=removed>Hope you have seen my sample permission with correct name.</span></p>\r\n<p><span xss=removed>Assuming that next deaprtment may give correct permission as Director - Universal but in that case you will have to change CAF applicant address to </span><span xss=removed>\" NH37,BETKUCHI, OPP. MANIRAM DEWAN TRADE CENTRE, GUWAHATI-781035\" FROM \"H.NO. 49 B.R.Phookan Road, Bharalumukh, Near Rly gate No. 7, GUWAHATI-781009\".</span></p>', NULL, '', 3, 47, '', 5),
(1451, '5C40B9F13FB20', '2019-01-17 22:52:57', 'jayanta.sarma@marico.com', 8876517312, 'SDC/F58/KU/000120/11/2018', 'jayanta kumar sarma', '', 2, '<p>Hi Sir,</p>\r\n<p>I have submitted one application Via UAIN No-SDC/F58/KU/000120/11/2018, Product Name- HAIR & CARE FRUIT OILS WITH MULTI-VITAMINS OLIVE, MOSAMBI & GREEN APPLE. In formulation column Serial No 10 I have <strong>wrongly</strong> mentioned Perfume IB Olive (QS w/v). It should be only <strong>Perfume (QS W/V).</strong> Requesting you to remove \"<strong>IB - Olive</strong>\" from the application form.Rest is OK.</p>\r\n<p>I shall be thankful if you remove the word \"<strong>IB - Olive</strong>\".<u></u></p>\r\n<p> </p>', NULL, '', 3, 47, '', 5),
