(1462, '5C42C22EC277B', '2019-01-19 11:52:38', 'konnect.pmc@gmail.com', 7002730499, 'RFS/F1/GP/000888/12/2018', 'Jagadish Rabha', '', 7, '<p>My application is rejected without giving me any reason. The system is so complicated at first inspite that we submitted all the documents as required for last the 3 queries they were asking for form 1 with date of establishment which was duly noted in the form and as such documents where submitted but they are rejecting the application saying the form 1 dates are wrong. As my understanding form 1 is generated by the system when we submit all the documents and date of establishment is same both in form 1 system generated form 1 physical scan copies and in the registered deed of partnership.</p>', NULL, '', 3, 47, '', 5),
(1463, '5C42C65C98D87', '2019-01-19 12:10:28', 'bnjysangha@gmail.com', 7670039731, 'RFS/F15/NB/002390/01/2019', 'BRAHMAPUTRA NAVA JYOTI YUVA SANGHA', '', 3, '<p>Respected Sir/Madam,</p>\r\n<p>I have the honour to inform you that I have wrongly submitted Challan Number. Correct Challan Number Is-2996 but Wrongly Enter is-2995. Name of the bank-State Bank of India, Nalbari Brach, Date-17/01/2019. But sir, I have Browse file is Correctly. This is for your kind information and necessary action please.</p>\r\n<p>Thanks and Regards.</p>\r\n<p>Nabur Uddin Ahmed,</p>\r\n<p>Secretary, Brahmaputra Nava Jyoti Yuva Sangha.</p>\r\n<p>Vill-Khagrakati, P.O-Peardhara, Dist-Nalbari, Assam, Pin-781312.</p>', 'b8a1df67190596dee994c1dd3f099c3ec96dfb74.pdf', '', 3, 47, '', 5),
