(1466, '5C4559784C808', '2019-01-21 11:02:40', 'dilip.kalita@nilons.net', 7002011275, 'AA25867/AABCBCN8601N/11/2018', 'NILONS ENTERPRISES PVT. LTD', '', 3, '<p> </p>\r\n<p class=\"MsoNormal\">Dear Sir/Madam,</p>\r\n<p class=\"MsoNormal\">                        This is to inform you that we applied for renewal our Boiler certificate through EODB portal and in the payment gate we paid the requisite amount Rs.4500 through online. The amount has been deducted from our account but still in the portal the amount is reflecting and application submission is showing 79% complete. We talked to your customer help line it was told the payment will reflect after 72 hrs. but  96 hrs. have been passed still the same position. Later, on 10.12.18 we have paid the amount through offline mode as it became late to submit the application.  </p>\r\n<p class=\"MsoNormal\">                        Kindly, do the needful to return the amount. Statement is attached herewith for your ready reference.</p>\r\n<p> </p>', '6ab751538f3cf01c646e7dd1c1495adbfff16cae.pdf', '', 3, 47, '', 5),
(1467, '5C455BC2574BE', '2019-01-21 11:12:26', 'swastikpharma.assam@gmail.com', 7896186702, 'RFS/F1/UD/000729/10/2018', 'THE SWASTIK PHARMACEUTICALS', '', 6, '<p>Dear Sir/ Mam,</p>\r\n<p>           We would like to say that we have received Certificate of Registration. By mistake we have applied Nature of Business as \"Wholesale Business\' whereas it should be \'Retail Business\'. You are requested to kindly rectify the same same and re-send our Certificate of Registration. Our Trade License is attached herewith for your ready reference.</p>\r\n<p>                      Thanking you,</p>\r\n<p>                      Yours faithfully,</p>\r\n<p>                       For, The Swastik Phramaceuticals</p>\r\n<p> </p>', 'c6b246e8bc8256a95cd61e2ac671a2c7e3561a07.pdf', '', 3, 47, '', 5),
(1468, '5C456532EB87C', '2019-01-21 11:52:42', 'binaniteaindustries@gmail.com', 8638104074, 'AA02217/ACTPB1164H/05/2017', 'BINANI TEA & INDUSTRIES', '', 2, '<p>While filling the Common Application Form the mistake which was displayed in the category of  Othe Details option No 11 Category of enterprise based on pollution was Other , but its correct option should be Green Category. So We kindly request yoiu to please provide us the option to change the Category or if it is possible from your end to make the changes kindy do the needful.</p>\r\n<p> </p>\r\n<p> </p>', NULL, '', 3, 47, '', 5),
