(1477, '5C46C4A28B7F7', '2019-01-22 12:52:10', 'magu@cnggroup.in', 9830926869, 'DOA/F23/KM/000090/01/2019', 'CNG AGROCARE PRIVATE LIMITED', '', 2, '<p>Application for Whole Sale Licence of Fertilizer</p>\r\n<p>Point No. 4 (Details of Fertilizer And Their source in Form \'O\') :</p>\r\n<p>please add Comapany Name in Bracket (CNG AGROCARE PRIVATE LIMITED) along with the name of all Fertilizers name. </p>\r\n<p>For Example:</p>\r\n<p>1) Vermi Compost (CNG AGROCARE PRIVATE LIMITED)</p>\r\n<p>2) Organic Manure (CNG AGROCARE PRIVATE LIMITED)</p>\r\n<p>3) ....</p>\r\n<p>4) .....</p>', 'cb519d04e4ed1d1d00971e9da634d86fdc1308c9.pdf', '', 3, 47, '', 5);
