(1532, '5C54138A34B6C', '2019-02-01 15:08:18', 'baruah031964@gmail.com', 9954768437, 'UBIN- AA12971/BNFPB5418L/03/2018', 'ASSR STONE INDUSTRIES', '', 2, '<p>Dear Sir,</p>\r\n<p>I hereby want to inform you that we did a mistake in Common Application Form in the Name of Proprietor. As our manager did the registration so he registered in his name with his documents by mistake. Moreover our firm is Partnership. There are two partners of our firm- 1) Suchan Gogoi 2) Ajoy Kumar Gogoi. The Pan Card, Authorization Letter and Address Proof of Authorized person are attached for your record and reference. Also the Factory License is attached for your record and reference. Hereby, I request you to change the name of the Proprietor. This is for your record and reference.</p>\r\n<p>Thanking you,</p>\r\n<p>Suchan Gogoi</p>\r\n<p>For ASSR Stone Industries</p>', 'ffc806ad7376f3c7057c33ce2d804219a15e1cf0.pdf', '', 3, 47, '', 4),
