(1539, '5C581B205ED16', '2019-02-04 16:29:44', 'senprasenjit5@gmail.com', 9435072446, 'AAA30039/BUSPS3406F/02/2019', 'JAYEETA SEN', '', 3, '<p>SIR/MADAM</p>\r\n<p>I HAVE MADE PAYMENT OF RS. 3000.00 AS DRUG LICENSE FEES VIDE MY UBIN NO. AAA30039/BUSPS3406F/02/2019 ON 04.02.2019. THE PAYMENT HAS BEEN DEDUCTED FROM MY ACCOUNT BUT MY APPLICATION FORM/RECEIPT IS NOT GENERATED. THEN I TRIED TO CHECK THE APPLICATION STATUS BY CLICKING SUBMITTED APPLICATION WHERE IT HAS SHOWN \"NO RECORDS FOUND\". THE SCREEN SHOT OF THE STEPS OF PAYMENT IS ATTACHED FOR YOUR READY REFERENCE.</p>\r\n<p>KINDLY DO THE NEEDFUL AS EARLY AS POSSIBLE.</p>\r\n<p> </p>\r\n<p>REGARDS</p>\r\n<p>JAYEETA SEN</p>\r\n<p>PRIME MEDICOS</p>', '8d0b6a566f762ed8ae2dbdb84085deb4548972b1.pdf', '', 3, 47, '', 5),
