(1578, '5C6113704A876', '2019-02-11 11:47:20', 'medikar2010@yahoo.com', 9531383584, 'AA30279/AERPK8130Q/02/2019', 'RASARAJ KAR', '', 2, '<p>SIR,</p>\r\n<p>I HAVE REGISTERED AND SUBMITTED THE COMMON APPLICATION FORM FOR OBTAINING DRUG LICENSE IN THE NAME AND STYLE \"MEDI FORTE\". BUT SIR I WANT TO CHANGE THE NAME OF THE FIRM AS \"MEDIFORTE INDIA\". AS FRESH REGISTRATION CANNOT BE SUBMITTED WITH SAME PAN CARD, SO KINDLY SUGGEST WHAT IS THE PROCEDURE TO MAKE THE NECESSARY CHANGES . </p>\r\n<p>EAGERLY WAITING FOR YOUR  KIND AND EARLY RESPONSE IN THIS REGARD.</p>\r\n<p>THANKING YOU</p>\r\n<p>RASARAJ KAR</p>\r\n<p> </p>', NULL, '', 3, 47, '', 5),
(1579, '5C6120303993B', '2019-02-11 12:41:44', 'medikar2010@gmail.com', 9531383584, 'AA30279/AERPK8130Q/02/2019', 'RASARAJ KAR', '', 2, '<p>SIR,</p>\r\n<p>WITH REFERENCE TO TICKET NO. <span xss=removed>5C6113704A876, I THANK YOU VERY MUCH FOR YOUR EARLY AND PROMPT RESPONSE IN RESOLVING MY ISSUE. BUT I JUST WANT TO CLEAR ONE MORE CONFUSION i.e. AFTER LOGIN, IN THE UPPER RIGHT CORNER THE PROFILE NAME STILL REMAINED \"MEDI FORTE\". WILL IT AFFECT IN ANY FORM AND WHAT NAME WILL BE PRINTED IN THE DRUG LICENSE.</span></p>\r\n<p><span xss=removed>THANKS AND REGARDS</span></p>\r\n<p><span xss=removed>RASARAJ KAR</span></p>\r\n<p> </p>', 'ab29d91db1a63950ec959a135aa5270b2bd259f1.jpg', '', 3, 47, '', 5),
(1580, '5C6127B37CA77', '2019-02-11 13:13:47', 'mdfassam@gmail.com', 9854003003, 'RFS/F13KM/000269/06/2018', 'Mushroom Development Foundation', '', 7, '<p>Respected Madam/Sir,</p>\r\n<p>With humble submission, I want to inform you that I forgot my user ID and Password and can\'t access my application form.</p>\r\n<p>I therefore kindly request you to regenerate my ID and Password and thereby oblige.</p>\r\n<p>thanks and regards.</p>', NULL, '', 3, 47, '', 5),
(1581, '5C612A440027F', '2019-02-11 13:24:44', 'buddha201819@gmail.com', 8638889736, 'RFS/F15/KM/002462/01/2019', 'BUDDHA MANDIR AREA DEVELOPMENT COMMITTEE', '', 2, '<p>SIR/MAM</p>\r\n<p>   I HAVE UPLOAD A FILE NAME WAS \"BUDDHA MANDIR AREA DEVELOPMENT COMMITTEE\" BUT MISTAKE  THE EXCUTIVE COMMITTE IN 3..</p>\r\n<p>MEMBERS.. SO I WRITE ALL EXCUTIVE MEMBER.. PLZ KINDLY SOLVE THIS</p>\r\n<p>                                                                                                                  YOURS FAITHFULLY</p>\r\n<p>                                                                                                                    GOKUL BAUMATARY</p>\r\n<p> </p>\r\n<p> </p>\r\n<p>EXE-COMITY ISGIVEN BELEOW...</p>\r\n<p>    NAME                                          ADDRESS                                      OCCUPATION                       DISIGATION         </p>\r\n<p>  BHIKKHU PHICA SASANA        KALYANI NAGAR MALIGAON                      BUSINESS                           PRESIDENT</p>\r\n<p>  GAKUL BASUMATRY                KALYANI NAGAR MALIGAON                      BUSINESS                          SECRETARY      </p>\r\n<p>  SIBJIEE MAHATO                    KALYANI NAGAR MALIGAON                      BUSINESS                          TREASURER</p>\r\n<p>  RAM PR SARMA                       KALYANI NAGAR MALIGAON                      BUSINESS                          VICE PRESIDENT</p>\r\n<p>  RAJANI DAS                            KALYANI NAGAR MALIGAON                      BUSINESS                          ASST SECREATARY</p>\r\n<p>  GANESH NARZARY                   KALYANI NAGAR MALIGAON                      BUSINESS                             MEMBER</p>\r\n<p>   UMA DEY                                KALYANI NAGAR MALIGAON                      BUSINESS                             MEMBER</p>\r\n<p>    PHUL KR DEY                         KALYANI NAGAR MALIGAON                       BUSINESS                             MEMBER</p>\r\n<p>    SANK