(1583, '5C613C617EAA3', '2019-02-11 14:42:01', 'sitalkdhar1947@gmail.com', 9101611945, 'nil', 'SITAL KRISHNA DHAR', '', 7, '<p>SIR,</p>\r\n<p>WE HAVE ACQUIRED THE \"CONSENT TO OPERATE\" CERTIFICATE PREVIOUS YEAR BY APPLYING ONLINE UNDER POLLUTION DEPARTMENT FOR OUR DIAGNOSTIC CENTRE IN THE NAME \'AAR GEES MEDICARE\". THIS YEAR WE HAVE CHANGED THE ADDRESS OF THE FIRM AND THE DEPARTMENT HAS ADVISED US TO APPLY FRESH FOR \"CONSENT TO OPERATE\". IN THAT CASE WE TRIED TO CREATE A NEW ACCOUNT BY REGISTERING AFRESH KEEPING THE SAME NAME OF THE FIRM, BUT WHILE FILLING THE CAF THE PAN NO. OF THE FIRM IS NOT ACCEPTED AS IT IS ALREADY REGISTERED.</p>\r\n<p>MY QUESTION IS CAN ANOTHER APPLICATION OF THE FIRM BE SUBMITTED CHANGING THE ADDRESS AND OTHER DETAILS UNDER SAME CAF? IF SO WHAT IS THE PROCEDURE.</p>\r\n<p>REGARDS</p>\r\n<p>SITAL KRISHNA DHAR</p>\r\n<p>PARTNER,</p>\r\n<p>AAR GEES MEDICARE</p>', NULL, '', 3, 47, '', 2),
