(1590, '5C62967EAF14A', '2019-02-12 15:18:46', 'bjbd13@gmail.com', 9706209328, 'AA30379/AQJPD0441P/02/2019', 'BIJOY DEY', '', 3, '<p>SIR,</p>\r\n<p>I HAVE APPLIED FOR DRUG LICENSE (WHOLESALE) VIDE UBIN NO. AA30379/AQJPD0441P/02/2019 AND PAID THE  FEES OF RS. 3000/-. THE SAID AMOUNT IS DEDUCTED BUT THE PROCEDURE IS NOT COMPLETED SO I DID NOT GET THE CHALLAN AND FILLED UP APPLICATION FORM. ALSO AFTER LOGIN WHEN I CLICKED  THE SUBMITTED APPLICATION OPTION, IT SHOWN \"NO RECORDS FOUND\".</p>\r\n<p>I AM ATTACHING THE SCREEN SHOTS OF THE PAYMENT STEPS FOR YOUR READY REFERENCE.</p>\r\n<p>KINDLY DO THE NEEDFUL AS EARLY AS POSSIBLE SO THAT THE PROCEDURE IS COMPLETED.</p>\r\n<p> </p>\r\n<p>REGARDS</p>\r\n<p>BIJOY DEY</p>\r\n<p>B D DRUG DISTRIBUTOR</p>', '9a60b6b76befa509906015292df2db2ab164482c.pdf', '', 3, 47, '', 5),
(1591, '5C62C10C04554', '2019-02-12 18:20:20', 'doyaporeteaestate@rediffmail.com', 8011768538, 'LEDF/F4/CA/000687/11/2018', 'Doyapore Tea Estate', '', 2, '<p>1. We have to change the name of factory in Sr. No. 1. We have wrongly written their Company name. Correct name will be \"<span xss=removed><strong>Doyapore Tea Estate</strong></span>\".</p>\r\n<p>2. Name of Occupier will be changed to \"<span xss=removed><strong>Mohit Agarwal</strong></span>\" instead of Subhash Pareek.</p>\r\n<p>Kindly correct the form accordingly.</p>\r\n<p>Regards.</p>', NULL, '', 3, 47, '', 2),
