(1593, '5C63AFB35767B', '2019-02-13 11:18:35', 'chakrabortymonika449@gmail.com', 9435070720, 'AA30297/AQWPC8268J/02/2019', 'MONIKA CHAKRABORTY', '', 3, '<p>SIR, I HAVE APPLIED FOR RETAIL DRUG LICENSE AND PAID THE REQUISITE FEES OF RS. 3000/- BUT THE CHALLAN OR APPLICATION FORM IS NOT GENERATED EVEN THOUGH THE SAID AMOUNT IS DEDUCTED. I AM ATTACHING THE SCREEN SHOT OF THE PAYMENT STEPS FOR YOUR KIND REFERENCE. KINDLY DO THE NEEDFUL AS EARLY AS POSSIBLE TO COMPLETE THE PROCEDURE.</p>\r\n<p>REGARDS</p>\r\n<p>MONIKA CHAKRABORTY</p>\r\n<p>FOR MONIKA MEDICOS</p>', '4ab4f997a0d3a7b445bab3424ced0cd4356127d7.pdf', '', 3, 47, '', 5),
