(1599, '5C65462C6FC78', '2019-02-14 16:12:52', 'chakraborty.sandip121@gmail.com', 8473920438, 'DOA/F30/KM/000007/11/2018', 'NACL INDUSTRIES LIMITED', '', 6, '<p>Dear Sir,</p>\r\n<p>We wish to inform you that we want to change our Company\'s name from NAGARJUNA AGRICHEM LIMITED to NACL INDUSTRIES LIMITED.</p>\r\n<p>Please note that our pesticides license no. Agri/Dev/PP/DL/84(B)/2017-18/27 DT 13-04-2018  in the name of NAGARJUNA AGRICHEM LIMITED will be expired on 31/12/2019.</p>\r\n<p>Kindly change our existing Pesticides License in the name of NACL INDUSTRIES LIMITED</p>\r\n<p> </p>\r\n<p>Please do the needful.</p>\r\n<p> </p>\r\n<p> </p>\r\n<p> </p>', '3d9ee5a8b1a935c8a159518a8a8a7931eaff9576.pdf', '', 3, 47, '', 2),
(1600, '5C655C41F306E', '2019-02-14 17:47:05', 'swapnil.das@tajhotels.com', 9127009643, 'AA03208/AAACT3957G/08/2017', 'THE INDIAN HOTELS COMPANY LIMITED', '', 2, '<p class=\"MsoNormal\" xss=removed>This is to inform that the Applicant/Authorised Person of Vivanta, Guwahati (A unit of The Indian Hotels Company Limited and registered under UBIN: AA03208/AAACT3957G/08/2017) Mr. KRISHAN KANT AGGARWAL, the previous General Manager had handed over his charges to Mr. ASHWANI KUMAR ANAND the current General Manager.</p>\r\n<p class=\"MsoNormal\" xss=removed>We now want to make changes in our profile accordingly and hereby raising a Ticket for the same in the EODB system.</p>\r\n<p class=\"MsoNormal\" xss=removed>In this regard we are uploading the necessary documents.</p>\r\n<p class=\"MsoNormal\" xss=removed>We would be very grateful if you mandate the changes accordingly as we require to raise some UAINs (submit applications) at our earliest. <span xss=removed> </span></p>', 'f492801349f8b4c09781e792888bd3b80baa053f.jpg', '', 1, 48, '', 5),
(1601, '5C65678FA0773', '2019-02-14 18:35:19', 'khan_brothers40@yahoo.in', 9435116836, 'AA30606/AAACD0097R/02/2019', 'ATIQUEL KHAN', '', 6, '<p>SHRIRAM FERTILIZERS & CHEMICALS AND SHRIRAM BIOSEED GENETICS A GROUP OF DCM SHRIRAM COMPANIES BELONG ONE PAN CARD </p>\r\n<p>SHRIRAM FERTILIZERS & CHEMICALS ALREADY APPLIED FOR RENUWAL OF THEIR LICENSE WITH DCM SHRIRAM PAN CARD. NOW WE ARE GOING TO RENUWAL OUR SEED LICENSE OF SHRIRAM BIOSEED GENETICS WITH SAME PAN CARD AFTER UPLOADING WE FOUND ALL PREVIOUS DATA OF SHRIRAM FERTILIZERS & CHEMICALS. SO WE ARE UNABLE TO SUBMIT OUR DOCUMENTS OF SHRIRAM BIOSEED GENETICS. KINDLY NECESSARY ARRANGEMENT TO SUBMIT OUR DOCUMENTS AND OBLIGE</p>\r\n<p>THANKING YOU</p>\r\n<p>WITH REGARDS </p>\r\n<p>ATIQUEL KHAN</p>', NULL, '', 3, 47, '', 2),
(1602, '5C656BF55CB88', '2019-02-14 18:54:05', 'Pradhanr8617735947@gmail.com', 8617735947, 'DEE/F1/ST/000008/02/2019', 'Rajesh Pradhan', '', 3, '<p>Dear sir,</p>\r\n<p>I have done online payment for treasury challan for the above uain. My money is deducted but transaction is not successful. Please help me on this.</p>', NULL, '', 3, 47, '', 5),
