(1635, '5C6B93D5313FF', '2019-02-19 10:57:49', 'bkmodi49@rediffmail.com', 9435050350, 'RFS/F1/UD/001014/02/2019', 'NALAPARA TEA COMPANY', '', 6, '<p xss=removed>Dear Sir,</p>\r\n<p xss=removed> </p>\r\n<p xss=removed>We are submit a appication on 05/02/2019 to <span xss=removed>REGISTRAR OF FIRMS & SOCIETIES vide above mentioned UAIN no. But till today no any response from the concern department.  So we raise a ticket vive Ticket No </span>5C692635CED49 which was replied by Mr. Sanjay Kumar Singha on 18.02.2019. As per your instraction we contact Mr Ghana Kt. Pegu, Nodls Officer, <span xss=removed>Registrar of Firms & Societies, Assam,</span> several time by figical and by Phone. but no any positive response from their side. So again we request you to kindly solve our problem as early as possible. </p>\r\n<p xss=removed> </p>\r\n<p xss=removed><span xss=removed>Thanks & regards</span></p>\r\n<p xss=removed><span xss=removed>B.K. Modi</span></p>', NULL, '', 3, 47, '', 5),
(1636, '5C6BA617DC48F', '2019-02-19 12:15:43', 'selfgravity@gmail.com', 9435342305, 'AA20527/AACAB47008K/08/2018', 'Dr Iresh Ranjan Bhattacharjee', '', 2, '<p>\"The I3GB Foundation\" is not an unit of \"Brahmon Sobha\". The \"The I3GB Foundation\" is independent unit and is engaged in science and education related activities.</p>\r\n<p>The address of \"The I3GB Foundation\" is clubbed with the address given in the BRAHMON SOBHA, which is not correct. </p>\r\n<p>Rest anomalous issues deserve to be resolved in personal presence- (when attended).</p>', NULL, '', 3, 47, '', 2),
