(1693, '5C7630300813B', '2019-02-27 12:07:36', 'ddcogau@gmail.com', 9508610100, 'RFS/F16/KM/000041/12/2018 ', 'South Sarania', '', 3, '<p class=\"MsoNormal\">Dear Sir/madam.</p>\r\n<p class=\"MsoNormal\"> </p>\r\n<p class=\"MsoNormal\">It’s a pleasant request to solve our matter at the earliest.</p>\r\n<p class=\"MsoNormal\">As talked over phone previously, I have payment made a payment of Rs 10.90/-  to registration of Firms & Societies.</p>\r\n<p class=\"MsoNormal\"> </p>\r\n<p class=\"MsoNormal\">UAIN NO.<strong> RFS/F16/KM/000041/12/2018</strong></p>\r\n<p class=\"MsoNormal\"> </p>\r\n<p class=\"MsoNormal\">But due to Link Disturbance  I have not got the E-Challan. And  amount got deducted from the bank ( attached Statement).</p>\r\n<p class=\"MsoNormal\"> </p>\r\n<p class=\"MsoNormal\">Your office previously  asked me to upload the Bank Statement instead Challan is not generated.</p>\r\n<p class=\"MsoNormal\">Now Dept of Registration has given a warning if the same statement is being uploaded then application will be rejected ( attached Screen Shot).</p>\r\n<p class=\"MsoNormal\"> </p>\r\n<p class=\"MsoNormal\"><strong><span xss=removed>Please take the matter seriously, ITS OUR KIND REQUEST</span></strong></p>\r\n<p class=\"MsoNormal\"><strong><span xss=removed> </span></strong></p>\r\n<p class=\"MsoNormal\"><span xss=removed>Regards,</span></p>\r\n<p class=\"MsoNormal\"><span xss=removed> </span></p>\r\n<p class=\"MsoNormal\"><span xss=removed>Bhupendra & Co</span></p>\r\n<p class=\"MsoNormal\"><span xss=removed> </span></p>\r\n<p class=\"MsoNormal\"><span xss=removed>Guwahati</span></p>\r\n<p class=\"MsoNormal\"><span xss=removed> </span></p>', '6365d4ba822ef480d1e34b7976e245a134198652.pdf', '', 3, 47, '', 5),
