(1696, '5C7652786D4F0', '2019-02-27 14:33:52', 'rejabulkarim02@gmail.com', 7662864077, 'UBIN : AA10287/CTRPK9649D/02/2018', 'REJAUL KARIM', '', 2, '<p>I want to change my Distributor name instead of M/S SARKAR DRUG DISTRIBUTOR namely - M/S LEZA DRUG DISTRUBUTOR</p>\r\n<p>and</p>\r\n<p>1. Date of commencement will be 01-04-2019</p>\r\n<p>2. House  no. instead of 151 will be 01</p>\r\n<p>3. Sub-division will be NAGAON instead of Kaliabor</p>\r\n<p>4. Estimated number of employees currently being employed will be LESS THAN 5 instead of 5 to 10</p>', NULL, '', 3, 47, '', 5),
(1697, '5C7677806ECD5', '2019-02-27 17:11:52', 'safety_pipeline@oilindia.in', 9435711886, 'AA20681/AAACO2352C/08/2018', 'Mallika Baruah Sarma, Oil India Limited', '', 7, '<p> </p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Sir,</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Presently  for  submission of online application with regard to Consent to Operate, Hazardous Waste authorisation, etc.  Oil India Limited is registered under the designation, adress, email add., telephone number ,etc. of  Chief General Manager (HSE), Field Headquarter(FHQ) ,Duliajan  under ease of doing business in Assam portal . We would like to inform you that Field Headquarter of Oil India LImited situated at Duliajan  is  a separate unit and  Pipeline Headquarter of Oil India Limited  situated at Guwahati  headed independently by Chief General Manager (PLS) is also a separate unit and do not come under the FHQ of OIL at Duliajan. </span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Hence though OIL is registered under EODB, a separate registration in the system for Pipeline is not possible(as  we are to register with PAN card and OIL is having only one PAN number) . Therefore attempt had been made by Pipeline Unit of OIL  to submit the online application by adding the Unit under registered user id of CGM (HSE), FHQ, Duliajan. While doing so, it has been observed that final output of the form and signature is not reflected as Head of the Unit i.e. CGM(PLS) and instead it would be CGM (HSE) FHQ . Also all communications are addressed to CGM(HSE), Duliajan </span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Hence , we are <span xss=removed> </span>unable to proceed further with online application. </span> </p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>View above, we request you to kindly look into the matter and guide us in this regard so that necessary application for renewal of CTO which has already been submitted offline can now be submitted online.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>For any clarification in this regard undersigned may be contacted please at mobile No. 9435711886.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Mallika Baruah sarma</span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><span lang=\"EN-US\" xss=removed>DGM(S&E)PL</span></strong></p>\r\n<p> </p>\r\n<p> </p>', NULL, '', 1, 48, '', 5),
