(1789, '5C8B20BE2E6BC', '2019-03-15 09:19:18', 'eodb.assam@ajantapharma.com', 8811820461, 'SDC/F58/KU/000148/01/2019', 'UTPAL KALITA', '', 6, '<p>Dear Sir</p>\r\n<p>Kindly remove the highlighted part (ATTACHED FILE) from the additional products permission copy of GORGEUS BODY WASH .</p>\r\n<p>Regards</p>\r\n<p>Utpal Kalita</p>', '216685e70ea8b984f686d8137bf93e76fa7b4864.png', '', 1, 6, '', 5),
(1790, '5C8B3D937721B', '2019-03-15 11:22:19', 'bi7338125@gmail.com', 9954816849, 'SDC/F2/KM/000806/09/2018', 'BAHARUL ISLAM', '', 6, '<p>UNFORTUNATELY AT THE TIME OF ON LINE FILL UP OF APPLICATION I HAVE ENTERED THE PAN NUMBER AS \'\'AAPWI5375A\' INSTEAD OF \' AAWPI5375A\' . FOR THIS REASON IN THE ISSUED LICENSES THE UBIN NUMBER IS WRONGLY ENTERED. PLEASE REISSUE THE SAME AFTER REPLACING THE UBIN NUMBER ENTERING RIGHT PAN NUMBER</p>', '2ab6b7258f485c8d3d229d0d02a25875af49e7bb.pdf', '', 3, 47, '', 5),
(1791, '5C8B698B2ECBB', '2019-03-15 14:29:55', 'obulareddy.pbc@heterohealthcare.com', 7675043303, 'SDC/F20/KU/000177/03/2019', 'P.B.C Obula Reddy', '', 3, '<p>Dear Sir/Madam,</p>\r\n<p> </p>\r\n<p>Please confirm the online payment 1500/- for the UAIN no. <span xss=removed>SDC/F20/KU/000177/03/2019,Challan No. SDCA-5c89031dd0c42</span></p>', NULL, '', 3, 47, '', 2),
(1792, '5C8B8B30765E9', '2019-03-15 16:53:28', 'maskindia@gmail.com', 9435382361, 'RFS/F15/ST/000730/03/2019', 'Mahila Shakti Kendra ', '', 7, '<p>Sir/Madam,</p>\r\n<p>Our organization, Mahila Shakti Kendra is alredey registerd under the Registration of Societies Act XXI 1860; its registration number is <strong>RS/SPR/242/C/06 of 2005-2006</strong>, it was valid upto 30-11-2018.</p>\r\n<p>We were trying to submit an on application for Renewal of Registration of Society,but mistakenly we have submited the online application for Registration of Societies under the Societies Registration Act XXI of 1860, with the UAIN - RFS/F15/ST/000730/03/2019 .</p>\r\n<p>We have submited a new online application for Renewal of Registration of Society with the UAIN : RFS/F13/ST/001261/03/2019.</p>\r\n<p>We request you to kindly <strong>deactivate</strong>  the online application for Registration of Societies with the <strong>UAIN - RFS/F15/ST/000730/03/2019.</strong> </p>\r\n<p>Thanks- Eliza Boro; Secretary ( Mahila Shakti Kendra) </p>\r\n<p> </p>\r\n<p> </p>', NULL, '', 3, 47, '', 5),
(1793, '5C8BA949954E7', '2019-03-15 19:01:53', 'rollerskatting2019@gmail.com', 7002732788, 'RFS/F15/KM/002459/01/2019', 'ROLLER SKATING ASSOCIATION OF ASSAM', '', 2, '<p>PLEASE WRIGHT  DOWN  THE   NAME COMPLETE OF THE EXECUTIVE BODY SERIAL FROM 1 TO 19 COMMON APPLICATION FORM.</p>', '2cfd195295ac5568ce5b8f16be1b77f6af0ef3a7.pdf', '', 3, 47, '', 2),
(1794, '5C8CAACA0A569', '2019-03-16 13:20:34', 'norentamuly1@gmail.com', 8638300374, 'UBIN- AA30497/AHBPT4609C/02/2019, UAIN- DOA/F26/GG/000088/02/2019', 'NAREN TAMULY', '', 7, '<p>Dear Sir,</p>\r\n<p>During first time registration with EODB I by mistake put enterprise name as \"TAMULY STORE\". Where as it should be \"<strong>M/S Naren Tamuly</strong>\".</p>\r\n<p>So, I request you to change the enterprise name from \"TAMULY STORE\" to \"<strong>M/S Naren Tamuly</strong>\" in EODB profile.</p>\r\n<p>I am attaching following documents for your referance-</p>\r\n<p>1. Trade License renewal slip of M/S Naren Tamuly</p>\r\n<p>2. My Voter ID</p>\r\n<p>3. My PAN Card</p>\r\n<p>4. \"O\" form provided by BVFCL to M/S Naren Tamuly</p>\r\n<p> </p>\r\n<p>An early action is highly solicited.</p>\r\n<p> </p>\r\n<p>With Best Regards,</p>\r\n<p>Naren Tamuly</p>', '06d2ebea0b8692bab398255a5a840321b811a568.jpg', '', 3, 47, '', 5),
(1795, '5C8CC038B5870', '2019-03-16 14:52:00', 'nabakishore@lifecarehll.com', 9864778263, 'UAIN: SDC/F2/DM/001209/03/2019    Active UBIN : AA32177/AAACH5598K/03/2019', 'NABAKISHORE TAMULI', '', 2, '<p>Dear Admin</p>\r\n<p>Please find herein attached the UAINs where we need to correct and change the signature of <strong>JAYAKUMAR A</strong> to <strong>NABAKISHORE TAMULI</strong></p>\r\n<p><strong>1. </strong><strong>UAIN: SDC/F2/BP/001202/03/2019   </strong><span xss=removed>UBIN : AA32075/AAACH5598K/03/2019</span></p>\r\n<p><span xss=removed>2. </span><span xss=removed><span xss=removed>UAIN: SDC/F2/CH/001208/03/2019     </span></span><span xss=removed>UBIN : AA32143/AAACH5598K/03/2019</span></p>\r\n<p><span xss=removed>3. </span><span xss=removed><span xss=removed>UAIN: SDC/F2/DM/001209/03/2019     </span></span><span xss=removed>UBIN : AA32177/AAACH5598K/03/2019</span></p>\r\n<p><span xss=removed>4. </span><span xss=removed><span xss=removed>UAIN: SDC/F2/DU/001214/03/2019     </span></span><span xss=removed>UBIN : AA32217/AAACH5598K/03/2019</span></p>\r\n<p><span xss=removed>5. </span><span xss=removed><span xss=removed>UAIN: SDC/F2/TI/001217/03/2019       </span></span><span xss=removed>UBIN : AA32267/AAACH5598K/03/2019</span></p>\r\n<p> </p>\r\n<p><span xss=removed>Also find herewith attached my Identity proof, Address proof and authorisation letter (POA)</span></p>', '651b34700aa6805de073db9dc3ede83ca90dc9f3.pdf', '', 1, 48, '', 5),
(1796, '5C8CC7B6B75B6', '2019-03-16 15:23:58', 'saha.ratan11@gmail.com', 9864061107, 'RFS/F1/KM/000994/01/2019', 'RATAN SAHA', '', 2, '<p><span xss=removed>Dear Sir,</span></p>\r\n<p><span xss=removed>Please upload photos of the partners along with signatures in the online application form.</span></p>', 'b2ba3297756e8348f229897539b3088c61cc8be4.pdf', '', 3, 47, '', 5),
(1797, '5C8CD5E5DD95F', '2019-03-16 16:24:29', 'info@globalentrade.com', 9854080047, 'RFS/F16/KM/000019/06/2018', 'GLOBAL ENTRADE', '', 2, '<p><span xss=removed>Dear Sir/Madam, </span></p>\r\n<p><span xss=removed>We have to upload photographs of all the partners along with their signatures and pan card as well as 4th partners information in the Common Application Form.</span></p>', NULL, '', 3, 47, '', 5);
