(1798, '5C8CD92A01E52', '2019-03-16 16:38:26', 'hotelsjinternational@gmail.com', 7086024181, 'UBIN-AA02395/AAPCS8254G/06/2017', 'Hotel S.J. International', '', 2, '<p><span xss=removed>This is to kind inform you that we want to changes of our  applicant mail id & contact number  due to our security reason . Please apply  the email Id to</span><span xss=removed> </span><a xss=removed href=\"mailto:hotelsjinternational@gmail.com\" target=\"_blank\" rel=\"noopener noreferrer\">hotelsjinternational@gmail.<wbr>com</a><span xss=removed> </span><span xss=removed>instead of current  Email id </span><span xss=removed> </span><span xss=removed><a xss=removed href=\"mailto:envisionghy@gmail.com\" target=\"_blank\" rel=\"noopener noreferrer\">envisionghy@gmail.com</a></span><span xss=removed>  and Contact Number  7086024181  instead of current no.</span><span xss=removed> </span><span xss=removed>8811096201</span><span xss=removed> . Our  UBIN No is </span><span xss=removed><strong>UBIN : AA02395/AAPCS8254G/06/2017</strong></span></p>', '485c5b9b61e1384edef90753d32a1cefd3db9baf.pdf', '', 3, 47, '', 5),
(1799, '5C8D24002F289', '2019-03-16 21:57:44', 'monsur10@gmail.com', 9435073661, 'AA30704/BTTPS1573B/02/2019', 'FERDOSE SULTANA', '', 3, '<p>SIR, I HAVE MADE PAYMENT OF RS. 3000.00 AS DRUG LICENSE FEES BUT THE CHALLAN AND APPLICATION RECEIPT IS NOT GENERATED. THE SCREEN SHOT OF VARIOUS STEPS OF PAYMENT IS ATTACHED FOR YOUR READY REFERENCE.</p>\r\n<p>KINDLY DO THE NEEDFUL AS EARLY AS POSSIBLE.</p>\r\n<p>REGARDS </p>\r\n<p>FERDOSE SULTANA</p>', '5fc46f61b2bf91f8c057f3090bd921547a1e4e7f.pdf', '', 3, 47, '', 2),
(1800, '5C8E07A930BD2', '2019-03-17 14:09:05', 'Imranlovez4ever@gmail.com', 8876124886, 'RFS/F1/KJ/000854/11/2018', 'sona hussain Enterprise', '', 2, '<p>Change the date of establishmemt...now the date of establishment is--12-02-2018</p>', 'd8ed50dc2191631b2aaf6b4eb7ec3679b39a0145.pdf', '', 3, 47, '', 5),
(1801, '5C8F2CC1EAC2E', '2019-03-18 10:59:37', 'oikyamancha2018@gmail.com', 9435104295, 'RFS/F15/KM/002614/02/2019', 'JATIYA SANSKRITI OIKYA MANCHA ASSAM', '', 2, '<p>PLEASE CHANGE THE UAIN NO :-RFS/F15/KM/002614/02/2019 TO KAMRUP RURAL  BECAUSE THE NGO SITUATED IN THE RURAL DISTRICT OF KAMRUP WHICH WAS SUBMITTED TO THE KAMRUP METRO  BY MISTAKE.</p>\r\n<p>REQUESTED TO DO THE NEEDFUL AT AN EARLY DATE.</p>', NULL, '', 3, 47, '', 5),
(1802, '5C8F8636D2D21', '2019-03-18 17:21:18', 'nk781335@gmail.com', 8473930621, 'AA25961/CKQPK4925C/11/2018', 'NAMITA KALITA', '', 7, '<p>DEAR SIR/MAM, PL CHANGE THE NAME THE ADDRESS OF THE UNIT VIZ. <span xss=removed><strong>N K INFRA - STONE CRUSHER AND SCREENING PLANT</strong> AS FOLLOWS:</span></p>\r\n<p><span xss=removed>VILLAGE: BAR AGRA</span></p>\r\n<p><span xss=removed>PO- HATINAMATI, PS- NALBARI</span></p>\r\n<p><span xss=removed>DISTRICT- NALBARI ASSAM</span></p>\r\n<p><span xss=removed>PIN-781337.</span></p>', '181b3469adbc08f57f51473e7b5b5c9f38fba855.jpg', '', 3, 47, '', 5),
(1803, '5C8F9B7782020', '2019-03-18 18:51:59', 'globalnice2018@gmail.com', 9401320995, 'UAIN : RFS/F16/KM/000061/12/2018', 'M/S GLOBAL CONSTRUCTION CO', '', 2, '<p>please insert the date of joining on caf as 1st partner-12-12-2013, 2nd partner 06-02-2018, 3rd partner-03-03-2018 in the applicaton form.</p>', NULL, '', 3, 47, '', 5),
