(1805, '5C8FC025EA28C', '2019-03-18 21:28:29', 'arijitb_2002@rediffmail.com', 9435050975, 'AA18383/AAGTS3000A/07/2018', 'SWASTIKA', '', 2, '<p>Dear Sir/Madam,</p>\r\n<p> </p>\r\n<p>As per Query raised in the EODB portal in \"My Inbox\" section under query ref. no. RFS/F13/JO/000933/01/2019 it is mentioned to raise a ticket to request to mention Occupation in point no. 6 but what does it relate to is not known please clarify the above doubt as per convenience </p>\r\n<p>Inconvineance Caused is regreted</p>', NULL, '', 3, 47, '', 2),
(1806, '5C9086075A1DB', '2019-03-19 11:32:47', 'pinakbarpeta@gmail.com', 9435242966, 'RFS/F18/BP/000073/01/2019', 'CLUB PINAK', '', 2, '<p>Dear Sir/Madam,</p>\r\n<p>The name of our organisation is wrongly written in the Common Application Form as PINAK, But it should be written as CLUB PINAK.  Plz correct and consider the name of our Society as CLUB PINAK instead of PINAK. Submitted for favour of your kind information and neccesary action.Thanking You.</p>\r\n<p>Regard-</p>\r\n<p>Mukul Das,Secy,Club Pinak,Barpeta(Assam)</p>', NULL, '', 3, 47, '', 5),
(1807, '5C909107E9D3E', '2019-03-19 12:19:43', 'nabinchandraborah2014@gmail.com', 8011265961, 'AA10168/AHEPB5221H/02/2018', 'NABIN CHANDRA BORAH PROP  HOTEL TOKYO TOWER', '', 7, '<p>Dear Sir/Madam,</p>\r\n<p>I have forgot my user id and password in EODBassam website. Kindly sms in my registred mobile no. And also update my new email id as mentioned above i.e. nabinchandraborah2014@gmail.com.</p>\r\n<p> </p>', '8540112cd0c564c34f07ad04bc5a46bc018672ec.pdf', '', 3, 47, '', 2),
(1808, '5C90B5AA542F4', '2019-03-19 14:56:02', 'info@bvfcl.co.in', 8638012226, 'AA02295/AABCB9399R/06/2017', 'Bikramjit Talukdar', '', 2, '<p>Dear Sir,</p>\r\n<p>Kindly arrange to update the following changes:</p>\r\n<p>1. List of Directors for our company: Brahmaputra Valley Fertilizer Corporation Limited Namrup. Copy of list fof directors attached as attachment.</p>\r\n<p>2. Update the designation of Applicant Sri. Ashim Kumar Ghosh from General Manager to Director (Production). Copy of Authorisation letter enclosed as attachment.</p>\r\n<p>Thanks & Regards</p>\r\n<p>Bikramjit Talukdar</p>\r\n<p>Sr. Systems Officer</p>\r\n<p>BVFCL, Namrup.</p>', '30e51085906552ba06bdf1a6f2f5f1cee330e4b3.pdf', '', 3, 47, '', 5),
(1809, '5C90CDD3B03A8', '2019-03-19 16:39:07', 'meditechsolutions2017@gmail.com', 9864096327, 'SDC/F1/KM/001538/03/2019', 'DR. PRABHAKAR DAS', '', 2, '<p>Dear Sir/Madam,</p>\r\n<p> </p>\r\n<p>Request you to change the component name as Anwar Hussain instead of DR. Prabhakar Das</p>\r\n<p> </p>\r\n<p>Please do the needful and oblige</p>\r\n<p> </p>\r\n<p>Thanking you</p>\r\n<p> </p>\r\n<p>Regards</p>\r\n<p> </p>\r\n<p>Dr. Prabhakar Das</p>', 'f79bfd3b239d454c2465bc0fe4a3693d8b84b3cc.pdf', '', 1, 6, '', 3),
(1810, '5C90F479EAF30', '2019-03-19 19:24:01', 'neweacentral@gmail.com', 8638081008, 'RFS/F13/KM/001059/02/2019', 'Inderdeep Singh', '', 7, '<p>Sir,</p>\r\n<p><span xss=removed><em>Reference : Earlier Filed Form for Renewal is <strong>UAIN : RFS/F13/KM/001059/02/2019, Dtd. 02.02.2019</strong>(Done by Private Firm)</em></span></p>\r\n<p xss=removed>I <strong>Inderdeep Singh</strong>, Secretery of \"<strong>North East Women Enterprenurs Association</strong>\", Located at Guwahati and our <strong>Registration No. 681/94</strong>. As per new system, renewal of Society Registration has to be done online. So, our society has handed over this work to a third party(<em>Private Firm</em>) for online work. Now the Firm was untraceable for us to know the User ID and Passoword generated by them, for this we are not able to renew our Society Registration. </p>\r\n<p xss=removed>We had also tried to generated new User Id and Password for our society, but when we try to give our society PAN No. in CAF (<em>Common Application Form</em>), a pop-up message appears that the \"<em>users PAN is already exists</em>\". For that problem we are not able to file the CAF for renewal of our Society Registration.</p>\r\n<p xss=removed>So, please help us to renew our society Registration for our smooth working for social works to society.</p>\r\n<p>Thanking you,</p>\r\n<p>Inderdeep Singh</p>\r\n<p><em>Secretary</em> </p>\r\n<p><strong>North East Women Enterprenurs Association</strong></p>\r\n<p><strong>Laxmi Apartment B-12</strong></p>\r\n<p><strong>Manik Nagar, Guwhati - 22</strong></p>', '1390a516380a855c7a7ab372066acb698967605a.jpg', '', 3, 47, '', 5),
